INSERT INTO `wced_entry` VALUES (1514, "baag1", "73", "<entry page=""73"" id=""1514""><form id=""baxag"" lang=""ceb"">báag<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[APB; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> make, become <tr>embers</tr>. </trans>
<eg><i lang=""ceb"">Nagbáag (nagpabáag) akug igpaplantsa,</i><trans> I’m making embers for the iron. </trans></eg>
<eg><i lang=""ceb"">Nabáag na ang tibuuk balángay únà mahiabut ang bumbíru,</i><trans> The whole village was already in embers before the firemen arrived. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>heat</tr> s.t., become hot. </trans>
<eg><i lang=""ceb"">Nagkabáag ang kaínit sa mga táwu nga nagkaduul ang iliksyun,</i><trans> The people are becoming more and more heated up as the election approaches. </trans></eg>
<eg><i lang=""ceb"">Baága (ibáag) ra ning gátas,</i><trans> Please heat this milk. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>heat</tr>. </trans>
<eg><i lang=""ceb"">Ang báag sa adlaw mauy nakaitum kanákù,</i><trans> The heat of the sun has made me black. </trans></eg>
</sense></hom>
<entry><form id=""baag_baagbaag"" lang=""ceb""><abbr expan=""baag"" type=""lemma"">(→)</abbr>, baagbaag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c]</itype><trans> for actions to become <tr>incoherent</tr>, <tr>aimless</tr>. </trans>
<eg><i lang=""ceb"">Nabaagbaag (nabaag) ang íyang diklarasiyun,</i><trans> His declaration became senseless and incoherent. </trans></eg>
<eg><i lang=""ceb"">Nagkabaagbaag siyag panghangyù ug pakitábang,</i><trans> She went around everywhere asking for help. </trans></eg>
</sense></hom></entry>
<entry><form id=""baagbaagun"" lang=""ceb"">baagbaagun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> of an <tr>incoherent</tr> sort.
</trans>
</sense></hom></entry></entry>");
