INSERT INTO `wced_entry` VALUES (1515, "baang, baang1", "73", "<entry page=""73"" id=""1515""><form id=""baang_baxang"" lang=""ceb"">baang, báang<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B3; c]</itype><trans> <tr>plug up</tr> a hole. </trans>
<eg><i lang=""ceb"">Sagbut ang nakabaang sa imburnal,</i><trans> Garbage has choked up the sewer. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> stuff s.t. into the mouth. </trans>
<eg><i lang=""ceb"">Pakit-ag kan-unun dì ba mubáang dáyun,</i><trans> Show him s.t. to eat and he’ll shove it into his mouth instantly. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> action of opening the mouth to shove food into it.†
</trans>
</sense></hom></entry>");
