INSERT INTO `wced_entry` VALUES (1521, "babad", "73", "<entry page=""73"" id=""1521""><form id=""babad"" lang=""ceb"">babad</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> turn around on its axis. </trans>
<eg><i lang=""ceb"">Wà makababad ang pála sa pambut kay nagápus sa sámù,</i><trans> The boat propeller would not turn because seaweeds were entangled in it. </trans></eg>
<eg><i lang=""ceb"">Ibabad (babara) ang ímung kayril,</i><trans> Twirl your key chain. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>brandish</tr>. </trans>
<eg><i lang=""ceb"">Nagbabad ang pildírung kaáway sa bandírang putì,</i><trans> The defeated enemy waved the white flag.
</trans></eg>
</sense></hom></entry>");
