INSERT INTO `wced_entry` VALUES (1522, "babad1", "73", "<entry page=""73"" id=""1522""><form id=""baxbad"" lang=""ceb"">bábad<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> make a torch by binding dry strips of coconut leaves, coconut sheaths, or similar materials together. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[c1]</itype><trans> swing a torch made in this way to cause it to flare up. </trans>
<eg><i lang=""ceb"">Ibábad (babára) ang <sic corr=""sulù"">sû</sic> arun mudakù ang síga,</i><trans> Swing the torch to fan up the light.
</trans></eg>
</sense></hom></entry>");
