INSERT INTO `wced_entry` VALUES (1523, "babad2", "73", "<entry page=""73"" id=""1523""><form id=""baxbad2"" lang=""ceb"">bábad<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> <tr>immerse</tr> or soak in liquid. </trans>
<eg><i lang=""ceb"">Dì ku mubábad sa túbig kay dalì ra kung tugnawun,</i><trans> I won’t immerse myself in the water because I easily catch chills. </trans></eg>
<eg><i lang=""ceb"">Gibábad ang karni sa túyù,</i><trans> The meat was soaked in soy sauce.
</trans></eg>
</sense></hom></entry>");
