INSERT INTO `wced_entry` VALUES (1525, "babag2", "73", "<entry page=""73"" id=""1525""><form id=""baxbag2"" lang=""ceb"">bábag<sub>2</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for meals to be irregular and scanty. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A]</itype><trans> eat meals on an irregular and scanty basis. </trans>
<eg><i lang=""ceb"">Mahibalu bayà gud ku mubábag ug káun,</i><trans> I know how to make do with irregular and scanty meals. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B]</itype><trans> for meals to become irregular and scanty. </trans>
<eg><i lang=""ceb"">Nabábag ang ílang káun sa nasakit ang amahan,</i><trans> Their meals got to be irregular and scanty when their father got sick.
</trans></eg>
</sense></hom></entry>");
