INSERT INTO `wced_entry` VALUES (1538, "babuy1", "74", "<entry page=""74"" id=""1538""><form id=""baxbuy"" lang=""ceb"">bábuy<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>pig</tr>, <tr>pork</tr>. </trans>
<eg><i lang=""ceb"">Mahal ang bábuy karun,</i><trans> Pork is high now. </trans></eg>
</sense></hom>
<entry><form id=""baxbuy_ihaxlas_sulup"" lang=""ceb""><abbr expan=""bábuy"" type=""lemma"">—</abbr> ihálas, sulup</form>
<hom>
<sense n=""0""><trans> <tr>wild pig</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A12]</itype><trans> obtain a pig. </trans>
<eg><i lang=""ceb""><corr sic=""Nakababuy"">Nakabábuy</corr> aku ug tulu ka buuk sa pagbatun ku sa íyang anay,</i><trans> I got three pigs for taking care of his sow. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AP; a2]</itype><trans> </trans>
</sense>
<sense n=""a""><number>a</number><trans> corner, pin down. </trans>
<eg><i lang=""ceb"">Nakabábuy (nakapabábuy) ang mga Písi sa mga Múrus sa pulù,</i><trans> The <abbr expan=""Philippine Constabulary"">P.C.</abbr> blockaded the Moros on the island. </trans></eg>
<eg><i lang=""ceb"">Nabábuy kami tungud sa dakung bahà,</i><trans> We were blocked in because of the great flood. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> <tr>checkmate</tr> (in chess). </trans>
<eg><i lang=""ceb"">Babúyun nákù ang ímung piyun,</i><trans> I’m going to checkmate your pawn. </trans></eg>
</sense>
<sense n=""c""><number>c</number> <itype>[AP; c1]</itype><trans> tie up capital. </trans>
<eg><i lang=""ceb"">Ang ákung kwarta nabábuy sa nigusyu,</i><trans> My money is tied up in business. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> piggish, <tr>dirty</tr>. </trans>
</sense></hom></entry>
<entry><form id=""baxbuy_ug_balatixan"" lang=""ceb""><abbr expan=""bábuy"" type=""lemma"">—</abbr> ug balatían</form>
<hom>
<sense n=""0""><trans> <tr>swinish</tr>, having no moral qualms. </trans>
</sense></hom></entry>
<entry><form id=""pakabaxbuy"" lang=""ceb""><abbr expan=""pakabábuy"" type=""lemma"">paka-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a12]</itype><trans> consider, treat like a pig. </trans>
<eg><i lang=""ceb"">Gipakabábuy lang ku nímu,</i><trans> You just treat me like a pig. </trans></eg>
</sense></hom></entry>
<entry><form id=""babuyan"" lang=""ceb""><abbr expan=""babuyan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>piggery</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1]</itype><trans> have, obtain a piggery. </trans>
</sense></hom></entry>
<entry><form id=""binaxbuy"" lang=""ceb""><abbr expan=""binábuy"" type=""lemma"">-in-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> like a pig. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for a scolding to be abusive. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> treat like a pig. </trans>
<eg><i lang=""ceb"">Gibinábuy ku nílag hikut,</i><trans> They hog-tied me. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be mercilessly scolded. </trans>
<eg><i lang=""ceb"">Gibinábuy ku níyag kasábà,</i><trans> He scolded me abusively. </trans></eg>
</sense></hom></entry>
<entry><form id=""magbababuy"" lang=""ceb""><abbr expan=""magbababuy"" type=""lemma"">mag-r-(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>pig-dealer</tr>.
</trans>
</sense></hom></entry></entry>");
