INSERT INTO `wced_entry` VALUES (1543, "badbad1", "75", "<entry page=""75"" id=""1543""><form id=""badbad"" lang=""ceb"">badbad<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB123; a]</itype><trans> <tr>untie</tr>, get untied. </trans>
<eg><i lang=""ceb"">Nakabadbad ang bábuy sa íyang gihigtan,</i><trans> The pig got loose from where he was tied. </trans></eg>
<eg><i lang=""ceb"">Badbára na ang bindáhi,</i><trans> Undo the bandage. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> liquidate a debt. </trans>
<eg><i lang=""ceb"">Badbárun (badbarun) ku ang ákung útang,</i><trans> I will pay off my debts. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> <tr>solve</tr> a problem. </trans>
<eg><i lang=""ceb"">Badbárun ra nátù ang prublíma,</i><trans> We’ll solve the problem. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; a]</itype><trans> <tr>translate</tr>. </trans>
<eg><i lang=""ceb"">Ang ubra ni Línin wà pa mabadbad sa Binisayà,</i><trans> The works of Lenin have not been translated into Visayan. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>resolved</tr>, paid off. </trans>
</sense></hom>
<entry><form id=""badbaran"" lang=""ceb"">badbaran</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> skein holder, a device to hold a skein of thread as it is being reeled.
</trans>
</sense></hom></entry></entry>");
