INSERT INTO `wced_entry` VALUES (1547, "badlipanis", "75", "<entry page=""75"" id=""1547""><form id=""badlipaxnis"" lang=""ceb"">badlipánis</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> badly punished in boxing. </trans>
<eg><i lang=""ceb"">Badlipánis siya sa siks ráwun,</i><trans> He was badly punished in the sixth round. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> have undergone sexual intercourse. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AP; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> maul s.o. in boxing. </trans>
</sense>
<sense n=""2""><number>2</number><trans> have heavy sexual activity with a woman. </trans>
<eg><i lang=""ceb"">Nabadlipánis siya sa íyang bána,</i><trans> Her husband gave her a good sexual going over.
</trans></eg>
</sense></hom></entry>");
