INSERT INTO `wced_entry` VALUES (1548, "badlis", "75", "<entry page=""75"" id=""1548""><form id=""badlis"" lang=""ceb"">badlis</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB3; a]</itype><trans> draw a <tr>line</tr>, for a line to show itself. </trans>
<eg><i lang=""ceb"">Mibadlis sa íyang agtang ang dagkung ugat,</i><trans> His forehead was prominently lined with veins. </trans></eg>
<eg><i lang=""ceb"">Mibadlis sa íyang nawung ang kahadluk,</i><trans> Fear was written all over his face. </trans></eg>
<eg><i lang=""ceb"">Kinsay nagbadlis sa átung bungbung?</i><trans> Who drew a line on our wall? </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> cross out the mark made by a bettor in cockfighting as an indication that the bet is taken on. </trans>
<eg><i lang=""ceb"">Misulud aku sa galyíra ug gibadlísan ku ang naglugrug tris-idus,</i><trans> I went into the arena and I took on the bet of three to two. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> set limits to a person’s behavior. </trans>
<eg><i lang=""ceb"">Badlísan ku ning tawhána kay nagdahan ang batásan,</i><trans> I will put a stop to this guy because he’s getting worse and worse. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> lines in the skin. </trans>
</sense>
<sense n=""1a""><number>1a</number> <form id=""badlis_sa_paxlad_kinabuxhiq"" lang=""ceb""><abbr expan=""badlis"" type=""lemma"">—</abbr> sa pálad, kinabúhì</form><trans> </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>fate</tr>. </trans>
<eg><i lang=""ceb"">Mau tingáli giyuy badlis sa íyang pálad nga maminyù siyag kriminal,</i><trans> Perhaps it was her fate to marry a criminal. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>line</tr> drawn. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>Ash Wednesday</tr>. </trans>
</sense></hom>
<entry><form id=""badlis_Myirkulis_tingbadlis"" lang=""ceb""><abbr expan=""badlis"" type=""lemma"">—</abbr> Myirkulis, <abbr expan=""tingbadlis"" type=""lemma"">ting-</abbr></form>
<hom>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#badlis"">= <sc>badlis</sc>, <ix>3.</ix></xr> </trans>
</sense></hom></entry>
<entry><form id=""badlisan"" lang=""ceb""><abbr expan=""badlisan"" type=""lemma"">-an</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> having lines. </trans>
</sense>
<sense n=""2""><number>2</number><trans> name given to k.o. <ix>danggit</ix> and <ix>sapsap</ix> that have light vertical lines on the upper sides.
</trans>
</sense></hom></entry></entry>");
