INSERT INTO `wced_entry` VALUES (1570, "baga", "76", "<entry page=""76"" id=""1570""><form id=""baxga"" lang=""ceb"">bága</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>embers</tr>. </trans>
</sense></hom>
<entry><form id=""mukaxug_baxga"" lang=""ceb"">mukáug <abbr expan=""bága"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> be a tough character (eat live embers). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB; a2]</itype><trans> make, become embers. </trans>
<eg><i lang=""ceb"">Nabága (mibága) ang úling,</i><trans> The charcoal turned into embers. </trans></eg>
<eg><i lang=""ceb"">Bagáha ang úling kay mangutaw ku,</i><trans> Make embers because I’m going to iron. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2S]</itype><trans> <tr>glow</tr>. </trans>
<eg><i lang=""ceb"">Nagbaga ang plantsa,</i><trans> The iron is glowing. </trans></eg>
</sense></hom></entry>
<entry><form id=""baga"" lang=""ceb""><abbr expan=""baga"" type=""lemma"">(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b56]</itype><trans> broil small dried fish by putting them in a plate with embers and shaking them. </trans>
<eg><i lang=""ceb"">Bagaha (bagahi) ang bulinaw,</i><trans> Broil the anchovies. </trans></eg>
</sense></hom></entry>
<entry><form id=""baga"" lang=""ceb""><abbr expan=""baga"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. red fish. </trans>
</sense></hom></entry>
<entry><form id=""bagabaga"" lang=""ceb"">bagabaga</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> name given to various k.o. fish with bright red scales; soldier fish, esp. <bio>Holocentrus spp</bio>. and <bio>Myripristis spp</bio>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> k.o. centipede with bright red body. </trans>
</sense></hom></entry>
<entry><form id=""bagahan"" lang=""ceb"">bagahan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having live coals. </trans>
</sense></hom></entry>
<entry><form id=""baghanan"" lang=""ceb"">baghanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>grill</tr>.
</trans>
</sense></hom></entry></entry>");
