INSERT INTO `wced_entry` VALUES (1577, "bagal1, bagal1", "76", "<entry page=""76"" id=""1577""><form id=""bagal_baxgal"" lang=""ceb"">bagal<sub>1</sub>, bágal<sub>1</sub></form>
