<sense n=""1""><number>1</number> <itype>[AC; ac]</itype><trans> <tr>meet</tr>, esp. on the sea. </trans>
<eg><i lang=""ceb"">Nagbágat ang duha ka barku,</i><trans> The two ships met on the sea. </trans></eg>
<eg><i lang=""ceb"">Adtu níla ikabágat ang matahum nílang kaugmáun,</i><trans> There they will meet their rosy future. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AC; ac2]</itype><trans> <tr>barter</tr> products (from the notion that one goes to meet a fisherman and exchanges s.t. for his fish). </trans>
