INSERT INTO `wced_entry` VALUES (1594, "bagay", "77", "<entry page=""77"" id=""1594""><form id=""baxgay"" lang=""ceb"">bágay</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>befitting</tr>, <tr>becoming</tr>. </trans>
<eg><i lang=""ceb"">Bágay kaáyu sa íyang nawung ang antipára,</i><trans> His glasses are very becoming on his face. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for instruments to be in tune. </trans>
<eg><i lang=""ceb"">Bágay na nang ímung sista,</i><trans> Your guitar is tuned now. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> for voices to be blended. </trans>
<eg><i lang=""ceb"">Bágay kaáyu ang ílang mga tíngug,</i><trans> Their voices are well blended. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2C]</itype><trans> <tr>harmonize with</tr>, <tr>match</tr>. </trans>
<eg><i lang=""ceb"">Mibágay sa kurti sa íyang láwas ang íyang sinínà,</i><trans> Her dress is very good for her sort of body. </trans></eg>
<eg><i lang=""ceb"">Nagbágay ang íyang <sic>bag</sic> ug sapátus,</i><trans> Her bag and shoes match. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> <tr>tune</tr> musical instruments. </trans>
<eg><i lang=""ceb"">Mubágay pa ku sa sista,</i><trans> I’ll tune the guitar first. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B2; a1c3]</itype><trans> for words to rhyme. </trans>
<eg><i lang=""ceb"">Ang púlung ‘úlud’ dílì mubágay sa ‘pálad’,</i><trans> The word ‘worm’ doesn’t rhyme with ‘palm’. </trans></eg>
</sense></hom>
<entry><form id=""pamaxgay"" lang=""ceb""><abbr expan=""pamágay"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>rhyming</tr>, <tr>verse-making</tr>.
