INSERT INTO `wced_entry` VALUES (1597, "bagdal", "77", "<entry page=""77"" id=""1597""><form id=""bagdal"" lang=""ceb"">bagdal</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for a face to be too chubby to be pretty. </trans>
