INSERT INTO `wced_entry` VALUES (1604, "baghut", "78", "<entry page=""78"" id=""1604""><form id=""baghut"" lang=""ceb"">baghut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> prompt s.o. to think ill about s.t. </trans>
<eg><i lang=""ceb"">Kinsay nibaghut sa átung ámu nga ipabalhin ku?</i><trans> Who talked against me to have prompted the boss to transfer me? </trans></eg>
