<sense n=""2""><number>2</number> <itype>[A; b3c]</itype><trans> <tr>rant</tr> loudly in anger or complaint. </trans>
<eg><i lang=""ceb"">Pangutána únà unsay hinungdan. Dílì kay mubaghut ka lang dihà dáyun,</i><trans> Find out what the matter is before you go ranting and raving right away. </trans></eg>
</sense></hom>
