INSERT INTO `wced_entry` VALUES (1608, "bagis1", "78", "<entry page=""78"" id=""1608""><form id=""baxgis"" lang=""ceb"">bágis<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> be completely careless of all rules of decorum, esp. proper dress. </trans>
<eg><i lang=""ceb"">Bágis kaáyu siya kay magtiniil lang ug musimba,</i><trans> He is a hippy because he goes to church barefooted. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be grossly misbehaved in general. </trans>
</sense>
<sense n=""3""><number>3</number><trans> be a tough, ruffian. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> get to be grossly misbehaved. </trans>
</sense></hom>
<entry><form id=""binaxgis"" lang=""ceb""><abbr expan=""binágis"" type=""lemma"">-in-</abbr></form>
<hom role=""v""><pos>v</pos>
