<eg><i lang=""ceb"">Bisan ug makabinágis ka ug kausa itsapuyráhun ka,</i><trans> If you appear unkempt just once you will get kicked out. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> act as if one doesn’t care what others say. </trans>
<eg><i lang=""ceb"">Ug aku diay binagísan níya, hilatiguhan giyud,</i><trans> If he misbehaves toward me, I’ll give him a beating.
