INSERT INTO `wced_entry` VALUES (1610, "bagit", "78", "<entry page=""78"" id=""1610""><form id=""bagit"" lang=""ceb"">bagit</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13]</itype><trans> invite or provoke a bad outcome. </trans>
<eg><i lang=""ceb"">Nagbagit ka giyud sa ímung kadaútan,</i><trans> You are certainly courting disaster for yourself. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AP]</itype><trans> cause to be aroused or stimulated. </trans>
<eg><i lang=""ceb"">Kining pamisti nímu nagbagit (nagpabagit) sa yawan-ung hunàhúnà sa mga laláki,</i><trans> The way you dress arouses devilish passions in a man. </trans></eg>
</sense></hom>
