<eg><i lang=""ceb"">Nagbagitbagit ka giyud sa ímung bána niánang ímung pagkasabaan,</i><trans> You’re provoking your husband to anger with your nagging. </trans></eg>
</sense></hom></entry>
<entry><form id=""mabagitbagitun"" lang=""ceb"">mabagitbagitun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>provocative</tr>. </trans>
