INSERT INTO `wced_entry` VALUES (1617, "bagnut", "78", "<entry page=""78"" id=""1617""><form id=""bagnut"" lang=""ceb"">bagnut</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> pull out by the roots with great force. </trans>
<eg><i lang=""ceb""><corr sic=""Nagbangut"">Nagbagnut</corr> siya sa dakung káhuy,</i><trans> He pulled a big tree out by the roots. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>weeds</tr>. </trans>
<eg><i lang=""ceb"">Adtu ang mga manuk mangitlug sa tag-as nga mga bagnut,</i><trans> The chickens lay their eggs in the tall weeds. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>weedy</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> of no use, a parasite. </trans>
<eg><i lang=""ceb"">Bagnut siya sa ílang pamilya. Dílì siya mutábang sa buluhatun,</i><trans> He is a parasite in their family. He doesn’t help with the chores. </trans></eg>
</sense></hom>
<entry><form id=""bagnutun"" lang=""ceb""><abbr expan=""bagnutun"" type=""lemma"">-un(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>weedy</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>untidy</tr>. </trans>
<eg><i lang=""ceb"">Bagnutun kaáyu ang íyang hitsúra. Walay sudlay ang buhuk,</i><trans> Her appearance is very untidy. She didn’t comb her hair.
