INSERT INTO `wced_entry` VALUES (1633, "bagu1", "79", "<entry page=""79"" id=""1633""><form id=""baguq"" lang=""ceb"">bagù<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> disease characterized by general debility, swelling in the region of the stomach, and yellowish skin. It commonly occurs in swampy areas and is thought to be caused by snails or mosquitoes. </trans>
</sense></hom>
