INSERT INTO `wced_entry` VALUES (1634, "bagu2", "79", "<entry page=""79"" id=""1634""><form id=""baguq2"" lang=""ceb"">bagù<sub>2</sub></form>
<hom role=""n""><pos>n</pos>
