INSERT INTO `wced_entry` VALUES (1638, "bagudlus", "80", "<entry page=""80"" id=""1638""><form id=""bagudlus"" lang=""ceb"">bagudlus</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a roaring sound of the sea or wind. </trans>
