INSERT INTO `wced_entry` VALUES (1663, "baha", "81", "<entry page=""81"" id=""1663""><form id=""bahaq"" lang=""ceb"">bahà</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>flood</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B46; b4]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> flow in a flood, flood over. </trans>
<eg><i lang=""ceb"">Mibahà ang sapà sa kakusug sa ulan,</i><trans> The river flooded over because of the heavy rain. </trans></eg>
<eg><i lang=""ceb"">Gibahaan (gibaháan) ang ámung sílung,</i><trans> The lower portion of our house was flooded. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> come in great quantity, experience in great intensity. </trans>
<eg><i lang=""ceb"">Mubahà ang sápì karung iliksiyun,</i><trans> Money will flow this coming election. </trans></eg>
<eg><i lang=""ceb"">Gibaháan ang ákung galamhan sa túmang kalípay,</i><trans> I was overwhelmed with joy. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[a4]</itype><trans> <tr>sneeze</tr>. </trans>
<eg><i lang=""ceb"">Bahaun (bàhun) ka ug mutan-aw kas adlaw,</i><trans> You will sneeze if you look at the sun. </trans></eg>
</sense></hom>
<entry><form id=""bahaqbaxhaq"" lang=""ceb"">bahàbáhà</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1]</itype><trans> go, come in throngs and swarms. </trans>
<eg><i lang=""ceb"">Nagbahàbáhà ang mga táwu sa kadalánan kay musúgat sa Santu Pápa,</i><trans> People are flooding the streets to meet the Pope. </trans></eg>
</sense></hom></entry>
<entry><form id=""balahaxan_bahaaxnan"" lang=""ceb"">balaháan, bahaánan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans><i lang=""ceb""/> subject to floods.
</trans>
</sense></hom></entry></entry>");
