<eg><i lang=""ceb"">May báhad silang magsumbagay sa plása,</i><trans> They have an agreement to have a fight in the plaza. </trans></eg>
</sense></hom>
<entry><form id=""mabahaxrun"" lang=""ceb"">mabahárun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>threatening</tr>.
