<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>below normal</tr>, <tr>low</tr>. </trans>
<eg><i lang=""ceb"">May bagyung umalábut. Bahádu ang barumítru,</i><trans> A typhoon is coming. The barometer is below normal. </trans></eg>
