INSERT INTO `wced_entry` VALUES (1667, "bahag", "81", "<entry page=""81"" id=""1667""><form id=""bahag"" lang=""ceb"">bahag</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>G-string</tr>. </trans>
<eg><i lang=""ceb"">Dì masaghirag bahag bayhána,</i><trans> That woman is terribly fertile. (Lit. You can’t brush a g-string against her without her getting pregnant.) </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> wear, make a g-string. </trans>
<eg><i lang=""ceb"">Gibahag níya ang íyang kamisin,</i><trans> He made a g-string out of his undershirt. </trans></eg>
</sense></hom>
<entry><form id=""bahag_ang_ixkug"" lang=""ceb""><abbr expan=""bahag"" type=""lemma"">—</abbr> ang íkug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> tuck the tail between legs. </trans>
<eg><i lang=""ceb"">Mabahag ang íkug sa irù basta daug,</i><trans> A defeated dog tucks his tail between his legs. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> run away in cowardice. </trans>
<eg><i lang=""ceb"">Mibahag ang íyang íkug nga gigúkud sa íyang kaáway,</i><trans> He turned tail when his enemy pursued him. </trans></eg>
</sense></hom></entry>
<entry><form id=""bahagbahag"" lang=""ceb"">bahagbahag</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> harmless k.o. long thin <tr>jellyfish</tr>, semi-transparent, resembling a snake. Used in sorcery called <ix>sampal.</ix>
</trans>
</sense></hom></entry></entry>");
