INSERT INTO `wced_entry` VALUES (1674, "bahan", "81", "<entry page=""81"" id=""1674""><form id=""baxhan"" lang=""ceb"">báhan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> team of militia workers. </trans>
<eg><i lang=""ceb"">Tulu ka báhan sa písi,</i><trans> Three teams of constabulary men. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> type of net fishing with a large group of people. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> tie in a row, large groups. </trans>
<eg><i lang=""ceb"">Itángag ang púkut didtu sa búkung ug bunut. Unyà bahánun,</i><trans> Put the net on top of the shells and husks; then tie them in a row to the net. </trans></eg>
</sense></hom>
<entry><form id=""bahanbaxhan"" lang=""ceb"">bahanbáhan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C]</itype><trans> gang around. </trans>
<eg><i lang=""ceb"">Nagbahanbáhan na pud ang mga batan-un sa átung baryu,</i><trans> The youngsters are running around in gangs in our neighborhood. </trans></eg>
<eg><i lang=""ceb"">Dílì ku mutúgut nga makigbahanbáhan ka sa mga buguy,</i><trans> I don’t like you to gang around with those good-for-nothing fellows.
