INSERT INTO `wced_entry` VALUES (1681, "bahaw2", "82", "<entry page=""82"" id=""1681""><form id=""baxhaw2"" lang=""ceb"">báhaw<sub>2</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> left over from before and not quite fresh. </trans>
<eg><i lang=""ceb"">Ayaw aku sirbíhig báhawng pán,</i><trans> Don’t serve me old bread. </trans></eg>
<eg><i lang=""ceb"">Alisdi kanang túbig kay báhaw,</i><trans> Change this water. It’s left over from before. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> old, stale news. </trans>
<eg><i lang=""ceb"">Báhaw na nang balitáa,</i><trans> That’s old news. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> fighting cock set out to fight a second time within a day or two after having fought. </trans>
<eg><i lang=""ceb"">Báhaw na nang manúka. Lagmit bun-un nà,</i><trans> That cock is stale. Most likely he’ll be defeated. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; a2b4]</itype><trans> reserve food for some later time. </trans>
<eg><i lang=""ceb"">Baháwun ta ning bibingka,</i><trans> Let’s put these rice cakes aside for later. </trans></eg>
<eg><i lang=""ceb"">Kanúnay lang ming baháwan káda káun,</i><trans> We always have food left over each meal. </trans></eg>
</sense></hom>
<entry><form id=""pamaxhaw"" lang=""ceb""><abbr expan=""pamáhaw"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>breakfast</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> late afternoon snack consisting of rice or corn. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c6]</itype><trans> eat breakfast, late afternoon meal. </trans>
</sense></hom></entry>
<entry><form id=""pamahawbahaw"" lang=""ceb"">pamahawbahaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c2]</itype><trans> take a snack from the leftovers. </trans>
<eg><i lang=""ceb"">Dúna ba tay ipamahawbahaw dihà?</i><trans> Do we have any leftovers to have as a snack? </trans></eg>
</sense></hom></entry>
<entry><form id=""bahawbahaw"" lang=""ceb"">bahawbahaw</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. small insects that swarm over leftover food or garbage. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a4]</itype><trans> be infested with this sort of insect.
</trans>
</sense></hom></entry></entry>");
