INSERT INTO `wced_entry` VALUES (1696, "bahu1", "83", "<entry page=""83"" id=""1696""><form id=""baxhu"" lang=""ceb"">báhu<sub>1</sub></form>
<hom>
<sense n=""0""><trans> <tr>no wonder</tr>, it is not surprising considering that [subject] is what it is. </trans>
