INSERT INTO `wced_entry` VALUES (1701, "bahud", "83", "<entry page=""83"" id=""1701""><form id=""baxhud"" lang=""ceb"">báhud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2]</itype><trans> for wounds to swell and redden. </trans>
<eg><i lang=""ceb"">Mibáhud ang íyang núka kay hiinitan man,</i><trans> His wound became swollen because it was exposed to the sun. </trans></eg>
<eg><i lang=""ceb"">Ug musúd kag mintiryu mubáhud ang ímung kabahung,</i><trans> If you go into a cemetery your wound might swell and redden.
</trans></eg>
</sense></hom></entry>");
