INSERT INTO `wced_entry` VALUES (1702, "bahug", "83", "<entry page=""83"" id=""1702""><form id=""bahug"" lang=""ceb"">bahug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> put liquid or fat into the staple food. </trans>
<eg><i lang=""ceb"">Mubahug lang siyag mantíkà kay dì mukáun ug útan,</i><trans> He mixes lard with his corn because he doesn’t eat vegetables. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> feed leftovers to. </trans>
<eg><i lang=""ceb"">Ibahug na lang ang pán ngadtu sa ítik,</i><trans> Toss the bread to the ducks. </trans></eg>
</sense></hom>
<entry><form id=""binahug_binahugan"" lang=""ceb""><abbr expan=""binahug"" type=""lemma"">-in-</abbr>, <abbr expan=""binahugan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> food mixed with soup, lard, or water. </trans>
<eg><i lang=""ceb"">Ang íyang binahug (binahugan) gikaun sa irù,</i><trans> The dog ate his food mixed with soup. </trans></eg>
</sense></hom></entry>
<entry><form id=""bahugbaxhug"" lang=""ceb"">bahugbáhug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> do s.t. in large amounts. </trans>
<eg><i lang=""ceb"">Nagbahugbáhug kamig katáwa sa íla,</i><trans> We had a barrel of laughs at their house. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> have a free-for-all fight. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. done in plentiful quantities. </trans>
<eg><i lang=""ceb"">Bahugbáhug ang ínum sa kasal,</i><trans> There was drinking done on a large scale at the wedding. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> free-for-all fight.
</trans>
</sense></hom></entry></entry>");
