INSERT INTO `wced_entry` VALUES (1707, "baid", "83", "<entry page=""83"" id=""1707""><form id=""baxid"" lang=""ceb"">báid</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3P; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> rub s.t. on s.t. else to sharpen <pb n=""84""/>it to make it shiny. </trans>
<eg><i lang=""ceb"">Baírun ku ang sanggut,</i><trans> I’ll sharpen the scythe. </trans></eg>
<eg><i lang=""ceb"">Ibáid sa simintu ang batu arun masínaw,</i><trans> Rub the stone on the cement floor so that it will get shiny. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>perfect</tr> s.t. </trans>
<eg><i lang=""ceb"">Nagbáid siya sa mananayaw sa hustung panlíhuk,</i><trans> He helped the dancer perfect her steps. </trans></eg>
<eg><i lang=""ceb"">Ang diksiyunaryu mauy nakabáid (nakapabáid) sa ákung ininglis,</i><trans> The dictionary sharpened my English. </trans></eg>
</sense></hom>
<entry><form id=""bairan"" lang=""ceb"">bairan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. to sharpen s.t. </trans>
</sense></hom></entry>
<entry><form id=""baidbaxid"" lang=""ceb"">baidbáid</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13C; c]</itype><trans> brush or rub s.t. against s.t. lightly as if sharpening. </trans>
<eg><i lang=""ceb"">Nagbaidbáid siya sa íyang mga kamut,</i><trans> He rubbed his palms together.
</trans></eg>
</sense></hom></entry></entry>");
