INSERT INTO `wced_entry` VALUES (1711, "baiwas", "84", "<entry page=""84"" id=""1711""><form id=""baixwas"" lang=""ceb"">baíwas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C3]</itype><trans> for two persons to fail to meet because one had left when the other arrived. </trans>
<eg><i lang=""ceb"">Nagkabaíwas ta kay pag-abut nákù mu say paglakaw nímu,</i><trans> We missed each other because when I arrived, you had left.
