INSERT INTO `wced_entry` VALUES (1743, "bakgrawun", "85", "<entry page=""85"" id=""1743""><form id=""bakgraxwun"" lang=""ceb"">bakgráwun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>background</tr>, past experience, origin. </trans>
<eg><i lang=""ceb"">Sutáa únang íyang bakgráwun únà sugta,</i><trans> Verify his background first before you accept his proposal. </trans></eg>
<eg><i lang=""ceb"">Wà kaáyu siyay bakgráwun. Dì siya makaapas sa liksiyun,</i><trans> He doesn’t have a very good background. He cannot catch on to the lesson. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> background of painting or picture. </trans>
</sense>
<sense n=""3""><number>3</number><trans> one who is staying out of the limelight. </trans>
</sense>
<sense n=""4""><number>4</number><trans> one who assists in a performance in a lesser role. </trans>
<eg><i lang=""ceb"">Mas maáyung mukanta ang bakgráwun kay sa istar,</i><trans> The background sings better than the star. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> attendant on a public performer, manager of a sportsman. </trans>
<eg><i lang=""ceb"">Gitunúlan ang buksiadur ug tualya sa íyang bakgráwun,</i><trans> The manager gave the boxer a towel. </trans></eg>
</sense>
<sense n=""6""><number>6</number><trans> one who supports another in a fight, provides fire cover for another. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b1]</itype><trans> be the background in performing, attending a public performer, support s.o. in a fight. </trans>
<eg><i lang=""ceb"">Bakgrawnan ta kag mukanta ka,</i><trans> I’ll accompany you if you sing. </trans></eg>
<eg><i lang=""ceb"">Bakgrawni aku inigtabuk nákù,</i><trans> Cover me when I cross over to the other side of the street. </trans></eg>
</sense></hom>
<entry><form id=""pabakraxwun"" lang=""ceb""><abbr expan=""pabakráwun"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> stay out of the limelight. </trans>
<eg><i lang=""ceb"">Pabakráwun lang siya kay maúlaw siya níla,</i><trans> He will just stay in the background because he is shy.†
</trans></eg>
</sense></hom></entry></entry>");
