INSERT INTO `wced_entry` VALUES (1771, "baknal", "86", "<entry page=""86"" id=""1771""><form id=""baknal"" lang=""ceb"">baknal</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> too big for the thing it was put in. </trans>
<eg><i lang=""ceb"">Baknal kaáyu ang pistúla sa háwak,</i><trans> There is no room for the pistol in the waist. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be too big for the situation. </trans>
<eg><i lang=""ceb"">Baknal ang kaniyun nga gigámit didtu sa Bitnam,</i><trans> The cannons they use in Viet Nam are too big for the job they have to do. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB; a2]</itype><trans> <tr>bulge out</tr>, make s.t. bulge out. </trans>
<eg><i lang=""ceb"">Unsa man nang nagbaknal sa ímung bulsa?</i><trans> What is making your pocket bulge? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> put s.t. which juts up on a road to block it or cause passers-by to stumble. </trans>
<eg><i lang=""ceb"">Átung baknálan ang agiánan ug dakung batu,</i><trans> We’ll block the road with a huge stone. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b6]</itype><trans> consider s.t. too big. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. bulging or which prevents easy passage. </trans>
</sense></hom>
<entry><form id=""baknalan"" lang=""ceb""><abbr expan=""baknalan"" type=""lemma"">-an</abbr></form>
<hom>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#bakal"">= <sc>bakal</sc>, <ix>a2.</ix></xr>
</trans>
</sense></hom></entry></entry>");
