INSERT INTO `wced_entry` VALUES (1779, "baksiwa", "86", "<entry page=""86"" id=""1779""><form id=""baksiwaq"" lang=""ceb"">baksiwà</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>contrary</tr>, <tr>nonconforming</tr>. </trans>
<eg><i lang=""ceb"">Baksiwà <pb n=""87""/>nga pagkabátà,</i><trans> A contrary child. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> be contrary to, be not in conformity. </trans>
<eg><i lang=""ceb"">Mubaksiwà giyud nà siya sa gustu sa ámung inahan,</i><trans> She always does s.t. contrary to our mother’s wishes. </trans></eg>
<eg><i lang=""ceb"">Nagkabaksíwa ang ílang pangatarúngan,</i><trans> Their reasons did not tally. </trans></eg>
<eg><i lang=""ceb"">Baksiwaun (ibaksiwà) man gud nímug sabut ang ákung sulti,</i><trans> You always place a wrong meaning on what I say. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> put in a head to toe arrangement. </trans>
<eg><i lang=""ceb"">Nagbaksíwà sila paghigdà,</i><trans> They lay down beside each other with their heads on opposite ends. </trans></eg>
<eg><i lang=""ceb"">Ibaksiwà (baksiwáun) nákù ang pagpahimútang sa káhuy,</i><trans> I will arrange the wood so that the bigger ends are next to the smaller ends. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[C13]</itype><trans> pass by one another without seeing each other. </trans>
<eg><i lang=""ceb"">Wà sila magkítà kay nagkabaksíwà lang sila sa dálan,</i><trans> They did not meet because they just passed each other on the road. </trans></eg>
</sense></hom>
<entry><form id=""baksixwaq"" lang=""ceb""><abbr expan=""baksíwà"" type=""lemma"">(←)</abbr></form>
<hom>
<sense n=""0""> <itype>[B]</itype><trans> be intertwining. </trans>
<eg><i lang=""ceb"">Bágun nga nagbaksíwà,</i><trans> Intertwining vines.
</trans></eg>
</sense></hom></entry></entry>");
