INSERT INTO `wced_entry` VALUES (1816, "bala, bala1", "88", "<entry page=""88"" id=""1816""><form id=""bala_baxla"" lang=""ceb"">bala, bála<sub>1</sub></form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>bullet</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>staples</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>money</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> load gun, stapler. </trans>
<eg><i lang=""ceb"">Maáyu lang kang ibála sa kaniyun,</i><trans> You are just good for cannon fodder. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> put s.t. in s.t. to make it appear bigger or weightier. </trans>
<eg><i lang=""ceb"">Ang kupras baláhag balas,</i><trans> The copra was mixed with sand. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> <tr>mix</tr> s.t. in with s.t. else to hide it. </trans>
<eg><i lang=""ceb"">Ang pinaldung panaptun gibaláhag sigarilyu,</i><trans> The bales of cloth had cigarettes hidden inside of them. </trans></eg>
</sense></hom>
<entry><form id=""balahan"" lang=""ceb"">balahan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>loaded</tr>. </trans>
<eg><i lang=""ceb"">Pagbantay kay balahan nang pistúla,</i><trans> Be careful. That pistol is loaded.
</trans></eg>
</sense></hom></entry></entry>");
