INSERT INTO `wced_entry` VALUES (1818, "bala1", "88", "<entry page=""88"" id=""1818""><form id=""balaq"" lang=""ceb"">balà<sub>1</sub></form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> find out information about an event that has happened (who stole s.t., where s.t. stolen or lost is, who committed a crime, etc.) by means of an egg. The egg is made to stand on its end on the edge of a tumbler. Then a yes-no question is put to it. If the answer is yes, the egg remains upright. If the answer is no, the egg falls. </trans>
<eg><i lang=""ceb"">Balaun ang bábuy kay sigúrung gikáwat tu,</i><trans> We’ll <tr>divine</tr> information about the pig, because it surely was stolen. </trans></eg>
</sense></hom>
<entry><form id=""balad-un"" lang=""ceb"">balad-un</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>omen</tr>, a sign which prophesizes s.t. </trans>
<eg><i lang=""ceb"">Ang kumíta mauy usa ka bad-un nga may umaábut nga kagúbut,</i><trans> A comet is a sign of a forthcoming war. </trans></eg>
</sense></hom></entry>
<entry><form id=""tiking_balad-un"" lang=""ceb"">tiking balad-un</form>
<hom>
<sense n=""0""><trans> phrase used to address the gecko (house lizard) in asking him to foretell whether s.t. will happen. The question is put to the gecko before he sounds. After he sounds the question is repeated. If the gecko sounds <pb n=""89""/>an odd number of times the answer is affirmative. If even, the answer is negative. </trans>
<eg><i lang=""ceb"">Tiking balad-un, muulan ugmà?</i><trans> Prophet gecko, will it rain tomorrow?
</trans></eg>
</sense></hom></entry></entry>");
