INSERT INTO `wced_entry` VALUES (1823, "balabag", "89", "<entry page=""89"" id=""1823""><form id=""balaxbag"" lang=""ceb"">balábag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[<corr sic=""AA2S"">A2S</corr>; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> lie across a path. </trans>
<eg><i lang=""ceb"">Balabágun (ibábag) nátù pagbutang ang káhuy,</i><trans> Let’s put the tree across the road. </trans></eg>
<eg><i lang=""ceb"">Gibabágan ang agiánan sa mga batu,</i><trans> The path was blocked by rocks. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> block s.o.’s way. </trans>
<eg><i lang=""ceb"">Ikaw ray nakabábag sa ákung kalípay,</i><trans> You are the only one who stands in the way of my happiness. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> for a fetus to be in a transverse position. </trans>
<eg><i lang=""ceb"">Naglísud siya pag-anak kay nagbalábag (nagbalabag) ang bátà,</i><trans> She had a hard labor because the child was in a transverse position. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a piece of wood or metal which lies across s.t. </trans>
<eg><i lang=""ceb"">Ang balabag mauy naglambing sa duha ka kasku,</i><trans> The crossbeam holds the two hulls of the boat together. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> cross (not without <ix>l</ix> in this meaning). </trans>
<eg><i lang=""ceb"">Gilansang si Hisus sa balábag,</i><trans> Jesus was nailed to a cross. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> s.t. which bars the way. </trans>
<eg><i lang=""ceb"">Dílì balábag sa hangtúray nílang panaghigála,</i><trans> It is not a bar to their eternal friendship. </trans></eg>
</sense></hom>
<entry><form id=""balabag"" lang=""ceb""><abbr expan=""balabag"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#balaxbag"">= <sc>balábag</sc>, <ix>n</ix>.</xr> </trans>
</sense></hom></entry>
<entry><form id=""balabagan"" lang=""ceb""><abbr expan=""balabagan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>fishes</tr> with a transverse line, e.g., k.o. snappers.
</trans>
</sense></hom></entry></entry>");
