INSERT INTO `wced_entry` VALUES (1845, "balakbak", "90", "<entry page=""90"" id=""1845""><form id=""balakbak"" lang=""ceb"">balakbak</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> cloth or similar material to lie, walk, sit on. </trans>
<eg><i lang=""ceb"">Duguun ang bakbak nga giangkan,</i><trans> The sheets on which she lay when she gave birth are all bloody. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> diaper. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> put material under s.o. to be on. </trans>
<eg><i lang=""ceb"">Gibakbákan ug puting panaptun ang tumbanan sa bag-ung kinasal,</i><trans> The newly-weds had a white cloth spread for them to walk over. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> underlay, be the thing in which s.t. is rooted. </trans>
<eg><i lang=""ceb"">Ang íyang panáad gibakbákan ug mga pasálig,</i><trans> His promises were backed up by assurances. </trans></eg>
<eg><i lang=""ceb"">Lúhà ug singut ang gibakbak sa ákung paglampus,</i><trans> My success is rooted in sweat and tears. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> put a diaper on. </trans>
<eg><i lang=""ceb"">Bakbáki ang bátà,</i><trans> Put a diaper on the baby.
</trans></eg>
</sense></hom></entry>");
