INSERT INTO `wced_entry` VALUES (1889, "balaw", "91", "<entry page=""91"" id=""1889""><form id=""balaw"" lang=""ceb"">balaw</form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a resinous preparation used to caulk and waterproof a boat, obtained from the sap of the <ix>apítung</ix> and <ix>almasíga.</ix> </trans>
</sense>
