INSERT INTO `wced_entry` VALUES (1891, "balawbaw", "92", "<entry page=""92"" id=""1891""><form id=""balawbaw"" lang=""ceb"">balawbaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> put s.t. over s.t. else. </trans>
<eg><i lang=""ceb"">Ang kík gibawbáwan ug aysing,</i><trans> The cake was topped with icing. </trans></eg>
<eg><i lang=""ceb"">Ibawbaw ang báhaw sa bag-ung kan-un,</i><trans> Put the leftover rice on top of the newly-cooked rice. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> skim off the topmost portion of s.t. </trans>
<eg><i lang=""ceb"">Bawbáwun ku ang ispúma sa sabaw,</i><trans> I’ll skim off the foam from the soup.
</trans></eg>
</sense></hom></entry>");
