INSERT INTO `wced_entry` VALUES (1902, "balda", "92", "<entry page=""92"" id=""1902""><form id=""balda"" lang=""ceb"">balda</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>disable</tr>, <tr>maim</tr>. </trans>
<eg><i lang=""ceb"">Baldáha ang tiil arun dì kadágan,</i><trans> Break his legs so he can’t run away. </trans></eg>
<eg><i lang=""ceb"">Gibaldáhan ang táwu nga misúkul sa pulis,</i><trans> The man who resisted the policeman was maimed. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>disturb</tr>, prevent s.o. from doing s.t. properly. </trans>
<eg><i lang=""ceb"">Ang mga tin-idyir mubaldag apil-apil sa sáyaw,</i><trans> The teenagers that get into the act keep us from dancing properly. </trans></eg>
<eg><i lang=""ceb"">Baldáhun ku sa makadiyut ang inyung panagsulti,</i><trans> May I disturb your conversation a minute? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. that disturbs. </trans>
</sense></hom>
<entry><form id=""baldaxdu"" lang=""ceb""><abbr expan=""baldádu"" type=""lemma"">-du</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>crippled</tr>, <tr>maimed</tr>. </trans>
<eg><i lang=""ceb"">Pagkatáwu níya, baldádu na siyag kamut,</i><trans> He was <pb n=""93""/>born with a crippled hand. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; a]</itype><trans> get maimed, maim. </trans>
<eg><i lang=""ceb"">Baldadúhun ta ka run,</i><trans> I’m going to cripple you, you damn ...

</trans></eg>
</sense></hom></entry></entry>");
