INSERT INTO `wced_entry` VALUES (1907, "balhibu", "93", "<entry page=""93"" id=""1907""><form id=""balhixbu"" lang=""ceb"">balhíbu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>hair</tr> on the body, but not pubic hairs, hair of animals, feathers. </trans>
<eg><i lang=""ceb"">Bagà ang balhíbu sa íyang íluk,</i><trans> He has thick hair in his armpits. </trans></eg>
<eg><i lang=""ceb"">Hámis ug balhíbu ang iring,</i><trans> The cat has soft fur. </trans></eg>
<eg><i lang=""ceb"">Putì ang balhíbu sa ákung hiniktan,</i><trans> My fighting cock has white feathers. </trans></eg>
</sense></hom>
<entry><form id=""saxmag_parixhug_balhixbu"" lang=""ceb"">sámag, paríhug <abbr expan=""balhíbu"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> similar in traits. </trans>
<eg><i lang=""ceb"">Ang mga táwung susámag balhíbu magkaúyun giyud,</i><trans> Birds of a feather flock together. </trans></eg>
</sense></hom></entry>
<entry><form id=""balhibu"" lang=""ceb""><abbr expan=""balhibu"" type=""lemma"">(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12; b8]</itype><trans> </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> better in feather coloration. </trans>
<eg><i lang=""ceb"">Ang tubaung parísag buyugun makabalhibu,</i><trans> Toddy-colored feathers win <corr sic=""o-over"">over</corr> honey-colored ones. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> <tr>beat</tr> invariably in a competition. </trans>
<eg><i lang=""ceb"">Nabalhibuan mung mga tagabaryu námung mga tagasyudad,</i><trans> We city people can outdo you country people. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>overawe</tr>, <tr>impress</tr> s.o. to the extent that he gets flustered or completely eats out of one’s hands. </trans>
<eg><i lang=""ceb"">Nabalhibuan ku niánang bayhána. Dílì ku makabungat sa ákung túyù,</i><trans> I was overawed by that woman. I couldn’t say what I wanted to. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> for one’s heart to <tr>soften</tr> to one. </trans>
<eg><i lang=""ceb"">Nabalhibuan ku ánang tihíka. Aku ray makapangáyù níyag kwarta. Way láin,</i><trans> That old skinflint has a soft spot in his heart for me. I can ask him for money, but no one else can. </trans></eg>
</sense></hom></entry>
<entry><form id=""pamalhixbu"" lang=""ceb""><abbr expan=""pamalhíbu"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> select fighting cocks on the basis of feather coloration. </trans>
