INSERT INTO `wced_entry` VALUES (1909, "balhug", "93", "<entry page=""93"" id=""1909""><form id=""balhug"" lang=""ceb"">balhug</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> insert s.t. long in a place under s.t. or between s.t. </trans>
<eg><i lang=""ceb"">Akuy mibalhug niánang linipak ngadtu sa binugkus,</i><trans> I inserted those bamboo slats into the bundle. </trans></eg>
<eg><i lang=""ceb"">Ibalhug iláwum sa katri ang malíta,</i><trans> Slip the valise under the bed. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3P; a]</itype><trans> put into an enclosure. </trans>
<eg><i lang=""ceb"">Akuy mibalhug sa manuk sa tangkal,</i><trans> I put the chicken in the cage. </trans></eg>
<eg><i lang=""ceb"">Gibalhug siya sa karsil,</i><trans> He was thrown in jail.
</trans></eg>
</sense></hom></entry>");
