INSERT INTO `wced_entry` VALUES (1910, "balhun", "93", "<entry page=""93"" id=""1910""><form id=""balhun"" lang=""ceb"">balhun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> rope tied from one end of the yoke to the other end, passing below the neck, so the yoke won’t slip off. </trans>
</sense>
<sense n=""2""><number>2</number><trans> bellyband of harness. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
