INSERT INTO `wced_entry` VALUES (1913, "bali", "94", "<entry page=""94"" id=""1913""><form id=""baxliq"" lang=""ceb"">bálì</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> <tr>break</tr> s.t. long. </trans>
<eg><i lang=""ceb"">Mibálì siyag sanga,</i><trans> He broke off a twig. </trans></eg>
<eg><i lang=""ceb"">Nabálì ang ákung buktun,</i><trans> I broke my arm. </trans></eg>
<eg><i lang=""ceb"">Túhud lay ibálì ánà,</i><trans> Break it off with your knee. </trans></eg>
</sense></hom>
<entry><form id=""baxliq_ang_suxngay"" lang=""ceb""><abbr expan=""bálì"" type=""lemma"">—</abbr> ang súngay</form>
<hom>
<sense n=""0""><trans> put s.o. in his place. </trans>
<eg><i lang=""ceb"">Balían ku siya sa íyang súngay arun dílì na mag-abusar,</i><trans> I’ll put her in her place so she won’t be so abusive any more. </trans></eg>
</sense></hom></entry>
<entry><form id=""baliq"" lang=""ceb""><abbr expan=""balì"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for an elongated thing to be <tr>broken</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.o. who is new at s.t., <tr>ignorant</tr>. </trans>
<eg><i lang=""ceb"">Balì ka pang mumaníhu,</i><trans> You’re still just learning how to drive. </trans></eg>
<eg><i lang=""ceb"">Balì siyag linaktan,</i><trans> He carries himself like a greenhorn. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>foolish</tr> in trying to do s.t. one doesn’t even know how to do. </trans>
<eg><i lang=""ceb"">Balì ning tawhána. Midrayib sa dyíp, unyà dì diay kamau,</i><trans> He’s a fool. He tries to drive the jeep when he doesn’t even know how to. </trans></eg>
</sense></hom></entry>
<entry><form id=""baliqbaxliq"" lang=""ceb"">balìbálì</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> k.o. rifle that is bent when cocked, usually a double-barreled gun. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <xr lang=""ceb"" target=""#bulinaw"">= <sc>bulinaw</sc>.</xr>†
</trans>
</sense></hom></entry></entry>");
