INSERT INTO `wced_entry` VALUES (1916, "balibad", "94", "<entry page=""94"" id=""1916""><form id=""balixbad"" lang=""ceb"">balíbad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S; c]</itype><trans> <tr>refuse</tr> s.o. or s.t. </trans>
<eg><i lang=""ceb"">Balibáran gánì ku nímu, patyun ta ka,</i><trans> If you turn me down, I’ll kill you. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN2]</itype><trans> give an excuse for not doing s.t. </trans>
<eg><i lang=""ceb"">Mibalíbad (namalíbad) siyang dì musulti kay pagaw siya,</i><trans> He got out of giving the speech with the excuse that he was hoarse. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>refusal</tr>. </trans>
<eg><i lang=""ceb"">Ang ímung balíbad way kapuslánan kun tiúnan kag pusil,</i><trans> No use trying to refuse when s.o. points a gun at you. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>excuse</tr>. </trans>
<eg><i lang=""ceb"">Nakadawat mig balíbad níya nga dì siya makaanhi,</i><trans> We already received his excuse that he couldn’t come. </trans></eg>
</sense></hom>
<entry><form id=""pamalixbad"" lang=""ceb""><abbr expan=""pamalíbad"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> say s.t. is not the case. </trans>
<eg><i lang=""ceb"">Namalíbad siya nga wà siya mahigugma kaníya,</i><trans> She said she did not love him. </trans></eg>
</sense></hom></entry>
<entry><form id=""balibaran"" lang=""ceb"">balibaran</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> fond of giving excuses.
</trans>
</sense></hom></entry></entry>");
