INSERT INTO `wced_entry` VALUES (1930, "baligtad", "95", "<entry page=""95"" id=""1930""><form id=""baligtad"" lang=""ceb"">baligtad</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> wrong side out, up. </trans>
<eg><i lang=""ceb"">Baligtad nang pagkatahì kay nailáwum ang karaygan,</i><trans> It was sewed with the wrong side out because the material that was meant to face is on the inside. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>contrary</tr> to what is expected. </trans>
<eg><i lang=""ceb"">Baligtad ang nahitabù kay inay silútan, gigantíhan na hinúun,</i><trans> Just the opposite happened: instead of being punished, he was rewarded. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> put wrong side up or out. </trans>
<eg><i lang=""ceb"">Nagbaligtad ang kahun ay, básig mahùhù ang sulud,</i><trans> The box is upside down. The contents might fall out. </trans></eg>
<eg><i lang=""ceb"">Ayaw ibaligtad (baligtára) pagladlad ang mga magasin,</i><trans> Do not display the magazines upside down.
</trans></eg>
</sense></hom></entry>");
