INSERT INTO `wced_entry` VALUES (1931, "baligtus", "95", "<entry page=""95"" id=""1931""><form id=""baligtus"" lang=""ceb"">baligtus</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> tight <tr>knot</tr> that won’t come undone. </trans>
</sense>
<sense n=""2""><number>2</number><trans> thumb-sized bundle of sorted abaca fiber for weaving, knotted at one end. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> <tr>tie</tr> in a knot. </trans>
<eg><i lang=""ceb"">Baligtúsa (ibaligtus) makaduha arun masigúru,</i><trans> Tie the knot twice to make it secure. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> tie abaca fiber into a bundle as thick as one’s thumb by knotting the end. </trans>
<eg><i lang=""ceb"">Baligtúsa ang sinudlay nga iskuhídu,</i><trans> Bundle the sorted fine abaca fiber.
</trans></eg>
</sense></hom></entry>");
