INSERT INTO `wced_entry` VALUES (1932, "baligwat", "95", "<entry page=""95"" id=""1932""><form id=""baligwat"" lang=""ceb"">baligwat</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; c6]</itype><trans> use s.t. as a <tr>crowbar</tr> to move s.t. else. </trans>
<eg><i lang=""ceb"">Ayaw ug ibaligwat ang páyung sa ríhas,</i><trans> Don’t use the umbrella as a crowbar to move the grill. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a12]</itype><trans> break one’s arm or leg by moving it accidentally after it has been wedged tight in place (i.e. having it act like a crowbar). </trans>
<eg><i lang=""ceb"">Nabálì íyang tiil kay nabaligwat sa pagkabulásut níya sa bangag,</i><trans> He broke his leg when he stepped into the hole because when he fell, his leg was wedged on the edge of the hole. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> crowbar.
</trans>
</sense></hom></entry>");
