INSERT INTO `wced_entry` VALUES (1934, "balik", "95", "<entry page=""95"" id=""1934""><form id=""baxlik"" lang=""ceb"">bálik</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b5]</itype><trans> go, <tr>come back</tr>, come back to get s.t. </trans>
<eg><i lang=""ceb"">Kanus-a ka man mubálik?</i><trans> When will you come back? </trans></eg>
<eg><i lang=""ceb"">Balíkun (balíkan) nákù ang ákung nahikalimtan,</i><trans> I’ll come back for the things I forgot. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A13; c]</itype><trans> put, give s.t. back. </trans>
<eg><i lang=""ceb"">Ibálik ra ni ngadtu,</i><trans> Put this back. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B23; b6]</itype><trans> return to his former state. </trans>
<eg><i lang=""ceb"">Mibálik (nabálik) na ang kangayà sa íyang panagway,</i><trans> Her happy expression returned to her face. </trans></eg>
<eg><i lang=""ceb"">Balíkan ang yútà sa íyang katambuk kun abunúhan,</i><trans> The soil will regain its fertility if you add fertilizer. </trans></eg>
</sense>
