<eg><i lang=""ceb"">Sa katapúsan nabalingan ra gayud ang tulisan,</i><trans> At last the robbers were caught in the dragnet. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2N3PC; a1]</itype><trans> trap, capture by stratagem. </trans>
<eg><i lang=""ceb"">Ang ímung sinultihan mauy makabáling (makapabáling) kanímu,</i><trans> Your speech will entrap you. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A3SN; a12]</itype><trans> for two parties to make a secret agreement in gambling in order to bilk a third player. </trans>
<eg><i lang=""ceb"">Dakù ang ákung pildi kay nabáling man ku,</i><trans> I lost heavily because they duped me. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A23PC; ab2c]</itype><trans> capture one’s attention, affections. </trans>
<eg><i lang=""ceb"">Nagkabáling ang ílang tinan-awan,</i><trans> Their eyes met. </trans></eg>
<eg><i lang=""ceb"">Balíngun níya ang ímung pagtagad,</i><trans> He will capture your attention. </trans></eg>
<eg><i lang=""ceb"">Wà níya ibáling ang íyang pagtagad ngadtu sa uban,</i><trans> He did not turn his affections to the others. </trans></eg>
</sense></hom>
<entry><form id=""baling"" lang=""ceb""><abbr expan=""baling"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#baxling"">= <sc>báling</sc>.</xr> </trans>
</sense></hom></entry>
<entry><form id=""pamaxling"" lang=""ceb""><abbr expan=""pamáling"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> fish with nets. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fishing with nets. </trans>
</sense></hom></entry>
<entry><form id=""himaxling_mamamaling"" lang=""ceb""><abbr expan=""himáling"" type=""lemma"">hiN-</abbr>, <abbr expan=""mamamaling"" type=""lemma"">maN-r-(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans><i lang=""ceb""/> one who likes to ensnare people. </trans>
<eg><i lang=""ceb"">Dalì rang ikítà <pb n=""97""/>ug áway, himáling (mamamaling) tuhù,</i><trans> She looks for trouble. She likes to ensnare people. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> fish caught with nets. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. captured by stratagem.
