INSERT INTO `wced_entry` VALUES (1967, "balinsay", "97", "<entry page=""97"" id=""1967""><form id=""balinsay"" lang=""ceb"">balinsay</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. game of tossing a handful of small objects, usually cowries, to be caught by the back of the hand, and then tossed again caught on the palm. The pieces that fall to the floor are paired off. In each pair one is made to hit the other by flicking it. If the player misses or hits more than one piece, he’s burnt (<ix>pasù</ix>) and loses his turn. The object is to get rid of the pieces without losing one’s turn. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[C2; ac]</itype><trans> play <ix>balinsay.</ix> </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> toss things in the air as if playing <ix>balinsay.</ix> </trans>
<eg><i lang=""ceb"">Dì balinsáyun ang kwarta kay makagábà,</i><trans> Don’t flip money in the air because it will bring you divine retribution.
</trans></eg>
</sense></hom></entry>");
