INSERT INTO `wced_entry` VALUES (1985, "balising", "98", "<entry page=""98"" id=""1985""><form id=""balixsing"" lang=""ceb"">balísing</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>transfer</tr> an activity elsewhere. </trans>
<eg><i lang=""ceb"">Ibalísing (balisíngun) ni nátung átung ínum,</i><trans> Let us move our drinking spree s.w. else. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>move</tr> a piece in a game of marbles from an obstructed place to s.w. else the same distance from the goal. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b4(1)]</itype><trans> have s.o. take a base in baseball. </trans>
<eg><i lang=""ceb"">Nagbalísing ba ang ampáyir sa bátir?</i><trans> Did the umpire tell the batter to take a base? </trans></eg>
<eg><i lang=""ceb"">Nabalisíngan ang ílang pitsir ug upat ka bátir,</i><trans> That pitcher had four batters take a base on him. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A2; b6]</itype><trans> for a husband to turn his attention elsewhere. </trans>
<eg><i lang=""ceb"">Hustis sa nayitklab ang gibalisíngan sa bána,</i><trans> The husband turned his attentions to a night club hostess. </trans></eg>
</sense></hom>
<entry><form id=""himalixsing_himalising"" lang=""ceb""><abbr expan=""himalísing"" type=""lemma"">hiN-</abbr>, <abbr expan=""himalising"" type=""lemma"">hiN-(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> inclined to move one’s piece in a game.
</trans>
</sense></hom></entry></entry>");
