INSERT INTO `wced_entry` VALUES (1988, "balista", "98", "<entry page=""98"" id=""1988""><form id=""balista"" lang=""ceb"">balista</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B26; a]</itype><trans> <tr>flip</tr> over backward. </trans>
