INSERT INTO `wced_entry` VALUES (1989, "balisung1", "98", "<entry page=""98"" id=""1989""><form id=""balixsung"" lang=""ceb"">balísung<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> exactly the <tr>contrary</tr>. </trans>
<eg><i lang=""ceb"">Balísung kanà sa ákung nadungug,</i><trans> That is just the opposite of what I heard. </trans></eg>
<eg><i lang=""ceb"">Balísung ang ílang paghigdà,</i><trans> They were lying head to foot. </trans></eg>
<eg><i lang=""ceb"">Dakung balísung: ang babáyi magkarsúnis ug ang laláki magbistída,</i><trans> It’s completely backwards: the women wear pants and the men wear dresses. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB; c1]</itype><trans> become just the opposite, turned around; turn s.t. around. </trans>
<eg><i lang=""ceb"">Kun mubalísung ang íyang buut, dì siya muanhi,</i><trans> If he changes his mind, he won’t come. </trans></eg>
<eg><i lang=""ceb"">Mubalísung ang dáut sa nagpadala niíni,</i><trans> The sorcery will boomerang on the person who sent it. </trans></eg>
<eg><i lang=""ceb"">Ayaw balisúnga (ibalísung) ang húnus sa lamísa,</i><trans> Don’t put the drawer in the table backwards.
</trans></eg>
</sense></hom></entry>");
