INSERT INTO `wced_entry` VALUES (1991, "balita", "98", "<entry page=""98"" id=""1991""><form id=""balitaq"" lang=""ceb"">balità</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>news</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> bad omen, esp. portending death. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> <ix>oath:</ix> it is true (lit. may it be a bad omen). </trans>
</sense></hom>
<entry><form id=""dakuq_nga_balitaq"" lang=""ceb"">dakù nga <abbr expan=""balità"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> sensational news. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> tell news. </trans>
<eg><i lang=""ceb"">Ikaguul mu kining ákung ibalità,</i><trans> You will feel sad about the news that I’m going to tell you. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A12]</itype><trans> receive news. </trans>
<eg><i lang=""ceb"">Nakabalità ka nga minyù na ku?</i><trans> Have you heard that I’m married now? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13; b(1)]</itype><trans> appear as a bad omen. </trans>
<eg><i lang=""ceb"">Nagbalità si Pidru kay sa walà pa mi masáyud sa íyang kamatáyun dihay nagpat-akpat-ak nga dugù sa salug,</i><trans> Pedro appeared to us with a bad omen, because before we learned of his death, we saw spots of blood on the floor.†
</trans></eg>
</sense></hom></entry></entry>");
