INSERT INTO `wced_entry` VALUES (1992, "balit-ad", "98", "<entry page=""98"" id=""1992""><form id=""balit-ad"" lang=""ceb"">balit-ad</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> inside out, belly-side up, front-side back. </trans>
<eg><i lang=""ceb"">Balit-ad pagkasul-ub ang ímung kamisin,</i><trans> You have your undershirt on backwards (or inside out). </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[ABN; a]</itype><trans> be, make wrong-side up, out. </trans>
<eg><i lang=""ceb"">Ang hiwing pulitiku mubalit-ad sa tinúud,</i><trans> The crooked politician twists the truth. </trans></eg>
<eg><i lang=""ceb"">Mibalit-ad (nabalit-ad, namalit-ad) ang atup sa kusug nga hángin,</i><trans> The wind turned the roof upside down.
</trans></eg>
</sense></hom></entry>");
