INSERT INTO `wced_entry` VALUES (1993, "balitang", "98", "<entry page=""98"" id=""1993""><form id=""balitang"" lang=""ceb"">balitang</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> short piece of wood or metal. Also the name given to pieces of wood which serve a purpose. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> whippletree of a plow. </trans>
</sense>
<sense n=""1b""><number>1b</number><trans> wood used in stripping abaca, around which the end of the abaca is wound and which is pulled to force the abaca through the stripper. </trans>
</sense>
<sense n=""1c""><number>1c</number><trans> wood used in fishing with a net that is pulled: the people who pull the net hold on to the <ix>balitang</ix> and hold it in a vertical position so that the top edge is directly above the bottom edge of the net. </trans>
</sense>
<sense n=""2""><number>2</number><trans> piece of bone, vein, or tendon supposed to lie across the vagina which obstructs the easy birth of a child. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1a""><number>1a</number> <itype>[A; a]</itype><trans> hurl a short stick at. </trans>
<eg><i lang=""ceb"">Balitanga ang manuk,</i><trans> Hurl the stick at the chicken. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> make into wood used as whippletree, net holder, etc. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A123P; a4b4]</itype><trans> have an obstructing bone in the vagina. </trans>
<eg><i lang=""ceb"">Gibalitang (gibalitangan) man si Títa, galisud ug anak,</i><trans> Tita had an obstruction in her vagina so that she had a difficult delivery. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[AN; a]</itype><trans> make a whippletree for a plow or piece of wood for a <pb n=""99""/>net.
</trans>
</sense></hom></entry>");
