<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> do a back <tr>somersault</tr>, <tr>flip</tr> over backwards. </trans>
<eg><i lang=""ceb"">Maáyung mubalituk ang sirkadur,</i><trans> An acrobat flips over backwards with ease. </trans></eg>
