INSERT INTO `wced_entry` VALUES (2002, "baliw", "99", "<entry page=""99"" id=""2002""><form id=""baxliw"" lang=""ceb"">báliw</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> divine <tr>punishment</tr>, usually for incest, consisting of being struck by lightning and turned into stone. </trans>
