<sense n=""3""><number>3</number><trans> be <tr>crazy</tr>. </trans>
<eg><i lang=""ceb"">Wà ka balíwa. Tigúwang ka na makigminyug diyisisayis?</i><trans> Are you out of your mind? At your age you want to marry a sixteen-year-old?
