INSERT INTO `wced_entry` VALUES (2011, "balsa", "99", "<entry page=""99"" id=""2011""><form id=""balsa"" lang=""ceb"">balsa</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> sled consisting of a shaft hitched to a draft animal and a platform dragged along the ground. </trans>
</sense>
<sense n=""2""><number>2</number><trans> raft. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac1]</itype><trans> bring s.t. with a sled or raft. </trans>
<eg><i lang=""ceb"">Balsáha ang mabdus sa lungsud,</i><trans> Let the pregnant woman ride the sled to town. </trans></eg>
<eg><i lang=""ceb"">Ibalsa (balsáha) ang lubi sa tabuk,</i><trans> Send the coconuts across on a raft (or by tying them together into a raft). </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> do work with a sled or raft. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A1; a]</itype><trans> go s.w. on a sled, raft. </trans>
<eg><i lang=""ceb"">Mabalsa ba ang tabuk?</i><trans> Can you reach the other side with a raft? </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; a]</itype><trans> carry or lift a load. </trans>
<eg><i lang=""ceb"">Makabalsa giyug daghang makáun si Tátay basta makadaug sa búwang,</i><trans> Father brings home a load of goodies when he wins at the cockfights. </trans></eg>
<eg><i lang=""ceb"">Gibalsa sa bána ang asáwa ug gibundak sa katri,</i><trans> The husband lifted his wife and threw her on the bed.
</trans></eg>
</sense></hom></entry>");
