INSERT INTO `wced_entry` VALUES (2021, "balubalu", "100", "<entry page=""100"" id=""2021""><form id=""balubaxlu"" lang=""ceb"">balubálu</form>
<hom>
<sense n=""1""><number>1</number><trans> [so-and-so] seemed unlikely, but that is what happened. </trans>
<eg><i lang=""ceb"">Maáyu nátung libak níya. Balubálu dinhà ra sa átung luyu,</i><trans> We were talking about him. We didn’t expect it, but there he was in back of us. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> actually, when in fact, the truth is otherwise. </trans>
<eg><i lang=""ceb"">Pasukùsúkù kaáyu, balubálu nahigugma diay,</i><trans> She pretends to be angry when in fact she’s in love. </trans></eg>
<eg><i lang=""ceb"">Kusug kaáyung manulti, balubálu talawan,</i><trans> He talks big, but actually he is a coward. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> despite the fact. </trans>
<eg><i lang=""ceb"">Balubálung dakug grádu way batásan,</i><trans> You might be highly-educated, but you are ill-mannered.
</trans></eg>
</sense></hom></entry>");
