INSERT INTO `wced_entry` VALUES (2023, "balud", "100", "<entry page=""100"" id=""2023""><form id=""balud"" lang=""ceb"">balud</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>waves</tr>. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>curved</tr>, <tr>curled</tr> in a single upward curve. </trans>
<eg><i lang=""ceb"">Balud siyag piluk,</i><trans> She has curly eyelashes. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[a]</itype><trans> be struck by waves. </trans>
<eg><i lang=""ceb"">Malúnud nang sakayánag balurun ug kusug,</i><trans> That boat will sink if it is struck by big waves. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> curl s.t. upwards. </trans>
<eg><i lang=""ceb"">Balura ang ímung kamut,</i><trans> Make your fingers bend upwards. </trans></eg>
