INSERT INTO `wced_entry` VALUES (2042, "balun", "101", "<entry page=""101"" id=""2042""><form id=""baxlun"" lang=""ceb"">bálun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> food, money to take along on a trip. </trans>
<eg><i lang=""ceb"">Ma, ambi na ang bálun, bi,</i><trans> Mom, can I have my spending money for school? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> take along food or money. </trans>
<eg><i lang=""ceb"">Mubálun ku sa trabáhu,</i><trans> I bring my lunch to work. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A1; a]</itype><trans> harbor emotions. </trans>
<eg><i lang=""ceb"">Balúnun ku sa lubngánan ang átung gugma,</i><trans> I’ll carry our love to the grave. </trans></eg>
</sense></hom>
<entry><form id=""pabaxlun"" lang=""ceb""><abbr expan=""pabálun"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> give s.t. to s.o. to take along. </trans>
</sense>
<sense n=""2""><number>2</number><trans> give s.t. in addition to s.t. else which was already sufficient. </trans>
<eg><i lang=""ceb"">Humag sagpà gipabalúnan pag kasábà,</i><trans> Not only was he slapped, he was administered a sound scolding as well. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> thing given to s.o. who leaves, or to a retiring employee. </trans>
<eg><i lang=""ceb"">Ang pabálun sa tigúlang bayinti mil písus,</i><trans> The old man was given twenty thousand pesos as retirement pay. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> prayer said for the soul of the dead on the night of the day of burial. </trans>
</sense>
<sense n=""3""><number>3</number><trans> food brought by the Chinese to the cemetery at funerals or on special days for the use of the departed soul. </trans>
</sense></hom></entry>
<entry><form id=""balunbaxlun"" lang=""ceb"">balunbálun</form>
<hom>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#pa-an"">= <sc>pa-an</sc>.</xr> </trans>
</sense></hom></entry>
