INSERT INTO `wced_entry` VALUES (2052, "balus", "101", "<entry page=""101"" id=""2052""><form id=""baxlus"" lang=""ceb"">bálus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3S; b1c]</itype><trans> do back to s.o. what he did to the agent. </trans>
<eg><i lang=""ceb"">Mibálus akug pahiyum,</i><trans> I smiled back at her. </trans></eg>
<eg><i lang=""ceb"">Wà pa ku makabálus (makabalus) sa ímung suwat,</i><trans> I haven’t had the chance to answer your letter. </trans></eg>
<eg><i lang=""ceb"">Balúsan (baslan) ku ang ímung kaáyu,</i><trans> I will repay your goodness. </trans></eg>
<eg><i lang=""ceb"">Balúsan (baslan) ku ikaw,</i><trans> I will repay you. </trans></eg>
<eg><i lang=""ceb"">Pagka walay igabálus mu,</i><trans> How ungrateful (repaying nothing) you are! </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> for s.t. to happen one way and then the opposite way. </trans>
<eg><i lang=""ceb"">Balúsa pagtahì ang kílid,</i><trans> Sew the seams twice: once inverted and then the right way around. </trans></eg>
<eg><i lang=""ceb"">Ang kalípay balúsan (baslan) ug kasákit,</i><trans> Happiness is followed by sorrow in turn. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[C3]</itype><trans> for a brother and sister to marry people that are also brothers and sisters. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> thing done in return or response to s.t. </trans>
</sense>
<sense n=""2""><number>2</number><trans> person whose sibling of the opposite sex is married to a sibling of the spouse. </trans>
</sense></hom>
<entry><form id=""panimalus"" lang=""ceb""><abbr expan=""panimalus"" type=""lemma"">paniN-(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c]</itype><trans> take vengeance on, <tr>avenge</tr>. </trans>
<eg><i lang=""ceb"">Panimaslan ku <pb n=""102""/>ang kamatáyun sa ákung igsúun,</i><trans> I’ll avenge my brother’s death. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> revenge. </trans>
</sense></hom></entry>
<entry><form id=""pamalusbaxlus"" lang=""ceb"">pamalusbálus</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A23S; c]</itype><trans> return a favor, repay a moral obligation. </trans>
</sense></hom></entry>
<entry><form id=""balaslan_baslanan_pamaslan"" lang=""ceb"">balaslan, baslanan, pamaslan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> things to be done to repay a debt. </trans>
</sense>
<sense n=""2""><number>2</number><trans> days owing in the <ix>aláyun.</ix> </trans>
</sense></hom></entry>
<entry><form id=""binaxlusan"" lang=""ceb""><abbr expan=""binálusan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> plaid in design. </trans>
</sense></hom></entry>
<entry><form id=""pamaxlus"" lang=""ceb""><abbr expan=""pamálus"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> hind toe of a fowl which is bent backwards. </trans>
<eg><i lang=""ceb"">Ang langgam nga way pamálus dì makabátug,</i><trans> A bird that has no hind toe cannot perch.
</trans></eg>
</sense></hom></entry></entry>");
