INSERT INTO `wced_entry` VALUES (2088, "banata", "103", "<entry page=""103"" id=""2088""><form id=""banaxta"" lang=""ceb"">banáta</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> section, flat piece cut from a whole. </trans>
<eg><i lang=""ceb"">Nanglatas kami sa lagpad nga banáta sa pilapilan,</i><trans> We traversed the wide sections of the rice field. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> division in a cabinet or room. </trans>
<eg><i lang=""ceb"">Sa kinaubsang banáta sa aparadur,</i><trans> On the lowest shelf of the cabinet. </trans></eg>
<eg><i lang=""ceb"">Ang banáta nakapangitngit sa kwartu,</i><trans> The partition made the room dark. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> sheet of woven cloth, a fathom wide. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> divide into sections, partition. </trans>
<eg><i lang=""ceb"">Arun way sámuk ibanáta (banatáha) ang yútà,</i><trans> So there will be no disagreement, divide the land. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> do s.t. by pieces. </trans>
<eg><i lang=""ceb"">Banatáhun (ibanáta) ku pagpalit ang panaptun,</i><trans> I will buy the cloth cut into pieces. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> put a shelf, section.
</trans>
</sense></hom></entry>");
