INSERT INTO `wced_entry` VALUES (2107, "bandiha", "103", "<entry page=""103"" id=""2107""><form id=""bandixha"" lang=""ceb"">bandíha</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> food or drinks brought to a party. </trans>
<eg><i lang=""ceb"">Magdala giyud kag bandíha sa pagpangunggu,</i><trans> <pb n=""104""/>You must bring food when you go to ask for a woman’s hand. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> food given to the leader of prayers by the family sponsoring the prayers. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <xr lang=""ceb"" target=""#bandihaxdu"">= <sc>bandihádu</sc>.</xr> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> contribute food to a feast, give food to a prayer leader. </trans>
<eg><i lang=""ceb"">Píkas sa bábuy ang ílang gibandíha sa katapúsan,</i><trans> They brought half of a pig to the feast concluding the novena. </trans></eg>
</sense></hom>
<entry><form id=""bandixhadu"" lang=""ceb""><abbr expan=""bandíhadu"" type=""lemma"">-du</abbr></form>
<hom>
<sense n=""0""><trans> large platter, large shallow serving dish. </trans>
</sense></hom></entry>
<entry><form id=""bandihaxwu"" lang=""ceb""><abbr expan=""bandiháwu"" type=""lemma"">-wu</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> precious stone, oval in shape (like a platter). </trans>
<eg><i lang=""ceb"">Bandiháwu ang íyang singsing brilyanti,</i></eg>
<eg><i lang=""ceb""/><trans> The diamond in her ring is shaped like a platter. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> one who receives the food offering after leading prayers for a family. </trans>
<eg><i lang=""ceb"">Bandiháwu giyud ang mananabtan,</i><trans> The person who leads a novena receives some gifts.
</trans></eg>
</sense></hom></entry></entry>");
