INSERT INTO `wced_entry` VALUES (2111, "bandira", "104", "<entry page=""104"" id=""2111""><form id=""bandixra"" lang=""ceb"">bandíra</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>flag</tr>, <tr>banner</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. flapping like a flag, <tr>visible</tr> for all to see. </trans>
<eg><i lang=""ceb"">Bitára ang ímung kamisun kay nagdayag ang ímung bandíra,</i><trans> You pull your slip up because it (lit. flag) shows. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[a]</itype><trans> make into a flag, put a flag on. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[AB6; c]</itype><trans> put s.t. in view; <tr>brandish</tr> a weapon, be in full view. </trans>
<eg><i lang=""ceb"">Bandiráhan ku bítaw sa pinútì, dágan lagi,</i><trans> He ran away when I brandished my sword at him. </trans></eg>
<eg><i lang=""ceb"">Ímu mang gibandíra ang ímung kadautan,</i><trans> You are brandishing your wickedness for all to see. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[B6]</itype><trans> be very much above, <tr>ahead</tr> of everyone else. </trans>
<eg><i lang=""ceb"">Labihan siyang namandíra (mibandíra) sa indigay,</i><trans> She was very much in the lead in the contest.
