INSERT INTO `wced_entry` VALUES (2145, "bangga", "105", "<entry page=""105"" id=""2145""><form id=""banggaq"" lang=""ceb"">banggà</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>contest</tr> of any sort for a winner. </trans>
<eg><i lang=""ceb"">Akuy midaug sa banggà sa áwit,</i><trans> I won the singing contest. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>crash</tr> of vehicles bumping into each other. </trans>
<eg><i lang=""ceb"">Duhay patay sa banggà dihà sa iskína,</i><trans> Two people died in the crash on the corner. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[C; a]</itype><trans> hold a contest. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[AC; ab2]</itype><trans> <tr>bump</tr> into s.t. with force. </trans>
<eg><i lang=""ceb"">Mibanggà ang bátà níya,</i><trans> The child bumped into her. </trans></eg>
<eg><i lang=""ceb"">Ang barku nakabanggà ug búya,</i><trans> The ship crashed into a buoy. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AN2; a2]</itype><trans> meet goods before they reach the market to get them cheaper. </trans>
<eg><i lang=""ceb"">Adtu ta sa paradahan kay mamanggà ta ug utanun,</i><trans> Let’s go to the bus stop and get vegetables. </trans></eg>
</sense></hom>
<entry><form id=""mamamanggaq_mamangaay"" lang=""ceb""><abbr expan=""mamamanggà"" type=""lemma"">maN-r-</abbr>, <abbr expan=""mamangaay"" type=""lemma"">maN-ay</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> buyers who meet and buy from a source before the goods reach the market.
</trans>
</sense></hom></entry></entry>");
