INSERT INTO `wced_entry` VALUES (2162, "bangil", "106", "<entry page=""106"" id=""2162""><form id=""baxngil"" lang=""ceb"">bángil</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b5c]</itype><trans> put s.t. beneath or next to s.t. to keep it from jiggling, rolling, sliding, etc. </trans>
<eg><i lang=""ceb"">Bangíli (bangíla) ang ligid sa trák,</i><trans> Put a block against the wheels of the truck. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a]</itype><trans> eat s.t. before a drinking bout (prop up one’s stomach). </trans>
<eg><i lang=""ceb"">Unsay ímung gibángil únà muinum?</i><trans> What did you eat before you drank? </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> use a charm to insure success in business or gambling. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b5]</itype><trans> induce s.o. with a bribe. </trans>
<eg><i lang=""ceb"">Bangílun (bangílan) ta siyag tubà arun maabtik sugúun,</i><trans> Give him some toddy to get him to work a bit faster. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A; b]</itype><trans> <tr>trip</tr> a player while running or jumping. </trans>
</sense></hom>
<entry><form id=""bangil"" lang=""ceb""><abbr expan=""bangil"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. placed beneath to keep a thing steady or in position. </trans>
<eg><i lang=""ceb"">Butangig bangil ang silya arun mupundu,</i><trans> Put a prop beneath the chair so it will be steady. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> food to stave off hunger. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> food taken before drinks (slang). </trans>
</sense>
<sense n=""2b""><number>2b</number> <form id=""bangil_sa_tinggutum"" lang=""ceb""><abbr expan=""bangil"" type=""lemma"">—</abbr> sa tinggutum</form><trans> food eaten in place of rice or corn in famine times. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>charm</tr> for gambling or business. </trans>
</sense>
<sense n=""4""><number>4</number><trans> s.t. given as an inducement to goad s.o. into action. </trans>
</sense></hom></entry>
<entry><form id=""pamaxngil"" lang=""ceb""><abbr expan=""pamángil"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> use a charm in gambling or in business. </trans>
</sense></hom></entry>
<entry><form id=""bangilbaxngil"" lang=""ceb"">bangilbángil</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> <tr>support</tr>, <tr>fill in</tr> the gaps. </trans>
<eg><i lang=""ceb"">Ang kamúti ibangilbángil sa pagkáun,</i><trans> Sweet potatoes aren’t the principal food. They are s.t. extra to fill in when there isn’t enough other food. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. that supports. </trans>
<eg><i lang=""ceb"">Bangilbángil nà siya nákù sa trabáhu,</i><trans> He is my helper in my job.
</trans></eg>
</sense></hom></entry></entry>");
