INSERT INTO `wced_entry` VALUES (2207, "bang-ug", "108", "<entry page=""108"" id=""2207""><form id=""bang-ug"" lang=""ceb"">bang-ug</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> foul smell of liquids that have stagnated or food that has spoiled because it has not been freely exposed to air. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> become smelly due to stagnation. </trans>
<eg><i lang=""ceb"">Mabang-ug ang kík ug dúgay nga gitaklúban,</i><trans> Cake which has been left covered tight too long develops a bad smell. </trans></eg>
<eg><i lang=""ceb"">Nagbang-ug ang túbig sa akwaryum,</i><trans> The water in the aquarium is stagnant and smelly. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be pent up too long and thus get rotten. </trans>
<eg><i lang=""ceb"">Nabang-ug na lang ang íyang pagbátì kay wà níya ikapaháyag,</i><trans> She kept her feelings bottled up inside too long (lit. till they rotted).
</trans></eg>
</sense></hom></entry>");
