INSERT INTO `wced_entry` VALUES (2210, "bangun", "108", "<entry page=""108"" id=""2210""><form id=""baxngun"" lang=""ceb"">bángun</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b2]</itype><trans> <tr>get up</tr> from a lying position. </trans>
<eg><i lang=""ceb"">Mubángun kug sayu,</i><trans> I’ll get up early. </trans></eg>
<eg><i lang=""ceb"">Hibangunan ta gánì ka, búnal giyud,</i><trans> As soon as I can get up I’ll spank you. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AP; c1]</itype><trans> make s.t. lying erect. </trans>
<eg><i lang=""ceb"">Mabughat kag mubángun (mupabángun) ka ánà,</i><trans> You’ll have a relapse if you lift that. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> redeem one’s honor. </trans>
<eg><i lang=""ceb"">Bangúna (ibángun) ang kanhing kadunggánan sa átung kalíwat,</i><trans> Redeem the former honor of our race. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[a12]</itype><trans> <tr>revive</tr> the name of a deceased relative by naming s.o. after him. </trans>
<eg><i lang=""ceb"">Bangúnun ku ang ngálan ni anhing lúlu pinaági sa ákung anak,</i><trans> I will bring grandfather’s name to life again through my son. </trans></eg>
</sense></hom>
<entry><form id=""bangun3"" lang=""ceb""><abbr expan=""bangun"" type=""lemma"">(→)</abbr><sub>3</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> put a boat on a small elevated platform or wedges when it is beached to prevent it from getting rotten or infested with shipworms. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> wedge used to put a boat on.
</trans>
</sense></hom></entry></entry>");
