INSERT INTO `wced_entry` VALUES (2216, "banha", "108", "<entry page=""108"" id=""2216""><form id=""banhaq"" lang=""ceb"">banhà</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>noisy</tr> in a loud way. </trans>
</sense>
<sense n=""2""><number>2</number><trans> exclamation telling s.o. to shut up or to stop making noise. </trans>
<eg><i lang=""ceb"">Banhà! <corr sic=""Di"">Dì</corr> ni mirkádu,</i><trans> Be quiet! This is not the market, you know. </trans></eg>
<eg><i lang=""ceb"">Banhà! Wà kay lábut,</i><trans> Shut up! It’s none of your business. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A1; a2]</itype><trans> make noise, consider s.t. noisy. </trans>
<eg><i lang=""ceb"">Dì ta magbanhà sulud sa simbahan,</i><trans> Let’s not make noise inside the church. </trans></eg>
</sense>
