<eg><i lang=""ceb"">Nakabanlaw na ku sa kusína,</i><trans> I have rinsed the kitchen floor. </trans></eg>
<eg><i lang=""ceb"">Banláwun ku na ang linadlad,</i><trans> I will rinse the clothes which have been bleached. </trans></eg>
