<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> <tr>rub</tr> s.t. on or against s.t. </trans>
<eg><i lang=""ceb"">Kinsay nagbanlus ug batu sa bildu nga nagaras man?</i><trans> Who rubbed a stone against the glass? There’s a scratch on it. </trans></eg>
<eg><i lang=""ceb"">Bíks ang gibanlus níya sa dughan sa bátà,</i><trans> He rubbed Vick’s ointment on the child’s chest. </trans></eg>
