<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> clean the skin of a dressed chicken of prickles or slimy substance. </trans>
<eg><i lang=""ceb"">Asin ang ibanlut niánang manúka,</i><trans> Use salt to clean the chicken’s skin. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a4]</itype><trans> have the sickness <ix>banlut.</ix> </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
