INSERT INTO `wced_entry` VALUES (2264, "banting", "111", "<entry page=""111"" id=""2264""><form id=""banting"" lang=""ceb"">banting</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> rope or chain tied to s.t. to steady it, hold it down. </trans>
<eg><i lang=""ceb"">Hugti ang banting sa balay kay talibagyu,</i><trans> Tighten the rope holding the house because a typhoon is coming. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> fetter placed on the feet of prisoners. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> secure or steady s.t. by fastening s.t. to it; make into a fastening rope. </trans>
<eg><i lang=""ceb"">Ug nakabanting ka pa sa bungsud, dílì untà maánud,</i><trans> Had you secured the fish corral, it wouldn’t have been washed away. </trans></eg>
<eg><i lang=""ceb"">Lambu ang ibanting sa tabánug,</i><trans> Use a string to balance the kite.†
</trans></eg>
</sense></hom></entry>");
