INSERT INTO `wced_entry` VALUES (2268, "bantuk", "111", "<entry page=""111"" id=""2268""><form id=""bantuk"" lang=""ceb"">bantuk</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> hard and compact. </trans>
<eg><i lang=""ceb"">Bantuk kaáyung unud sa gábi,</i><trans> Taro meat is very firm. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for muscles to be firm. </trans>
<eg><i lang=""ceb"">Bantuk kaáyu siyag kaunuran,</i><trans> He has firm muscles. </trans></eg>
<eg><i lang=""ceb"">Bída, bantuk giyung busúga,</i><trans> My, I’m filled to bursting! </trans></eg>
</sense>
<sense n=""3""><number>3</number> <form id=""bantuk_sa_dughan"" lang=""ceb""><abbr expan=""bantuk"" type=""lemma"">—</abbr> sa dughan</form><trans> filling the breast. </trans>
<eg><i lang=""ceb"">Kalípay nga bantuk sa dughan,</i><trans> Happiness that fills the breast. </trans></eg>
</sense></hom>
<entry><form id=""bantuk_ug_nawung"" lang=""ceb""><abbr expan=""bantuk"" type=""lemma"">—</abbr> ug nawung</form>
<hom>
<sense n=""0""><trans> shameless, hardened to others’ opinions. </trans>
</sense></hom></entry>
<entry><form id=""bantuk_ug_uxlu"" lang=""ceb""><abbr expan=""bantuk"" type=""lemma"">—</abbr> ug úlu</form>
<hom>
<sense n=""a""><number>a</number><trans> thick-skulled. </trans>
<eg><i lang=""ceb"">Bantuk kag úlu. Kápuy itudlù nímu,</i><trans> You are thick-skulled. It’s terrible to try to teach you. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> <tr>stubborn</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[APB3; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> make s.t. harden, harden. </trans>
<eg><i lang=""ceb"">Mibantuk (nabantuk) ang basakan sa kataas sa húlaw,</i><trans> The rice field hardened because of the long drought. </trans></eg>
<eg><i lang=""ceb"">Bantúkun nátù ang nataran kay himúung baylihan,</i><trans> Let’s tramp the yard down so we can use it as a dance floor. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> inure, get inured to s.t. </trans>
<eg><i lang=""ceb"">Nagbantuk na ning ákung nawung sa mga biaybíay,</i><trans> I have become hardened to their taunts. </trans></eg>
<eg><i lang=""ceb"">Nagkabantuk na ang ákung dughan sa kaguul,</i><trans> My heart has become hardened to grief.†
</trans></eg>
</sense></hom></entry></entry>");
