INSERT INTO `wced_entry` VALUES (2272, "bantulinaw", "111", "<entry page=""111"" id=""2272""><form id=""bantulinaw"" lang=""ceb"">bantulinaw</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> daytime weather conditions where there is a light cloud cover: the sun shines but its heat is mitigated. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for the sea to be rippling slightly, but on the whole calm. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> be, become lightly overcast. </trans>
<eg><i lang=""ceb"">Nagkabantulinaw na man, maáyu nang iduwà,</i><trans> Now that it is gradually clouding over lightly, it is a good time to play. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for the sea to be rippling slightly.
</trans>
</sense></hom></entry>");
