INSERT INTO `wced_entry` VALUES (2274, "bantut", "111", "<entry page=""111"" id=""2274""><form id=""bantut"" lang=""ceb"">bantut</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> light <tr>thudding</tr> sound of a falling object. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B26]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> make a light thudding sound in falling. </trans>
<eg><i lang=""ceb"">Nahúlug nga pútut tung mibantut,</i><trans> That thudding sound was a coconut bud that fell. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for a top to <tr>fail</tr> to spin. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B2; c1]</itype><trans> for a business to <tr>fail</tr>. </trans>
<eg><i lang=""ceb"">Ang súgal makapabantut sa nigusyu,</i><trans> Gambling can cause a business to fail. </trans></eg>
</sense></hom>
<entry><form id=""bantutun"" lang=""ceb""><abbr expan=""bantutun"" type=""lemma"">-un(←)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> having tendency not to spin well. </trans>
<eg><i lang=""ceb"">Bantutun ang kasing gaan,</i><trans> Light tops tend not to spin well. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> having a tendency to fail in business.
</trans>
</sense></hom></entry></entry>");
