<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126]</itype><trans> for work or an undertaking to come out <tr>good</tr>. </trans>
<eg><i lang=""ceb"">Nabánu tingáli ang íyang pagpaninda kay midakù man ang íyang tindáhan,</i><trans> Her business must have been successful because she has enlarged her store.
