INSERT INTO `wced_entry` VALUES (2277, "banug, ban-ug", "111", "<entry page=""111"" id=""2277""><form id=""baxnug_ban-ug"" lang=""ceb"">bánug, ban-ug</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for fruits to be <tr>bruised</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB2; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>soften</tr> fruits, for fruits to get bruised. </trans>
<eg><i lang=""ceb"">Muban-ug (maban-ug) ang kapáyas <pb n=""112""/>ug sigíhag híkap,</i><trans> The papaya will get bruised if you keep touching it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> bruise by pounding. </trans>
<eg><i lang=""ceb"">Ban-úgun giyud nang tulisag hisakpan,</i><trans> They will beat up that robber if they catch him.

</trans></eg>
</sense></hom></entry>");
