INSERT INTO `wced_entry` VALUES (2278, "ban-uk1", "112", "<entry page=""112"" id=""2278""><form id=""ban-uk"" lang=""ceb"">ban-uk<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> sickness caused by a spirit of the woods (<ix>banwaánun</ix>) which intrudes sand, feathers, and hairs into the body. The sickness results from bathing in streams or bathing anywhere on Tuesdays and Fridays or may be on the instigation of a sorcerer. The symptoms are stomach pain followed by intense itchy rashes. The cure is <ix>túub.</ix> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a4b4]</itype><trans> cause to get <ix>ban-uk.</ix> 
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (2278, "ban-uk", "ban-uk", "s", "nv");
INSERT INTO `wced_entry` VALUES (2279, "ban-uk2", "112", "<entry page=""112"" id=""2279""><form id=""ban-uk2"" lang=""ceb"">ban-uk<sub>2</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>lush</tr>, plentiful in growth. </trans>
<eg><i lang=""ceb"">Ban-uk kaáyu ang sagbut sa ákung pilapilan,</i><trans> Weeds are growing lush in my rice field. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for a mass to be well-packed. </trans>
<eg><i lang=""ceb"">Pwirting ban-úka sa baráha sa kahun. Maglisud ta paghulbut ug usa,</i><trans> The cards are very tightly packed into the box. We’ll have a hard time taking one. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B26; c1]</itype><trans> get packed in tight. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[B; aPb]</itype><trans> become lush. </trans>
<eg><i lang=""ceb"">Nagkaban-uk ang buhuk ni Bal nga nagkadakù,</i><trans> Bal’s hair is becoming thicker as he is growing bigger.
</trans></eg>
</sense></hom></entry>");
