INSERT INTO `wced_entry` VALUES (2280, "banus1", "112", "<entry page=""112"" id=""2280""><form id=""banus"" lang=""ceb"">banus<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> implanted close to each other. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2; c16]</itype><trans> for standing things to be implanted close to each other. </trans>
<eg><i lang=""ceb"">Mibanus (nabanus) ang humayan nga giabunúhan,</i><trans> The field which was fertilized grew densely. </trans></eg>
<eg><i lang=""ceb"">Banusun (ibanus) gánì pagtanum ang mga lubi dílì mubúnga,</i><trans> Coconut trees planted too close to each other will not bear fruit.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (2280, "banus", "banus", "s", "av");
INSERT INTO `wced_entry` VALUES (2281, "banus2, banus", "112", "<entry page=""112"" id=""2281""><form id=""banus2_baxnus"" lang=""ceb"">banus<sub>2</sub>, bánus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; a2]</itype><trans> for s.t. to happen after s.t. else happened. </trans>
<eg><i lang=""ceb"">Mibanus ang kaínit human muulan,</i><trans> The sun shone after the rain shower. </trans></eg>
<eg><i lang=""ceb"">Bansun gánì ang tímug, mukalma ang bagyu,</i><trans> The typhoon abates when the east wind lets up. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> take over after s.o. </trans>
<eg><i lang=""ceb"">Bansi ku dinhi sa kusína kay gikápuy ku,</i><trans> Take my place in the kitchen because I’m tired. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AN; b5]</itype><trans> put on or wear s.t. which belongs to s.o. else. </trans>
<eg><i lang=""ceb"">Mamanus ku sa ímung tráhi kay wà kuy ikapatahì,</i><trans> I’ll wear your suit because I don’t have money to have one made. </trans></eg>
<eg><i lang=""ceb"">Maluag ang midiyas ug bansan (bansun) sa dakug tiil,</i><trans> The socks will loosen if s.o. with big feet wears them first. </trans></eg>
</sense></hom>
<entry><form id=""banusbaxnus"" lang=""ceb"">banusbánus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[C; b5]</itype><trans> take turns in doing s.t. </trans>
<eg><i lang=""ceb"">Magbanusbánus tag dala sa baskit,</i><trans> Let’s take turns in carrying the basket. </trans></eg>
<eg><i lang=""ceb"">Banusbanúsi (banusbanúsa) ninyug pas-an ang kawáyan,</i><trans> Take turns in carrying the bamboo on your shoulders. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3]</itype><trans> occur repeatedly one after the other. </trans>
<eg><i lang=""ceb"">Magbanusbánus ang kalípay ug kasákit,</i><trans> Joys and sorrows follow one another repeatedly.
</trans></eg>
</sense></hom></entry></entry>");
