INSERT INTO `wced_entry` VALUES (2283, "banwa1", "112", "<entry page=""112"" id=""2283""><form id=""banwa"" lang=""ceb"">banwa<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>thicket</tr>. </trans>
<eg><i lang=""ceb"">Adtu ta maggapud ug igsulugnud sa banwa,</i><trans> Let’s cut firewood in the woods. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1PB; a2]</itype><trans> become a <tr>thicket</tr>, let s.t. revert to the forest. </trans>
<eg><i lang=""ceb"">Nagbanwa (nagpabanwa) kug usa ka iktarya,</i><trans> I purposely allowed a hectare of my farm to revert to thicket. </trans></eg>
</sense></hom>
<entry><form id=""banwaaxnun"" lang=""ceb"">banwaánun</form>
<hom>
<sense n=""1""><number>1</number><trans> from the forest. </trans>
<eg><i lang=""ceb"">Banwaánung sunuy,</i><trans> Wild rooster. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <xr lang=""ceb"" target=""#tagabanwa"">= <sc>tagabanwa</sc>.</xr> </trans>
</sense></hom></entry>
<entry><form id=""tagabanwa_tagibanwa_banwaaxnun"" lang=""ceb""><abbr expan=""tagabanwa"" type=""lemma"">taga-</abbr>, <abbr expan=""tagibanwa"" type=""lemma"">tagi-</abbr>, banwaánun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> supernatural beings which inhabit woodlands, victimize people by rendering them invisible, and are capable of inflicting diseases. Sometimes they show themselves and even make love to women.
</trans>
</sense></hom></entry></entry>");
