INSERT INTO `wced_entry` VALUES (2300, "bara", "113", "<entry page=""113"" id=""2300""><form id=""baxra"" lang=""ceb"">bára</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>steel bar</tr>, <tr>rod</tr>. </trans>
</sense></hom>
<entry><form id=""baxra_dikabra"" lang=""ceb""><abbr expan=""bára"" type=""lemma"">—</abbr> dikabra</form>
<hom>
<sense n=""0""><trans> <tr>crowbar</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>frame</tr> of a bicycle. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>measurement</tr>, the span from the shoulder to the tip of the opposite hand with the arm extended. </trans>
</sense>
<sense n=""4""><number>4</number> <form id=""baxra_i_baxra"" lang=""ceb""><abbr expan=""bára"" type=""lemma"">—</abbr> i <abbr expan=""bára"" type=""lemma"">—</abbr></form><trans> <tr>eye for an eye and tooth for a tooth</tr>. </trans>
<eg><i lang=""ceb"">Pamaslan tikaw bára i bára sa ímung gibúhat kanákù,</i><trans> I will repay you eye for an eye and tooth for a tooth for what you have done to me. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number><trans> <tr>punishment</tr> sent to a philanderer that his daughter falls victim to a philanderer. </trans>
<eg><i lang=""ceb"">Bára nà níya nga gipaangkan ang íyang anak kay himabáyi man,</i><trans> It’s his punishment for being a philanderer that his daughter was made pregnant. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; a12]</itype><trans> make into a bar. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[b4]</itype><trans> for a girl to suffer at the hands of a philanderer as a punishment to her father. </trans>
<eg><i lang=""ceb"">Baráhan ang átung anak ug magsígi kag pamabáyi,</i><trans> Our daughter will become a victim herself if you keep chasing women. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2C; c1]</itype><trans> for a brother and sister in one family to marry a brother and sister in another. </trans>
<eg><i lang=""ceb"">Gibára sa mga Kurtis ug Sansis ang ílang mga anak,</i><trans> A son and daughter of the Corteses’ married a son and daughter of the Sanchezes’. </trans></eg>
</sense></hom></entry>
<entry><form id=""barabaxra"" lang=""ceb"">barabára</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>shaft</tr> for a horse carriage. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a]</itype><trans> make into a shaft for a carriage, put a shaft on. </trans>
</sense></hom></entry>
<entry><form id=""barabara"" lang=""ceb"">barabara</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>shaft</tr> in a pressurized kerosene lantern which holds the needle <corr sic=""controling"">controlling</corr> the width of the orifice through which the vaporized kerosene passes. </trans>
</sense></hom></entry>
<entry><form id=""barahan"" lang=""ceb"">barahan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>yard-</tr>*stick. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>criterion</tr> for measuring s.t. </trans>
</sense></hom></entry>
<entry><form id=""binara"" lang=""ceb""><abbr expan=""binara"" type=""lemma"">-in-(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. cloth of cheap quality with big, checkered prints. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> wear this sort of cloth.†
</trans>
</sense></hom></entry></entry>");
