INSERT INTO `wced_entry` VALUES (2309, "barang", "113", "<entry page=""113"" id=""2309""><form id=""baxrang"" lang=""ceb"">bárang</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> k.o. sorcery whereby insects are introduced into the intended victim. </trans>
</sense>
<sense n=""2""><number>2</number><trans> insect, usually a mutant specimen, with which <ix>bárang</ix> sorcery is performed. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
