<eg><i lang=""ceb"">Barángun siya ni Danílu,</i><trans> Danilo will inflict his sorcery on him. </trans></eg>
</sense></hom>
<entry><form id=""barangan"" lang=""ceb""><abbr expan=""barangan"" type=""lemma"">-an(→)</abbr></form>
