INSERT INTO `wced_entry` VALUES (2313, "barat", "113", "<entry page=""113"" id=""2313""><form id=""barat"" lang=""ceb"">barat</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>cheap</tr>, <tr>petty</tr>: refusing to pay a reasonable price and heeding matters not worth one’s attention. </trans>
</sense>
<sense n=""2""><number>2</number><trans> cheap, <tr>vulgar</tr>. </trans>
<eg><i lang=""ceb"">Barat na kaáyu nang bayhána, bísan kinsa lang ang ubanan,</i><trans> That woman is very cheap. Anybody can have her. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; b6]</itype><trans> for a person to become cheap. </trans>
<eg><i lang=""ceb"">Mauy ibarat nímu ug ímu siyang ashan,</i><trans> You will come to be vulgar if you attach importance to what she says. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; c1]</itype><trans> for things to be of little value, inferior, make s.t. in an inferior way. </trans>
<eg><i lang=""ceb"">Mibarat (nabarat) ang písu,</i><trans> The peso has become devalued. </trans></eg>
<eg><i lang=""ceb"">Ayúha pagtahì. Ayawg barata (ibarat),</i><trans> Sew that dress well. Don’t put out s.t. cheap. </trans></eg>
</sense></hom>
<entry><form id=""baratixra"" lang=""ceb""><abbr expan=""baratíra"" type=""lemma"">-íra</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> fond of bargaining prices down too much. </trans>
</sense></hom>
