INSERT INTO `wced_entry` VALUES (2359, "bartiha", "115", "<entry page=""115"" id=""2359""><form id=""bartixha"" lang=""ceb"">bartíha</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>plank</tr>, <tr>board</tr>. </trans>
<eg><i lang=""ceb"">Gilugkat ang usa ka bartíha sa bungbung,</i><trans> One plank was torn off the wall. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>parcel</tr>, block of land. </trans>
<eg><i lang=""ceb"">Bahínun sa tulu ka bartíha ang ílang yútà,</i><trans> Their land will be divided into three parcels. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>share</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1]</itype><trans> make, or cut into planks or boards. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6(1)]</itype><trans> put a board between two things. </trans>
<eg><i lang=""ceb"">Bartihái ang kanal arun makalabang ang kutsi,</i><trans> Place some planks over the canal so the car can pass over it. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> <tr>divide</tr>, cut up into pieces or sections. </trans>
<eg><i lang=""ceb"">Hukum ang mubartíha (magbartíha) sa yútà nga iapud-apud sa mga anak,</i><trans> A judge will apportion the land that will be distributed among the children. </trans></eg>
<eg><i lang=""ceb"">Bartiháa ang kík sa walu ka bátà,</i><trans> Divide the cake among the eight children. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A]</itype><trans> get a share or a part of. </trans>
<eg><i lang=""ceb"">Nakabartíha siyag duha ka gatus sa usa ka byáhi,</i><trans> His share in one trip was two hundred pesos.
</trans></eg>
</sense></hom></entry>");
