INSERT INTO `wced_entry` VALUES (2364, "barug", "115", "<entry page=""115"" id=""2364""><form id=""barug"" lang=""ceb"">barug</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[APB36; c1P]</itype><trans> <tr>stand</tr>, stand up, cause to do so. </trans>
<eg><i lang=""ceb"">Mubarug kita inigtugtug sa nasudnung áwit,</i><trans> Let us stand when the national anthem is played. </trans></eg>
<eg><i lang=""ceb"">Mibarug ang íya pagbása níya ug librung law-ay,</i><trans> He got a bone on (lit. his stood up) when he read the dirty book. </trans></eg>
<eg><i lang=""ceb"">Nagbarug (nagpabarug) siya sa masakitun,</i><trans> He helped the sick man get to his feet. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[B3(1)46; c1]</itype><trans> for a building to stand, be built. </trans>
<eg><i lang=""ceb"">Sa katapúsan nagbarug nang balay nga ákung gitúkud,</i><trans> At last the house I constructed was built. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; c2]</itype><trans> stand up for one’s opinions or principles. </trans>
<eg><i lang=""ceb"">Makabarug ra giyud sa katapúsan ang matúud,</i><trans> Truth prevails in the end. </trans></eg>
<eg><i lang=""ceb"">Barugi (ibarug) ang katinúud sa ímung gipanulti,</i><trans> Stand up for the truth of your statement. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b6]</itype><trans> stand for, act as proxy for s.o., <tr>guarantee</tr> for s.o.’s obligations or rights. </trans>
<eg><i lang=""ceb"">Akuy nagbarug sa íyang útang sa bangku,</i><trans> I stood as guarantor for his debts to the bank. </trans></eg>
<eg><i lang=""ceb"">Gibarugan ku ni tiyù pagpamaláyi nákù kay wà si Tátay,</i><trans> My uncle stood for my father when I made the formal marriage proposal. <pb n=""116""/></trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B12; c1P]</itype><trans> get standing in a community. </trans>
<eg><i lang=""ceb"">Ang makabarug (makapabarug) sa táwu ang íyang prupisyun,</i><trans> A man’s profession gives him dignity. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[B2]</itype><trans> look good in s.t., for s.t. to become one. </trans>
<eg><i lang=""ceb"">Dì ka mubarug sa míni kay tag-as kag tul-an,</i><trans> You don’t look good in a mini because you have long legs. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> height. </trans>
<eg><i lang=""ceb"">Mubù ug barug,</i><trans> Of a short height. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> bearing and features. </trans>
<eg><i lang=""ceb"">Ang íyang barug daw istadista,</i><trans> His bearing is statesman-like. </trans></eg>
</sense></hom>
<entry><form id=""pamarug"" lang=""ceb""><abbr expan=""pamarug"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> stature and/or features of a person. </trans>
<eg><i lang=""ceb"">Ambúngang pamarug,</i><trans> Handsome features. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> one’s standing in a profession or any group. </trans>
</sense></hom></entry>
<entry><form id=""barugaxnan"" lang=""ceb""><abbr expan=""barugánan"" type=""lemma"">-ánan</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> principle. </trans>
<eg><i lang=""ceb"">Táwung way barugánan,</i><trans> A man without principles. </trans></eg>
</sense></hom></entry>
<entry><form id=""baruxgan"" lang=""ceb""><abbr expan=""barúgan"" type=""lemma"">(←)-an</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for a person to have a good bearing. </trans>
<eg><i lang=""ceb"">Barúgan nga pagkalaláki,</i><trans> Good-looking man.
</trans></eg>
</sense></hom></entry></entry>");
