INSERT INTO `wced_entry` VALUES (2365, "barumbada", "116", "<entry page=""116"" id=""2365""><form id=""barumbaxda"" lang=""ceb"">barumbáda</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> <tr>squander</tr> s.t. valuable. </trans>
<eg><i lang=""ceb"">Nagbarumbáda lang ka sa ímung kabílin,</i><trans> You are squandering your inheritance. </trans></eg>
<eg><i lang=""ceb"">Ibarumbáda lang níyang íyang nindut nga sinínà, gihímung pambáy,</i><trans> She wastes her beautiful dress, using it around the house.
</trans></eg>
