INSERT INTO `wced_entry` VALUES (2366, "barumbadu", "116", "<entry page=""116"" id=""2366""><form id=""barumbaxdu"" lang=""ceb"">barumbádu</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>ill-mannered</tr>. </trans>
<eg><i lang=""ceb"">Barumbádu nang anáka kay dì mangáyug katahúran sa íyang katiguwángan,</i><trans> That child is ill-mannered because he doesn’t greet his folks. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> careless in dress; wearing clothing untidily or in such a way as to destroy it. </trans>
<eg><i lang=""ceb"">Barumbádu siyang mamisti. Lúpig pay buguy,</i><trans> He dresses terribly, worse than a tramp. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>vagabond</tr>, <tr>vagrant</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2; b6]</itype><trans> become ill-mannered. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[B3(1)6; c]</itype><trans> become careless of one’s dress, treat clothes carelessly. </trans>
<eg><i lang=""ceb"">Ayaw ibarumbádu kanang ímung púlung putì sa tubaan,</i><trans> Don’t ruin your white shirt wearing it to the toddy stand. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B1; b6]</itype><trans> become a vagabond. </trans>
<eg><i lang=""ceb"">Nagbarumbádu siya sukad mapapha sa trabáhu,</i><trans> He became a tramp after he lost his job.
</trans></eg>
</sense></hom></entry>");
