INSERT INTO `wced_entry` VALUES (2371, "barut", "116", "<entry page=""116"" id=""2371""><form id=""barut"" lang=""ceb"">barut</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> tobacco that is of the lowest class. </trans>
<eg><i lang=""ceb"">Ibaligyag kinilu ang barut,</i><trans> The cheapest k.o. tobacco is sold by the kilogram. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>inferior</tr> in quality. </trans>
<eg><i lang=""ceb"">Dalì rang mulubad ang panaptung barut,</i><trans> A cloth which is inferior in quality easily fades. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> ugly to look at. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; a]</itype><trans> be, become inferior in quality or ugly. </trans>
<eg><i lang=""ceb"">Mibarut (nabarut) ang lamì sa tabákung wà maputus,</i><trans> The tobacco lost its flavor because it hadn’t been wrapped. </trans></eg>
<eg><i lang=""ceb"">Nagkabarut ang átung dapit kay midagsang ang iskwátir,</i><trans> This place is turning into an eyesore because of the proliferation of the squatters.
</trans></eg>
</sense></hom></entry>");
