INSERT INTO `wced_entry` VALUES (2374, "baryabli", "116", "<entry page=""116"" id=""2374""><form id=""baryabli"" lang=""ceb"">baryabli</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>changeable</tr>, <tr>fickle</tr>. </trans>
<eg><i lang=""ceb"">Ning tyimpung baryabli ang dátù mapubri, ang pubri maadunáhan,</i><trans> In these uncertain times the rich become poor and the poor, rich. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2]</itype><trans> be <tr>variable</tr>. </trans>
<eg><i lang=""ceb"">Ang bili sa palalítun kanúnayng mubaryabli (mabaryabli),</i><trans> Retail prices are constantly fluctuating.
</trans></eg>
</sense></hom></entry>");
