INSERT INTO `wced_entry` VALUES (2377, "basa", "116", "<entry page=""116"" id=""2377""><form id=""baxsa"" lang=""ceb"">bása</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3S; ab2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>read</tr>. </trans>
<eg><i lang=""ceb"">Dílì ku makabasa,</i><trans> I cannot read. </trans></eg>
<eg><i lang=""ceb"">Wà ku kabasa ánà,</i><trans> I haven’t <pb n=""117""/>had a chance to read that. </trans></eg>
<eg><i lang=""ceb"">Basáha ang Biblíya,</i><trans> Read the Bible. </trans></eg>
<eg><i lang=""ceb"">Basáhi siya,</i><trans> Read to him. </trans></eg>
<eg><i lang=""ceb"">Hibasahan gánì ni Tátay ang sulat sa ímung trátu,</i><trans> If Father reads your boy friend’s love letter. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>interpret</tr> signs, omens. </trans>
<eg><i lang=""ceb"">Inighuman ug urasiyun sa básu, basáhun dáyun sa tambálan ang ímung mga sakit,</i><trans> After the shaman says the magic words into a glass, he will read your sickness in it. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[a3]</itype><trans> <tr>understand</tr>, get the meaning. </trans>
<eg><i lang=""ceb"">Nabása ku sa ímung mata nga gihigugma mu siya gihápun,</i><trans> I can read in your eyes that you still love him. </trans></eg>
</sense></hom>
<entry><form id=""himasa"" lang=""ceb""><abbr expan=""himasa"" type=""lemma"">hiN-(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> fond of reading. </trans>
</sense></hom></entry>
<entry><form id=""kabasahun"" lang=""ceb"">kabasahun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> feel very much like reading. </trans>
</sense></hom></entry>
<entry><form id=""balasahun"" lang=""ceb"">balasahun</form>
<hom role=""n""><pos>n</pos>
