INSERT INTO `wced_entry` VALUES (2405, "basiyu, basiyu", "118", "<entry page=""118"" id=""2405""><form id=""basiyu_basixyu"" lang=""ceb"">basiyu, basíyu</form>
<hom role=""n""><pos>n</pos>
