<sense n=""2""><number>2</number><trans> empty <tr>plate</tr> to eat off of. </trans>
<eg><i lang=""ceb"">Panghatágig basíyu ang mga bisíta,</i><trans> Give the visitors empty plates. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2; a12]</itype><trans> for containers to be empty. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; c]</itype><trans> set the table. </trans>
<eg><i lang=""ceb"">Pamasíyu na,</i><trans> Set the table now. </trans></eg>
<eg><i lang=""ceb"">Ang plátung bag-u mauy ibasíyu,</i><trans> Set the new plates on the table. </trans></eg>
