<sense n=""3""><number>3</number><trans> for machinery (gears, propellers, etc.) not to engage. </trans>
<eg><i lang=""ceb"">Mubasíyu ang kadína sa bisiklíta,</i><trans> The bicycle chain fails to engage. </trans></eg>
<eg><i lang=""ceb"">Ug mubasíyu ang pála sa bangkà muusab ang inandaran,</i><trans> When the propeller of the boat gets out of the water, the noise of the motor changes in quality.
</trans></eg>
</sense></hom></entry>");
