INSERT INTO `wced_entry` VALUES (2412, "baskug", "118", "<entry page=""118"" id=""2412""><form id=""baskug"" lang=""ceb"">baskug</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>strong</tr> and <tr>healthy</tr>, <tr>vigorous</tr> in movement. </trans>
<eg><i lang=""ceb"">Baskug kaáyu siyang manglihuklihuk kay batan-un pa,</i><trans> He is full of pep because he is still young. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2; a]</itype><trans> be strong and healthy. </trans>
<eg><i lang=""ceb"">Ang gátas makabaskug (makapabaskug) sa láwas,</i><trans> Milk makes you strong. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b7c1]</itype><trans> do in a <tr>brisk</tr> and vigorous manner. </trans>
<eg><i lang=""ceb"">Baskúga (ibaskug, baskúgi) ang pagsíkad sa bisiklíta,</i><trans> Pedal the bicycle more briskly. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <form id=""baskug_ang_kabuxhiq"" lang=""ceb""><abbr expan=""baskug"" type=""lemma"">—</abbr> ang kabúhì</form><trans> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B3(1)]</itype><trans> for the pit of the stomach to palpitate rapidly in pain due to <ix>kabúhì.</ix> </trans>
<eg><i lang=""ceb"">Mabaskug ákung kabúhì basta mukáun kug útang tinunuan,</i><trans> The pit of my stomach palpitates fast if I eat vegetable stew cooked in coconut milk.
</trans></eg>
</sense></hom></entry>");
