INSERT INTO `wced_entry` VALUES (2417, "basta", "118", "<entry page=""118"" id=""2417""><form id=""basta"" lang=""ceb"">basta</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>provided that</tr>, <tr>if and only if</tr>. </trans>
<eg><i lang=""ceb"">Ihátag ku ning risíbu basta bayran ku nímu,</i><trans> I will give you the receipt provided that you pay me. </trans></eg>
<eg><i lang=""ceb"">Bísag magabin-an ka, basta na lang madala ákung gitúgun,</i><trans> Even if it takes half <pb n=""119""/>the night, so long as you do what you were told to do. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> [so-and-so] is the case, no matter what anyone says. </trans>
<eg><i lang=""ceb"">Na, basta, náa lagi,</i><trans> Well, that’s the way it is. There is, believe it or not. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> with commands reminding a person to keep his promise: don’t forget! </trans>
<eg><i lang=""ceb"">Basta ayaw giyud ug pakítà dinhig usab,</i><trans> Mark this, don’t ever show your face here again. </trans></eg>
<eg><i lang=""ceb"">Basta ha? Muuban ku,</i><trans> Don’t forget now. I want to go along. </trans></eg>
</sense></hom>
<entry><form id=""basta_nga_kay_basta"" lang=""ceb""><abbr expan=""basta"" type=""lemma"">—</abbr> nga, kay <abbr expan=""basta"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> to make the story short, suffice it to say that. </trans>
<eg><i lang=""ceb"">Basta nga (kay basta) pagpanganti níya, nangatágak ang buláwan,</i><trans> Anyway, when he made a wish, gold pieces fell out. </trans></eg>
</sense></hom></entry>
<entry><form id=""basta_kay"" lang=""ceb""><abbr expan=""basta"" type=""lemma"">—</abbr> kay</form>
<hom>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#basta"">= <sc>basta</sc>, <ix>1, 2.</ix></xr> </trans>
</sense></hom></entry>
<entry><form id=""bastabasta"" lang=""ceb"">bastabasta</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> not very exact, accurate. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[c1]</itype><trans> do s.t. in an inaccurate way. </trans>
<eg><i lang=""ceb"">Ug bastabastáhun (ibastabasta) nímu, alkansi ta,</i><trans> If you do it any old way, we will lose money. </trans></eg>
