INSERT INTO `wced_entry` VALUES (2437, "basul1", "119", "<entry page=""119"" id=""2437""><form id=""baxsul"" lang=""ceb"">básul<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; bc3]</itype><trans> <tr>blame</tr> s.o. for a fault. </trans>
<eg><i lang=""ceb"">Mubásul aku nímu,</i><trans> I will blame you. </trans></eg>
<eg><i lang=""ceb"">Ang draybir ang gibásul (gibasúlan) sa aksidinti,</i><trans> The driver was blamed for the accident. </trans></eg>
<eg><i lang=""ceb"">Unsa may ikabásul nímu nákù nga nagtúman man ku?</i><trans> What are you blaming me for, since I did what you said? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13; b3]</itype><trans> repent, regret having done s.t. </trans>
<eg><i lang=""ceb"">Nagbásul kung walà mupadáyun pagtuun,</i><trans> I regretted that I did not continue my studies. </trans></eg>
<eg><i lang=""ceb"">Wà kuy kabasúlan sa ákung gibúhat,</i><trans> I did nothing I regret. </trans></eg>
</sense></hom>
<entry><form id=""pagbaxsul"" lang=""ceb""><abbr expan=""pagbásul"" type=""lemma"">pag-</abbr></form>
