INSERT INTO `wced_entry` VALUES (2453, "bata", "120", "<entry page=""120"" id=""2453""><form id=""baxtaq"" lang=""ceb"">bátà</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>child</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>son</tr> or <tr>daughter</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>mistress</tr>, <tr>concubine</tr>. </trans>
</sense>
<sense n=""4""><number>4</number><trans> <tr>bodyguard</tr>, <tr>protege</tr> of s.o. of high rank. </trans>
<eg><i lang=""ceb"">Nag-abusar ábi bátà man sa prisidinti,</i><trans> He’s abusive because he’s the president’s protege. </trans></eg>
</sense></hom>
<entry><form id=""baxtaq_nga_lintiq"" lang=""ceb""><abbr expan=""bátà"" type=""lemma"">—</abbr> nga lintì</form>
<hom>
<sense n=""0""><trans> tough, ruffian. </trans>
</sense></hom></entry>
<entry><form id=""kanay_baxtaq"" lang=""ceb"">kanay <abbr expan=""bátà"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> attaboy, that’s the way you should be. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>young</tr>, in the early period of life or growth. </trans>
<eg><i lang=""ceb"">Bákang bátà,</i><trans> Young cow, heifer. </trans></eg>
<eg><i lang=""ceb"">Matul-id nímung hiwing káhuy kun bátà pa,</i><trans> You can straighten a crooked tree while it’s young. </trans></eg>
<eg><i lang=""ceb"">Bátà siyang tan-áwun,</i><trans> She looks very young. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> a <tr>novice</tr> in the field. </trans>
<eg><i lang=""ceb"">Bátà pa íyang pagkaduktur,</i><trans> He’s still a novice at practicing medicine. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> for the hour to be early. </trans>
<eg><i lang=""ceb"">Bátà pa ang kagabhíun,</i><trans> The night is still young. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2; a]</itype><trans> get to be young-looking. </trans>
<eg><i lang=""ceb"">Mibátà kang tan-áwun niánang sinináa,</i><trans> You look young in that dress. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; a12]</itype><trans> make s.o. his mistress or protegee. </trans>
<eg><i lang=""ceb"">Nakabátà kug mistísa,</i><trans> I had a mistress with a Spanish blood. </trans></eg>
<eg><i lang=""ceb"">Matun íyang gibátà,</i><trans> He made a goon into his protege. </trans></eg>
</sense></hom></entry>
<entry><form id=""bataq"" lang=""ceb""><abbr expan=""batà"" type=""lemma"">(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> rear s.o. from childhood. </trans>
<eg><i lang=""ceb"">Gibátà ku ni Tiyù pagkamatay ni Tátay,</i><trans> My uncle took care of me after my father died. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1; c1]</itype><trans> grow up in a certain atmosphere. </trans>
<eg><i lang=""ceb"">Nagbatà aku sa kakabus,</i><trans> I grew up in poverty. </trans></eg>
<eg><i lang=""ceb"">Bataa (ibatà) siya sa kabuútan,</i><trans> Rear him in an atmosphere of honesty. </trans></eg>
</sense></hom></entry>
<entry><form id=""pakabaxtaq"" lang=""ceb""><abbr expan=""pakabátà"" type=""lemma"">paka-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> act like, consider, treat like a child. </trans>
<eg><i lang=""ceb"">Ayaw ku pakabatáa. Antígu na bítaw ku,</i><trans> Don’t treat me like a baby. I know how already! </trans></eg>
</sense></hom></entry>
<entry><form id=""bataqbaxtaq"" lang=""ceb"">batàbátà</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> right-hand man. </trans>
</sense>
<sense n=""2""><number>2</number><trans> bodyguard. </trans>
</sense>
<sense n=""3""><number>3</number><trans> protege. </trans>
</sense>
<sense n=""4""><number>4</number><trans> errand boy, right-hand man. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; a1]</itype><trans> request s.o. to run an errand for him. </trans>
<eg><i lang=""ceb"">Ibatàbátà ra kug palit ug bínu,</i><trans> Do me a favor and get some wine. </trans></eg>
</sense></hom></entry>
<entry><form id=""bataqbataq"" lang=""ceb"">batàbatà</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> younger. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#binaxtaq"">= <sc>binátà</sc>.</xr> </trans>
</sense></hom></entry>
<entry><form id=""bataqbataun"" lang=""ceb"">batàbataun</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> childish. </trans>
</sense>
<sense n=""2""><number>2</number><trans> fond of children. </trans>
</sense></hom></entry>
<entry><form id=""binaxtaq"" lang=""ceb""><abbr expan=""binátà"" type=""lemma"">-in-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> acting like a child. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> act like a child. </trans>
<eg><i lang=""ceb"">Ayawg ibinátà (binatáa) ang ímung sinultihan,</i><trans> Don’t talk in a childish way. </trans></eg>
<eg><i lang=""ceb"">Ug binatáan ku níya, mawálà ákung kasukù,</i><trans> When she acts like a little child to me, my anger vanishes. </trans></eg>
</sense></hom></entry>
<entry><form id=""binat-an"" lang=""ceb"">binat-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> way s.o. takes care of children. </trans>
</sense></hom></entry>
<entry><form id=""kabaxtaq"" lang=""ceb""><abbr expan=""kabátà"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> childhood friend. </trans>
</sense></hom></entry>
<entry><form id=""kabaxtaan"" lang=""ceb""><abbr expan=""kabátaan"" type=""lemma"">ka-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> children. </trans>
</sense></hom></entry>
<entry><form id=""batan-un"" lang=""ceb"">batan-un</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> young, youthful. </trans>
<eg><i lang=""ceb"">Batan-un pa siyang naminyù,</i><trans> He got married while he was still quite young. </trans></eg>
</sense></hom></entry>
<entry><form id=""kabatan-un"" lang=""ceb"">kabatan-un</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the days of one’s youth. </trans>
<eg><i lang=""ceb"">Kun handúmun nátù ang átung kabatan-un,</i><trans> When we reminisce about our youth. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> state of being young. </trans>
</sense></hom></entry>
<entry><form id=""bataut"" lang=""ceb""><abbr expan=""bataut"" type=""lemma"">-ut(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> naughty child, usually used as a term of address. </trans>
<eg><i lang=""ceb"">Uy bataut ka,</i><trans> Hey, you naughty boy! </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> childish <pb n=""121""/>in behavior. </trans>
<eg><i lang=""ceb"">Dalága ka na piru bataut gihápun,</i><trans> You’re grown-up, but you act like a child. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> become childish.
</trans>
</sense></hom></entry></entry>");
