INSERT INTO `wced_entry` VALUES (2466, "batang2, batang1", "121", "<entry page=""121"" id=""2466""><form id=""batang2_baxtang"" lang=""ceb"">batang<sub>2</sub>, bátang<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> <tr>lie</tr> <tr>prostrate</tr>. </trans>
<eg><i lang=""ceb"">Nagbatang na ang masakitun ug pila ka búlan sa banig,</i><trans> The patient has been bed-ridden for several months. </trans></eg>
<eg><i lang=""ceb"">Ibatang ang ímung láwas sa baybáyun,</i><trans> Lie down on the beach. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> keep <tr>still</tr> without moving. </trans>
<eg><i lang=""ceb"">Ipabatang (pabatanga) ímung tuu, suntuk sa wala,</i><trans> Keep your right arm in place and hit with your left. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>stay</tr> in a place permanently. </trans>
<eg><i lang=""ceb"">Pabatangun ku nímu dinhi hangtud sa hangtud?</i><trans> Will you make me stay in this place forever? </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> stick around s.w. without doing anything. </trans>
<eg><i lang=""ceb"">Nagpabatang ka dihà nga daghan man tag trabáhu?</i><trans> Why are you sitting around there doing nothing when there is so much to do? </trans></eg>
</sense></hom>
<entry><form id=""pabaxtang"" lang=""ceb""><abbr expan=""pabátang"" type=""lemma"">pa-(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. longline fishing, usually for sharks.
