INSERT INTO `wced_entry` VALUES (2473, "batasan", "121", "<entry page=""121"" id=""2473""><form id=""bataxsan"" lang=""ceb"">batásan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>custom</tr>, usual way of acting. </trans>
<eg><i lang=""ceb"">Batásan námung mangadyì únà mangáun,</i><trans> It’s our custom to pray before eating. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> one’s <tr>manners</tr>, way of dealing with s.o. </trans>
<eg><i lang=""ceb"">Maáyung batásan,</i><trans> Good way of dealing with people. </trans></eg>
<eg><i lang=""ceb"">Way batásan,</i><trans> Having no manners. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A23; c1]</itype><trans> make doing s.t. a habit. </trans>
<eg><i lang=""ceb"">Nabatásan na sa mga kutsíru ang pagpílì sa ílang sakay,</i><trans> The rig drivers have gotten into the habit of choosing their passengers. </trans></eg>
<eg><i lang=""ceb"">Ibatásan (batasánun) ku sa ákung mga anak ang kamatinahúrun,</i><trans> I will train my children to be respectful. <pb n=""122""/></trans></eg>
</sense></hom>
<entry><form id=""pamataxsan"" lang=""ceb""><abbr expan=""pamatásan"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> proper behavior, the social conventions. </trans>
<eg><i lang=""ceb"">Pamatásan sa mga militar ang pagsaludar,</i><trans> Saluting is a part of military courtesy. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> set of customs.
</trans>
</sense></hom></entry></entry>");
