INSERT INTO `wced_entry` VALUES (2479, "bati", "122", "<entry page=""122"" id=""2479""><form id=""batiq"" lang=""ceb"">batì</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>inferior</tr> in quality. </trans>
<eg><i lang=""ceb"">Ayaw pagpalit ug sinínang batì,</i><trans> Don’t buy clothes which are inferior in quality. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>ugly</tr> (derisive). </trans>
<eg><i lang=""ceb"">Batig dagway,</i><trans> Ugly in face. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; a2]</itype><trans> for s.t. to get to be of poor quality. </trans>
<eg><i lang=""ceb"">Mabatì ang lamì sa tinúlang isdag kaugmaan,</i><trans> Fish stew develops a bad flavor if you keep it till the following day. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; a1]</itype><trans> get to be ugly. </trans>
<eg><i lang=""ceb"">Mauy nakabatì (nakapabatì) sa átung syudad ning mga balungbálung,</i><trans> These shacks are what makes our city ugly.
</trans></eg>
</sense></hom></entry>");
