INSERT INTO `wced_entry` VALUES (2509, "batsi2", "123", "<entry page=""123"" id=""2509""><form id=""batsi2"" lang=""ceb"">batsi<sub>2</sub></form>
<hom>
<sense n=""0""><trans> (slang, from <ix>sibat</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; c]</itype><trans> <tr>get out</tr> of s.t., <tr>run away</tr>. </trans>
<eg><i lang=""ceb"">Mibatsi si Títù sa íyang buluhatun,</i><trans> Tito bugged out of the chores. </trans></eg>
<eg><i lang=""ceb"">Nakabatsi ang mamumúnù sa prisuhan,</i><trans> The prisoner escaped from the jail. </trans></eg>
<eg><i lang=""ceb"">Batsíhan pa nà nímung ímung asáwa,</i><trans> If you just run away from your wife. </trans></eg>
<eg><i lang=""ceb"">Ákung ibatsi ang ákung trátu,</i><trans> I will run away with my girl friend. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; ac1]</itype><trans> steal, get s.t. by foul or illegal means. </trans>
<eg><i lang=""ceb"">Si Pilu ang mubatsi sa ilimnun,</i><trans> Pilo will steal the drinks.
</trans></eg>
</sense></hom></entry>");
