INSERT INTO `wced_entry` VALUES (2512, "batu1", "123", "<entry page=""123"" id=""2512""><form id=""batu"" lang=""ceb"">batu<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>rock</tr>, <tr>stone</tr>, <tr>pebble</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>precious stone</tr>, <tr>kidney stone</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> s.t. that has hardened. </trans>
<eg><i lang=""ceb"">Batu na ang kukakúla,</i><trans> The coca-cola has frozen solid now. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <tr>piece</tr> used in a game of checkers, chess, </trans>
<eg><i lang=""ceb"">sungkà,</i><trans> or any game that uses pieces. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> <tr>flint</tr> in a lighter. </trans>
</sense>
<sense n=""6""><number>6</number> <form id=""batung_buxhiq"" lang=""ceb""><abbr expan=""batung"" type=""lemma"">-ng</abbr> búhì</form><trans> </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. stone which is heavy, compact, hard, whitish, and which pops when heated. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; a1P]</itype><trans> harden into stone. </trans>
<eg><i lang=""ceb"">Ayaw paulani ang simintu kay mubatu nà,</i><trans> Don’t expose the cement to the rain because it will harden. </trans></eg>
<eg><i lang=""ceb"">Batuhun pagpagáhì ang balikutsa,</i><trans> Let the coconut candy harden like stone. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AP; a2P]</itype><trans> </trans>
</sense>
<sense n=""a""><number>a</number><trans> stand stock-still like a stone. </trans>
<eg><i lang=""ceb"">Mubatu (mupabatu) man lang ug sugúun,</i><trans> He just stands there when he’s told to do s.t. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> harden oneself to s.t. </trans>
<eg><i lang=""ceb"">Nabatu na ang nawung niánang bayhána,</i><trans> That woman has become hardened to insults. </trans></eg>
</sense>
