INSERT INTO `wced_entry` VALUES (2521, "batuk1", "124", "<entry page=""124"" id=""2521""><form id=""baxtuk"" lang=""ceb"">bátuk<sub>1</sub></form>
<hom>
<sense n=""0""><trans> <tr>against</tr>, <tr>versus</tr>. </trans>
<eg><i lang=""ceb"">Ang áway ni Balug bátuk Di Liyun,</i><trans> The fight of Balug versus De Leon. </trans></eg>
<eg><i lang=""ceb"">Tambal bátuk sa sip-un,</i><trans> A medicine against colds. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A23C12; b(1)]</itype><trans> <tr>oppose</tr>. </trans>
<eg><i lang=""ceb"">Dì aku mubátuk sa ákung mga labaw,</i><trans> I will not oppose my superiors. </trans></eg>
<eg><i lang=""ceb"">Ayaw batúki ang pagbuut sa ímung ginikánan,</i><trans> Don’t oppose the wishes of your parents. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b]</itype><trans> respond to a hurt by being cold or silent to the perpetrator. </trans>
<eg><i lang=""ceb"">Dílì maáyung magbátuk sa ginikánan kun kasab-an,</i><trans> It’s no good to feel resentment against your parents if they scold you. </trans></eg>
</sense></hom>
<entry><form id=""mabinaxtukun"" lang=""ceb""><abbr expan=""mabinátukun"" type=""lemma"">ma-in-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> resentful, tending to respond to slights by coldness.
</trans>
</sense></hom></entry></entry>");
