INSERT INTO `wced_entry` VALUES (2530, "batun1", "124", "<entry page=""124"" id=""2530""><form id=""batun"" lang=""ceb"">batun<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A1; b(1)]</itype><trans> <tr>have</tr> or <tr>possess</tr> s.t. </trans>
<eg><i lang=""ceb"">Nagbatun siya ug dakung hibalu,</i><trans> He is deeply learned. </trans></eg>
<eg><i lang=""ceb"">Ayaw batuni ang pagdumut,</i><trans> Do not nurse your hatred. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b(1)]</itype><trans> have a servant. </trans>
<eg><i lang=""ceb"">Nakabatun kamig kiriwan kaáyu,</i><trans> We had a thieving servant. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b(1)]</itype><trans> take <pb n=""125""/>care of s.t. </trans>
<eg><i lang=""ceb"">Kinsay mibatun sa bátà pagkapíang niíni?</i><trans> Who was looking after the child when he broke his leg? </trans></eg>
<eg><i lang=""ceb"">Batuni kinig maáyu kay handumánan ni nátù,</i><trans> Take good care of this because it is a souvenir. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[AN; b(1)]</itype><trans> raise and take care of s.o. else’s domesticated animal for a consideration, usually for half the offspring. </trans>
<eg><i lang=""ceb"">Siyay namatun sa ákung anay,</i><trans> He raised my sow for half the litter. </trans></eg>
