INSERT INTO `wced_entry` VALUES (2543, "batyag", "125", "<entry page=""125"" id=""2543""><form id=""batyag"" lang=""ceb"">batyag</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b8]</itype><trans> <tr>notice</tr>, be aware of s.t. </trans>
<eg><i lang=""ceb"">Wà ku makabatyag sa ulan kay nahinánuk aku,</i><trans> I didn’t notice the rain because I was sound asleep. </trans></eg>
<eg><i lang=""ceb"">Nabatyagan ku siya nga milabay dinhi,</i><trans> I noticed him passing by here. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3P]</itype><trans> make s.o. aware. </trans>
<eg><i lang=""ceb"">Ang paghut sa irù nakabatyag (nakapabatyag) kanákù nga dinhay misulud,</i><trans> The dog’s barking made me aware that s.o. had come in. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2N; a12Nb2]</itype><trans> have physical sensations. </trans>
<eg><i lang=""ceb"">Mubatyag ka gánì sa kutukutu mu, risulta na nà sa ínum,</i><trans> If you feel pain in the pit of your stomach, it’s the result of drinking. </trans></eg>
<eg><i lang=""ceb"">Pamatyágun (batyágun) nímu ang kasakit unyà,</i><trans> You will feel the pain later. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> feeling, sensation. </trans>
<eg><i lang=""ceb"">Pamatyag sa kaluud,</i><trans> A sensation of vomiting.
</trans></eg>
</sense></hom></entry>");
