INSERT INTO `wced_entry` VALUES (2567, "bawhag", "126", "<entry page=""126"" id=""2567""><form id=""bawhag"" lang=""ceb"">bawhag</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> doing things unthinkingly. </trans>
<eg><i lang=""ceb"">Bawhága níyang milabang sa dálan way lingìlíngì,</i><trans> How <tr>careless</tr> of her to cross the street without looking to the right or left. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> unthinking in speech. </trans>
<eg><i lang=""ceb"">Bawhága nímu, magpalumaluma ka mag sáad,</i><trans> You talk too much. You make promises you can’t possibly fulfill. </trans></eg>
<eg><i lang=""ceb"">Bawhága nímu. Nabungat tu <corr sic=""nimu"">nímu</corr> nga wà tà tu siya kahibalu,</i><trans> How careless of you. You let it slip out when he wouldn’t have even known about it. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> be unthinking in what one does.
</trans>
</sense></hom></entry>");
