INSERT INTO `wced_entry` VALUES (2569, "bawi", "126", "<entry page=""126"" id=""2569""><form id=""baxwiq"" lang=""ceb"">báwì</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>take back</tr> s.t. lent or given. </trans>
<eg><i lang=""ceb"">Ug dì ka mubáwì sa ímung gisulti,</i><trans> If you don’t take back what you said. </trans></eg>
<eg><i lang=""ceb"">Dì na mabáwì kay binayran,</i><trans> You can’t get it back because it’s been paid for. </trans></eg>
<eg><i lang=""ceb"">Gibawían ang saup sa íyang uma,</i><trans> The tenant had his land repossessed on him. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>save</tr>, <tr>deliver</tr> (Biblical). </trans>
<eg><i lang=""ceb"">Bawíun mu kami sa mga panulay,</i><trans> Deliver us from evil. </trans></eg>
</sense></hom>
<entry><form id=""bawi"" lang=""ceb""><abbr expan=""bawi"" type=""lemma"">(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; a12]</itype><trans> <tr>recoup</tr> one’s losses, recover one’s investment. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; ac]</itype><trans> recompense, make up for s.t. </trans>
<eg><i lang=""ceb"">Way makabawì sa ímung salà kanákù,</i><trans> Nothing can make up for the wrong you have done me. </trans></eg>
<eg><i lang=""ceb"">Bawia ang ímung kalaksut pinaági sa kabuútan,</i><trans> Compensate for your ugliness by being nice. </trans></eg>
<eg><i lang=""ceb"">Kining kwarta ibawì sa ímung giantus,</i><trans> This money is to compensate for your sufferings. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AB236; c1]</itype><trans> bring s.t. back onto course by pulling it in the opposite direction; get back on course. </trans>
<eg><i lang=""ceb"">Aku ang mibawì sa manubíla,</i><trans> I turned the steering wheel to the opposite direction to get the car on course. </trans></eg>
<eg><i lang=""ceb"">Ug dílì mubawì ang barútu,</i><trans> If the boat doesn’t right itself. </trans></eg>
<eg><i lang=""ceb"">Inigkíling sa sakayan ibawì (bawia) sa tuu,</i><trans> When the boat tilts, pull it to the right.
</trans></eg>
</sense></hom></entry></entry>");
