INSERT INTO `wced_entry` VALUES (2592, "baya1", "127", "<entry page=""127"" id=""2592""><form id=""bayaq"" lang=""ceb"">bayà<sub>1</sub></form>
<hom>
<sense n=""1""><number>1</number><trans> particle giving an admonitary tone. </trans>
</sense>
<sense n=""a""><number>a</number><trans> <ix>with an imperative:</ix> make sure that, better do. </trans>
<eg><i lang=""ceb"">Hinumdumi bayà,</i><trans> You’d better remember. </trans></eg>
<eg><i lang=""ceb"">Sigurúa bayà ha,</i><trans> Make sure you do it! </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> <ix>with a statement:</ix> watch out. </trans>
<eg><i lang=""ceb"">Mamáak bayà nà,</i><trans> Watch out! He bites. </trans></eg>
<eg><i lang=""ceb"">Ikaw bayà ang nanghilabut, ayaw pamasángil,</i><trans> You touched it. Don’t try to make excuses. </trans></eg>
</sense>
<sense n=""c""><number>c</number><trans> <xr lang=""ceb"" target=""#bayaxay"">= <sc>bayáay</sc>.</xr> </trans>
</sense>
<sense n=""2""><number>2</number><trans> <ix>particle with a statement or exclamation:</ix> [so-and-so] is different than it should be. </trans>
<eg><i lang=""ceb"">Tiawtíaw ka bayà,</i><trans> You’re joking, though you shouldn’t be. </trans></eg>
<eg><i lang=""ceb"">Bayà, nagbinátà ka dihà,</i><trans> Hmm, you’re acting like a child. </trans></eg>
<eg><i lang=""ceb"">Kabuútan bayà nímu,</i><trans> How good of you, but you shouldn’t have. </trans></eg>
<eg><i lang=""ceb"">Bayang kusúga níyang midágan, mu rag unsáun siya,</i><trans> God! How he ran away. As if I were going to do s.t. to him. </trans></eg>
<eg><i lang=""ceb"">‘Panginum mu áning kúk, u.’—‘Busug pa bayà ku, bay,’</i><trans> ‘Here, drink this coke.’—‘No thanks, I’m still full.’ </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> why should that be the case when ... </trans>
<eg><i lang=""ceb"">Wà nay bugas? Nagpalit bayà aku gahápun,</i><trans> There’s no rice? Why? I just bought some yesterday. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <ix>particle conceding that s.t. is the case which one didn’t think to be so.</ix> </trans>
<eg><i lang=""ceb"">Nákug dì ka kamaung mulútù. Lamì bayà,</i><trans> I thought you didn’t know how to cook. But I must say it’s good. </trans></eg>
<eg><i lang=""ceb"">Pagkadakù bayà sa Manílà,</i><trans> I did not know Manila was this big. </trans></eg>
</sense></hom>
<entry><form id=""bayaxay"" lang=""ceb""><abbr expan=""bayáay"" type=""lemma"">-ay(←)</abbr></form>
<hom>
<sense n=""0""><trans> <ix>particle with a condition:</ix> a feared consequence will happen if the condition happens (had happened, were to happen). </trans>
<eg><i lang=""ceb"">Bayáay (bayà) na man ug nasakpan pa ta. Prísu giyud,</i><trans> God! If we had been caught. It would have meant jail.
</trans></eg>
</sense></hom></entry></entry>");
