INSERT INTO `wced_entry` VALUES (2595, "bayad", "127", "<entry page=""127"" id=""2595""><form id=""baxyad"" lang=""ceb"">báyad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S3S; b1]</itype><trans> <tr>pay</tr> for s.t. </trans>
<eg><i lang=""ceb"">Nagbayad mig kinyintus káda búlan,</i><trans> We paid five hundred a month. </trans></eg>
<eg><i lang=""ceb"">Bayran ku lang ug písus ang gantang,</i><trans> I’ll just pay one peso for a <ix>ganta.</ix> </trans></eg>
<eg><i lang=""ceb"">Bayran ku ra siya,</i><trans> I’ll pay him. </trans></eg>
<eg><i lang=""ceb"">Pilay ibáyad?</i><trans> How much shall we pay? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13S; b1]</itype><trans> pay a moral debt. </trans>
<eg><i lang=""ceb"">Magbáyad ka sa ímung pag-insultu nákù,</i><trans> You’ll pay for your insults to me. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>fee</tr>, <tr>charge</tr>. </trans>
<eg><i lang=""ceb"">Way báyad ang gamayng bátà,</i><trans> There is no charge for small children. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> amount which serves as payment. </trans>
<eg><i lang=""ceb"">Pilay báyad sa bibingka?</i><trans> How much do we owe for the rice cakes? </trans></eg>
<eg><i lang=""ceb"">Báyad sa ímung kaáyu,</i><trans> In return for your goodness. </trans></eg>
</sense></hom>
<entry><form id=""balayranan_balayran_balaydan_balaydanan"" lang=""ceb"">balayranan, balayran, balaydan, balaydanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> things to be paid for. </trans>
</sense></hom></entry>
<entry><form id=""igbalaxyad_igbabaxyad"" lang=""ceb""><abbr expan=""igbaláyad"" type=""lemma"">ig-l</abbr>/<abbr expan=""igbabáyad"" type=""lemma"">r-(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> amount to be paid. </trans>
</sense></hom></entry>
<entry><form id=""kabayaxran"" lang=""ceb"">kabayáran</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> recompense. </trans>
<eg><i lang=""ceb"">Ang kwartang nasunud níya kabayáran sa íyang paghágù,</i><trans> The money she inherited was a recompense for her trouble. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> retribution, punishment. </trans>
</sense></hom></entry>
<entry><form id=""panimaxyad"" lang=""ceb""><abbr expan=""panimáyad"" type=""lemma"">paniN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> just desert. </trans>
<eg><i lang=""ceb"">Ang ímung pagkabilanggù panimáyad sa ímung kamaldítu,</i><trans> You got your just deserts when you went to jail. </trans></eg>
</sense></hom></entry>
<entry><form id=""panimaxyad_sa_uxtang"" lang=""ceb""><abbr expan=""panimáyad"" type=""lemma"">—</abbr> sa útang</form>
<hom>
<sense n=""0""><trans> a man’s daughter (humorous usage—from the notion that a man pays for his sins against women by what happens to his daughter: if he commits a sin against a woman, the same thing will happen to his daughter as punishment to him). </trans>
</sense></hom></entry>
<entry><form id=""balayrunun_balaydunun_bayrunun"" lang=""ceb"">balayrunun (balaydunun, bayrunun)</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> amount to be paid off. </trans>
<eg><i lang=""ceb"">Líbu pang balayrunun ku sa bangku,</i><trans> I still have one thousand pesos to pay off to the bank.
</trans></eg>
</sense></hom></entry></entry>");
