INSERT INTO `wced_entry` VALUES (2599, "bayang1", "127", "<entry page=""127"" id=""2599""><form id=""bayang"" lang=""ceb"">bayang<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB; bc]</itype><trans> <tr>go</tr>, put s.t. where it is exposed to view or to the elements. </trans>
<eg><i lang=""ceb"">Mibayang na siya sa íyang baráha,</i><trans> He has already spread his cards open for everyone to see. </trans></eg>
<eg><i lang=""ceb"">Nagbayang sa ulan ang mga bátà,</i><trans> The children were exposed to the rain. </trans></eg>
<eg><i lang=""ceb"">Gibayang sa lamísa ang inasal,</i><trans> The roasted pig was placed on the table where everyone could see it. </trans></eg>
<eg><i lang=""ceb"">Mabayang sa katilingban ang pulitiku,</i><trans> A politician’s life is exposed to public view. <pb n=""128""/></trans></eg>
<eg><i lang=""ceb"">Pagtárug lingkud. Ayaw pagpabayang,</i><trans> Sit properly. Don’t expose yourself to public view. </trans></eg>
</sense></hom>
<entry><form id=""baxyang"" lang=""ceb""><abbr expan=""báyang"" type=""lemma"">(←)</abbr><sub>1</sub></form>
<hom role=""v""><pos>v</pos>
