INSERT INTO `wced_entry` VALUES (2608, "bayat", "128", "<entry page=""128"" id=""2608""><form id=""bayat"" lang=""ceb"">bayat</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>worn-out</tr>, dilapidated, esp. clothes. </trans>
</sense>
<sense n=""2""><number>2</number><trans> poor in quality. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>slovenly</tr> in dress. </trans>
<eg><i lang=""ceb"">Bayat ang ákung pamisti run kay magtrabáhu man ku sa uma,</i><trans> I’m slovenly dressed because I am going to work in the field. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> mentally slow, <tr>stupid</tr>. </trans>
<eg><i lang=""ceb"">Kabayat. Dúgay kaáyu nga nakat-un,</i><trans> How dull he is. It took him forever to catch on. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> sluggish, slow-moving. </trans>
</sense>
<sense n=""6""><number>6</number><trans> poor in doing things. </trans>
<eg><i lang=""ceb"">Bayat kaáyu nang musiyat,</i><trans> He is a poor shot. </trans></eg>
</sense></hom>
<entry><form id=""baxyat"" lang=""ceb""><abbr expan=""báyat"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for things to get worn out and dilapidated. </trans>
<eg><i lang=""ceb"">Nabáyat (mibáyat) na lang ning ákung sapátus sa pagkanúnayng gináwì,</i><trans> My shoes have become ragged and worn-out from constant use. </trans></eg>
<eg><i lang=""ceb"">Nagkabayat na ang ílang payag,</i><trans> Their shack is gradually falling into ruin. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be poor in quality. </trans>
<eg><i lang=""ceb"">Mabayat (mubayat) giyud nang ímung trabáhug ímung kiátan,</i><trans> Your work will turn out shoddy if you go about it carelessly. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> be slovenly. </trans>
</sense>
<sense n=""4""><number>4</number><trans> get to be dull, stupid. </trans>
</sense>
<sense n=""5""><number>5</number><trans> get to be sluggish, slow-moving. </trans>
</sense>
<sense n=""6""><number>6</number><trans> get to be unskilled in doing things. </trans>
</sense></hom></entry>
<entry><form id=""kabayatbayat"" lang=""ceb"">kabayatbayat</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> be hard put to do s.t. because of the large number of things that have to be done at once. </trans>
<eg><i lang=""ceb"">Nagkabayatbayat mig panghípus sa wà pa muabut ang mga bisíta,</i><trans> We were in a dither trying to clean up before the visitors arrived.

</trans></eg>
</sense></hom></entry></entry>");
