<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[APB236; c1]</itype><trans> <tr>raise</tr>, <tr>rise</tr> into the air. </trans>
<eg><i lang=""ceb"">Ang hánging kusug mauy nagbáyaw (nagpabáyaw) sa papil,</i><trans> The strong wind blew the papers into the air. </trans></eg>
