INSERT INTO `wced_entry` VALUES (2614, "bayhun", "128", "<entry page=""128"" id=""2614""><form id=""bayhun"" lang=""ceb"">bayhun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>carriage</tr>, <tr>bearing</tr> of a person. </trans>
<eg><i lang=""ceb"">Gikaibgan kung ambúngan níyang bayhun,</i><trans> I admire his handsome posture. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>gait</tr> in walking. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>outline</tr>, <tr>appearance</tr> of s.t. </trans>
<eg><i lang=""ceb"">Makítà gíkan sa lungsud ang bayhun sa payag ibábaw sa bungtud,</i><trans> The outline of the shack on the top of the hill is visible from the town. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> having the form of (Biblical usage). </trans>
<eg><i lang=""ceb"">Ang láwas ug dugù ni Kristu sa bayhun sa pán ug bínu,</i><trans> The flesh and blood of Christ in the form of bread and wine. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; c6]</itype><trans> swing the arms in walking. </trans>
<eg><i lang=""ceb"">Ibayhun ímung paglakaw,</i><trans> Walk swinging your arms. </trans></eg>
</sense></hom>
<entry><form id=""pamayhun"" lang=""ceb""><abbr expan=""pamayhun"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> way of walking. </trans>
<eg><i lang=""ceb"">Ilhan ta ka bisag layù sa ímu lang pamayhun,</i><trans> I know you from afar by your carriage. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> appearance.
</trans>
</sense></hom></entry></entry>");
