</sense></hom></entry>
<entry><form id=""pamalaxyi"" lang=""ceb"">pamaláyi</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b]</itype><trans> ask a girl’s hand from her parents. </trans>
<eg><i lang=""ceb"">Kinsa may dakung táwu sa ímung pamaláyi?</i><trans> When you asked for her hand in marriage, who was the spokesman? </trans></eg>
<eg><i lang=""ceb"">Gipamay-an na siya,</i><trans> S.o. has already asked for her hand in marriage. </trans></eg>
</sense></hom></entry>
<entry><form id=""babayixru"" lang=""ceb"">babayíru</form>
