INSERT INTO `wced_entry` VALUES (2624, "baylan", "129", "<entry page=""129"" id=""2624""><form id=""baylan"" lang=""ceb"">baylan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a person supposed to have close and friendly relationships with supernatural beings, evil or good, such that he can deal with them on behalf of other people: he can ask them to bring illness or cure illnesses of any sort, natural or supernatural in cause. He officiates at offerings (<ix>diwáta</ix>) and at folk weddings and other ceremonies in relation to supernatural beings. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B156]</itype><trans> be, become a <ix>baylan.</ix>
</trans>
</sense></hom></entry>");
