INSERT INTO `wced_entry` VALUES (2625, "bayli", "129", "<entry page=""129"" id=""2625""><form id=""bayli"" lang=""ceb"">bayli</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>dance</tr>, <tr>ball</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; b1c3]</itype><trans> do ballroom dancing. </trans>
<eg><i lang=""ceb"">Gibaylíhan (gikabayli) nákù si Rús,</i><trans> I danced with Rose. </trans></eg>
<eg><i lang=""ceb"">Dúm kaáyu ang ílang gibaylíhan,</i><trans> The place where they are dancing is very dim. </trans></eg>
<eg><i lang=""ceb"">Kining sunatáha maáyung baylíhan,</i><trans> This song is a good one to dance to. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A1; a12]</itype><trans> hold a dance. </trans>
</sense></hom>
<entry><form id=""baylixhan_baylihaxnan"" lang=""ceb"">baylíhan, baylihánan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> dance hall, floor. </trans>
</sense></hom></entry>
<entry><form id=""baylirixna"" lang=""ceb""><abbr expan=""baylirína"" type=""lemma"">-rína</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> woman fond of, skilled in dancing. </trans>
</sense>
<sense n=""2""><number>2</number><trans> taxi dancer. </trans>
</sense>
<sense n=""3""><number>3</number><trans> ballerina. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B16; a12]</itype><trans> become skilled in dancing, a ballerina or a taxi dancer.
</trans>
</sense></hom></entry></entry>");
