INSERT INTO `wced_entry` VALUES (2626, "baylu", "129", "<entry page=""129"" id=""2626""><form id=""baylu"" lang=""ceb"">baylu</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[C; ac1]</itype><trans> <tr>exchange</tr>. </trans>
<eg><i lang=""ceb"">Magbaylu tag lápis,</i><trans> Let’s exchange pencils. </trans></eg>
<eg><i lang=""ceb"">Baylúi ug manuk ang ákung mais,</i><trans> Barter my corn for a chicken. </trans></eg>
<eg><i lang=""ceb"">Ayaw ibaylu ang ímung sapátus sa íyang pantalun,</i><trans> Don’t swap your shoes for his pants. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; a2]</itype><trans> take s.t. with the understanding that one will give it or its equivalent back. </trans>
<eg><i lang=""ceb"">Bayluun kung ímung dus písus,</i><trans> I will borrow your two pesos. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b6(1)]</itype><trans> buy things for immediate household use. </trans>
<eg><i lang=""ceb"">Pagbaylu ngadtug sigarilyu,</i><trans> Go buy some cigarettes. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. one borrowed from s.o. else. </trans>
<eg><i lang=""ceb"">Ang baylu mung kwarta nákù wà nímu ilisdi,</i><trans> You did not repay the money you borrowed from me. </trans></eg>
</sense></hom>
<entry><form id=""bayluay_bayluxay"" lang=""ceb"">bayluay, baylúay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C]</itype><trans> exchange with one another.
</trans>
</sense></hom></entry></entry>");
