<sense n=""0""><trans> woman’s genitalia (lit. rice cake with a single crack). </trans>
</sense></hom></entry>
<entry><form id=""bibingka_nga_hilaw"" lang=""ceb""><abbr expan=""bibingka"" type=""lemma"">—</abbr> nga hilaw</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> woman’s genitalia. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> make rice cakes. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A123P; a12]</itype><trans> put between the devil and the deep blue sea (from the idea that the <ix>bibingka</ix> is baked in between two fires). </trans>
<eg><i lang=""ceb"">Ug mupaúlì ku kasab-an. Ug dílì, kasab-an sad. Nabibingka ku,</i><trans> If I go home, I’ll be cussed out. If not, I’ll be cussed out, too. I’m between the devil and the deep blue sea.
</trans></eg>
</sense></hom></entry></entry>");
