<sense n=""1""><number>1</number><trans> <tr>give</tr> s.t. which has been extorted. </trans>
<eg><i lang=""ceb"">Ug dì ka mubigay, dì ka kapasar,</i><trans> If you don’t give a bribe, you won’t pass. </trans></eg>
<eg><i lang=""ceb"">Bigyan giyud ang mga dispatsir,</i><trans> You have to pay protection money to the dispatchers. </trans></eg>
