<eg><i lang=""ceb"">Mubigay nà siyag íyang uyab ang kasáyaw,</i><trans> She will give herself freely if her boyfriend is her dancing partner. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A12; b6]</itype><trans> have sexual intercourse with (slang). </trans>
<eg><i lang=""ceb"">Bigyan nákung ákung hinigugma,</i><trans> I’ll have sexual intercourse with my girl. </trans></eg>
