<sense n=""5""><number>5</number><trans> purposely lose a point in jai-alai to enable the opponent to get it. </trans>
<eg><i lang=""ceb"">Ug ibigay nà níya run, dì na kadaug,</i><trans> If he purposely loses this game, he can’t win any more. </trans></eg>
