INSERT INTO `wced_entry` VALUES (2707, "bihag", "133", "<entry page=""133"" id=""2707""><form id=""bixhag"" lang=""ceb"">bíhag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> bring into captivity. </trans>
<eg><i lang=""ceb"">Mga múrus ang mibíhag sa mga Bisayà,</i><trans> Muslims who captured and carried away Visayan people. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> attract the attention. </trans>
<eg><i lang=""ceb"">Makabíhag sa átung pagtagad,</i><trans> Can attract our attention. </trans></eg>
<eg><i lang=""ceb"">Bihágun ku ang ímung kasingkásing,</i><trans> I’ll captivate your heart. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for fowls to attract another fowl not belonging to the flock. </trans>
<eg><i lang=""ceb"">Nabíhag ákung sunuy sa ílang himungáan,</i><trans> My rooster was attracted to stay at their place by their hen. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A3P; b4]</itype><trans> <tr>defeat</tr> in a contest such that the loser is given to the winner, most commonly in cockfighting. </trans>
<eg><i lang=""ceb"">Gibihágan mig duha,</i><trans> We lost (had defeated on us) two cocks. </trans></eg>
</sense></hom>
<entry><form id=""bihaxg"" lang=""ceb""><abbr expan=""bihág"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> person <tr>captured</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> fowls attracted to another flock. </trans>
</sense>
<sense n=""3""><number>3</number><trans> s.t. lost in a contest where the winner takes the loser, esp. the defeated cock. </trans>
</sense></hom></entry>
<entry><form id=""bihagay"" lang=""ceb"">bihagay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; a12]</itype><trans> for keeps, such that the winner gets the loser’s thing. </trans>
<eg><i lang=""ceb"">Nagbihagay silag húlin,</i><trans> They are playing marbles for keeps. </trans></eg>
</sense></hom></entry>
<entry><form id=""makabibixhag_mabixhagun"" lang=""ceb""><abbr expan=""makabibíhag"" type=""lemma"">maka-r-</abbr>, <abbr expan=""mabíhagun"" type=""lemma"">ma-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> attractive, captivating. </trans>
</sense></hom></entry>
<entry><form id=""mamimixhag"" lang=""ceb""><abbr expan=""mamimíhag"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. that is a steady winner, and wins over the loser. </trans>
<eg><i lang=""ceb"">Mahal kining sunúya hay mamimíhag,</i><trans> This is a valuable cock because it is a steady winner.
</trans></eg>
</sense></hom></entry></entry>");
