<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>busy</tr>, <tr>preoccupied</tr> because of too many things to do at once. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>encumbering</tr>, causing extra work. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> get encumbered, too busy with many things. </trans>
<eg><i lang=""ceb"">Makabikang (makapabikang) ning mga silya sa ákung paglampásu,</i><trans> These chairs make it all the harder to get the floor scrubbed. </trans></eg>
<eg><i lang=""ceb"">Nagkabikang ku sa trabáhu nga nagkadaghan na ning mga táwu dinhi,</i><trans> I have so much work now that there are so many people staying here.
</trans></eg>
</sense></hom></entry>");
