INSERT INTO `wced_entry` VALUES (2724, "bikang2, bikang", "134", "<entry page=""134"" id=""2724""><form id=""bikang2_bixkang"" lang=""ceb"">bikang<sub>2</sub>, bíkang</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having the feet spread apart, front to back or sideways. </trans>
<eg><i lang=""ceb"">Bikang íyang linaktan,</i><trans> He walked with his feet spread apart. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; c1]</itype><trans> take a stride, take a long step. </trans>
<eg><i lang=""ceb"">Dì siya makabikang kay guut íyang palda,</i><trans> She cannot take big steps because she has a tight skirt on. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c1]</itype><trans> set one’s feet apart. </trans>
<eg><i lang=""ceb"">Napukling kay walà man mabíkang ang mga tiil,</i><trans> He fell because he had not set his feet well apart. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> large stride. </trans>
</sense></hom>
<entry><form id=""binikang"" lang=""ceb""><abbr expan=""binikang"" type=""lemma"">-in-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for the legs to be widely spread apart.
</trans>
</sense></hom></entry></entry>");
