INSERT INTO `wced_entry` VALUES (2728, "bikil", "134", "<entry page=""134"" id=""2728""><form id=""bikil"" lang=""ceb"">bikil</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> <tr>nudge</tr>, <tr>move</tr> s.t. out of its position. </trans>
<eg><i lang=""ceb"">Kinsay nagbikil sa kwadru nga naharag man?</i><trans> Who moved the picture, that it is tilting? </trans></eg>
<eg><i lang=""ceb"">Ibikil (bikila) ang tupad mung natúlug,</i><trans> Nudge the fellow beside you. He fell asleep. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; c1]</itype><trans> </trans>
</sense>
<sense n=""a""><number>a</number><trans> <tr>protrude</tr>, stick out. </trans>
<eg><i lang=""ceb"">Kun magtanum ug kamúting káhuy ibikil (bikila) ang píkas tumuy sa yútà,</i><trans> When you plant cassava stems, let one end stick out of the ground. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> encumber by protruding<corr>.</corr> </trans>
<eg><i lang=""ceb"">Mubikil ang bátà sa íyang tiyan iglakaw níya,</i><trans> The child in her stomach sticks out and makes it hard for her to walk. </trans></eg>
</sense>
<sense n=""2c""><number>2c</number> <itype>[A; ab2]</itype><trans> trip s.o. </trans>
<eg><i lang=""ceb"">Nabikil ku sa tuud,</i><trans> I tripped over the stump. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B126]</itype><trans> suddenly twisted so as to get sprained. </trans>
<eg><i lang=""ceb"">Nagtakiang siyang naglakaw kay nabikil ang íyang tiil,</i><trans> He walked with a limp because his foot got twisted. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[AC3; ac3]</itype><trans> </trans>
</sense>
<sense n=""a""><number>a</number><trans> be contrary, opposed. </trans>
<eg><i lang=""ceb"">Ang íyang anak mauy nakabikil sa íyang pagminyù ug usab,</i><trans> Her child made it difficult for her to remarry. </trans></eg>
<eg><i lang=""ceb"">Nagbíkil ang ílang mga hunàhúnà,</i><trans> Their opinions differed. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> provoke a quarrel, annoy s.o. with the purpose of angering him. </trans>
<eg><i lang=""ceb"">Bísag unsa na lay ílang buhátun nga ibikil sa bátà,</i><trans> They never run out of ways to make the child cry. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>contrary</tr>, <tr>adverse</tr>. </trans>
<eg><i lang=""ceb"">Bikil kaáyu ning batáa. Bisag unsay átung isulti, lalísun giyud,</i><trans> This child is very contrary. He gives back talk to whatever we say. </trans></eg>
</sense></hom>
<entry><form id=""bikixl"" lang=""ceb""><abbr expan=""bikíl"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>quarrel</tr>, <tr>provocation</tr> to a fight. </trans>
<eg><i lang=""ceb"">Wà pa mahílut ang ílang bikil,</i><trans> Their quarrel hasn’t been settled. </trans></eg>
</sense></hom></entry>
<entry><form id=""biklunun_bikluxnun_bikiluxnun"" lang=""ceb"">biklunun, biklúnun, bikilúnun</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> needing prodding. </trans>
<eg><i lang=""ceb"">Biklunung batáa mabáwu kag paayun-áyun únà mulíhuk,</i><trans> The child needs to be prodded. You go wild trying to get him to do s.t. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> very sensitive, easily disturbed. </trans>
<eg><i lang=""ceb"">Biklunun si Pidru. Sabdan lag gamay, masukù dáyun,</i><trans> Pedro is sensitive. Just nudge him, and he gets angry right away.
</trans></eg>
</sense></hom></entry></entry>");
