INSERT INTO `wced_entry` VALUES (2763, "bilar", "136", "<entry page=""136"" id=""2763""><form id=""bilar"" lang=""ceb"">bilar</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>vigil</tr>, esp. one of the dead. </trans>
<eg><i lang=""ceb"">Dúnay bilar basta dúnay mamatyan,</i><trans> A vigil is always held if the dead person has relatives. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> keep a <tr>wake</tr>. </trans>
<eg><i lang=""ceb"">Gibilaran níla ang minatay,</i><trans> They kept vigil over the corpse. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b]</itype><trans> do s.t. late into the night. </trans>
<eg><i lang=""ceb"">Magbilar kug tuun rung gabíi,</i><trans> I will stay up late studying tonight. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[B156]</itype><trans> stay up late. </trans>
<eg><i lang=""ceb"">Nabilar ku gabíi kay hilabihang pagsákit sa bátà,</i><trans> I stayed up late last night because the baby was very sick.
</trans></eg>
</sense></hom></entry>");
