INSERT INTO `wced_entry` VALUES (2767, "bilat", "136", "<entry page=""136"" id=""2767""><form id=""bilat"" lang=""ceb"">bilat</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>cunt</tr> of a person or animal (coarse). </trans>
</sense>
<sense n=""2""><number>2</number><trans> profane exclamation. </trans>
</sense>
<sense n=""a""><number>a</number><trans> expression indicating disbelief. </trans>
<eg><i lang=""ceb"">Bilat! Ása man ku mutúu adtu,</i><trans> Hell! You think I’d ever believe that. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> expression indicating exasperation at s.t. which happened contrary to one’s desires. </trans>
<eg><i lang=""ceb"">Bilat! Nasipyat pa giyud dà,</i><trans> Shit! I missed again. </trans></eg>
</sense></hom>
<entry><form id=""bilat_sa_ixmung_ixyang_ina_inahan"" lang=""ceb""><abbr expan=""bilat"" type=""lemma"">—</abbr> sa ímung (íyang) ina, inahan</form>
<hom>
<sense n=""1""><number>1</number><trans> profane exclamation used upon experiencing annoyance. </trans>
<eg><i lang=""ceb"">Ikawng bilat sa ímung ináha ka,</i><trans> You son of a bitch, you. </trans></eg>
<eg><i lang=""ceb"">Gikaun sa bilat sa íyang ina,</i><trans> The son of a bitch ate it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> watchamacallit, a filler word. </trans>
<eg><i lang=""ceb"">Ag kadtung unsa gud tung bilat sa íyang ináha tu—íyang íhi,</i><trans> That—um, what was that son of a bitch there called, the axle. </trans></eg>
</sense></hom></entry>
<entry><form id=""bilatbilat"" lang=""ceb"">bilatbilat</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1245; a12]</itype><trans> have more work to do than one can manage (coarse word). </trans>
<eg><i lang=""ceb"">Nagkabilatbilat ku sa trabáhu dinhi,</i><trans> I’m swamped with work here. </trans></eg>
<eg><i lang=""ceb"">Akuy ímung bilatbilatun ug pabáyad ning utánga?</i><trans> You trying to drive me crazy paying these debts. </trans></eg>
</sense></hom></entry>
<entry><form id=""bilatra"" lang=""ceb""><abbr expan=""bilatra"" type=""lemma"">-ra</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> broad, a derogatory word referring to a woman.
</trans>
</sense></hom></entry></entry>");
