INSERT INTO `wced_entry` VALUES (2781, "bili", "136", "<entry page=""136"" id=""2781""><form id=""bili"" lang=""ceb"">bili</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>price</tr>. </trans>
<eg><i lang=""ceb"">Ang bili sa palalítun,</i><trans> The price of commodities. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>worth</tr>. </trans>
<eg><i lang=""ceb"">Wà nay bili ang kinabúhì ug mawalà ka,</i><trans> Life is worthless without you. </trans></eg>
</sense></hom>
<entry><form id=""haxtag_ug_bili"" lang=""ceb"">hátag ug <abbr expan=""bili"" type=""lemma"">—</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> not value s.t. </trans>
<eg><i lang=""ceb"">Ang ákung tambag dílì hatágan ug bili,</i><trans> He does not value my advice. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A23]</itype><trans> cost. </trans>
<eg><i lang=""ceb"">Mibili nag písus ang gantang sa mais,</i><trans> A <ix>ganta</ix> of corn costs one peso. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> cost s.o. s.t., result in. </trans>
<eg><i lang=""ceb"">Kanang ímung binúang mubili nímug kastígu,</i><trans> Your foolishness will cost you a spanking. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b6]</itype><trans> <tr>quote</tr> a price to s.o. </trans>
<eg><i lang=""ceb"">Bilhan ta kag singku,</i><trans> I will offer it to you for five. </trans></eg>
</sense></hom></entry>
<entry><form id=""bililhun"" lang=""ceb"">bililhun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> valuable, precious.
</trans>
</sense></hom></entry></entry>");
