<sense n=""1""><number>1</number> <itype>[AB2S6; a]</itype><trans> <tr>turn</tr> on its axis, <tr>spin</tr> s.t. </trans>
<eg><i lang=""ceb"">Mubílik nang manubílag íya ra,</i><trans> That steering wheel turns by itself. </trans></eg>
<eg><i lang=""ceb"">Siyay mibílik sa <pb n=""137""/>timun,</i><trans> He turned the steering wheel of the boat. </trans></eg>
</sense>
