INSERT INTO `wced_entry` VALUES (2859, "bintang1", "139", "<entry page=""139"" id=""2859""><form id=""bintang"" lang=""ceb"">bintang<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>distance between</tr>. </trans>
<eg><i lang=""ceb"">Duha ka dupa lang ang bintang sa duha ka balay,</i><trans> The two houses are only two fathoms apart from each other. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> advantage, edge in a race or contest. </trans>
<eg><i lang=""ceb"">Kun ikaw lay makiglumbà nákù tagáan ta pa kag bintang,</i><trans> I’ll give you an advantage if it’s just you that’s going to race with me. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> be at a distance, be <tr>ahead</tr> of s.o. </trans>
<eg><i lang=""ceb"">Nagbintang sila pagpanglingkud,</i><trans> They sat far from each other. </trans></eg>
<eg><i lang=""ceb"">Ibintang (bintánga, bintanga) pagbutang ang mga kaang,</i><trans> Place the flower pots far apart from each other. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> give an edge in a contest. </trans>
<eg><i lang=""ceb"">Bintangan ta kag dus kartas,</i><trans> I’ll give you an advantage of two cards.
</trans></eg>
</sense></hom></entry>");
