INSERT INTO `wced_entry` VALUES (2870, "bintus", "140", "<entry page=""140"" id=""2870""><form id=""bintus"" lang=""ceb"">bintus</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> mahjong pieces which represent the winds. Occasionally, the pieces which represent the grasses, daggers, and mirrors also are called <ix>bintus.</ix> </trans>
