INSERT INTO `wced_entry` VALUES (2881, "bira1", "140", "<entry page=""140"" id=""2881""><form id=""bira"" lang=""ceb"">bira<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC2; c1]</itype><trans> <tr>pull</tr>, <tr>tug</tr> at s.t. while standing still. </trans>
<eg><i lang=""ceb"">Nagbira sila sa písì,</i><trans> They are having a tug-of-war with the rope. </trans></eg>
<eg><i lang=""ceb"">Biraha (ibira) nà sa wala,</i><trans> Pull it to the left. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3; a12b2]</itype><trans> <tr>attach property</tr> to repay a debt. </trans>
<eg><i lang=""ceb"">Bayri ímung útang arun dì birahun ímung yútà,</i><trans> Pay your debts so your land won’t be foreclosed. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; b6]</itype><trans> make an extension to a structure (pull on the dimensions). </trans>
<eg><i lang=""ceb"">Birahi ang kusínag duha ka mitrus sa luyu,</i><trans> Add two meters to the kitchen in the back. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <form id=""bira_ang_kawit"" lang=""ceb""><abbr expan=""bira"" type=""lemma"">—</abbr> ang kawit</form><trans> <itype>[a12]</itype> for a winner to treat to a drink of toddy. </trans>
<eg><i lang=""ceb"">Nakadaug lagi ka, sígi biraha ang kawit,</i><trans> Since you won, you treat (lit. grab for the palm toddy container). </trans></eg>
</sense>
<sense n=""5""><number>5</number> <form id=""bira_sa_kunut"" lang=""ceb""><abbr expan=""bira"" type=""lemma"">—</abbr> sa kunut</form><trans> <itype>[a12]</itype> be wrinkled due to age (humorous). </trans>
<eg><i lang=""ceb"">Gibira na siya sa kunut piru maminyug usab,</i><trans> She is old but she’s going to marry again. </trans></eg>
</sense>
<sense n=""6""><number>6</number> <itype>[A; a2]</itype><trans> strip fiber from abaca. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the extent or length of action of pulling s.t. </trans>
<eg><i lang=""ceb"">Gimab-an nákù ang pasul ug tulu ka bira,</i><trans> I shortened the fishing line by three arm lengths. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> single act of hauling s.t. </trans>
<eg><i lang=""ceb"">Kining kargáha madala sa usa ka bira,</i><trans> This cargo can be taken in one trip. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> command given to a driver to get moving. </trans>
<eg><i lang=""ceb"">U sígi. Bira.</i><trans> All right. Let’s get going. </trans></eg>
</sense></hom>
<entry><form id=""birabixra"" lang=""ceb"">birabíra</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> line fishing in which one keeps pulling the line out repeatedly rather than just waiting. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> fish in this way. </trans>
</sense></hom></entry>
<entry><form id=""biraxda"" lang=""ceb""><abbr expan=""biráda"" type=""lemma"">-da(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a single <tr>trip</tr> or <tr>haul</tr> that a vehicle takes. </trans>
<eg><i lang=""ceb"">Madá tas usa ka biráda,</i><trans> We can all be taken in one trip. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12]</itype><trans> make [so-and-so] many hauls. </trans>
<eg><i lang=""ceb"">Makabiráda tag daghang pasahíru kay tábù,</i><trans> We can haul lots of passengers because it’s market day.
</trans></eg>
</sense></hom></entry></entry>");
