INSERT INTO `wced_entry` VALUES (2911, "birnis", "141", "<entry page=""141"" id=""2911""><form id=""birnis"" lang=""ceb"">birnis</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>Friday</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B256; b4]</itype><trans> be Friday. </trans>
<eg><i lang=""ceb"">Nagbirnis (mibirnis) na lang wà gihápun siya muabut,</i><trans> It is (got to be) Friday and he has not arrived yet. </trans></eg>
<eg><i lang=""ceb"">Hibirnisan kug ulì tungud sa bagyu,</i><trans> It was already Friday when I arrived because of the typhoon. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1256]</itype><trans> do things on Fridays. </trans>
<eg><i lang=""ceb"">Mabirnis ray íyang ianhi,</i><trans> He’ll come only on Fridays. </trans></eg>
</sense></hom>
<entry><form id=""birnisbirnis"" lang=""ceb"">birnisbirnis</form>
<hom>
<sense n=""0""><trans> every Friday. </trans>
<eg><i lang=""ceb"">Birnisbirnis ang tinglímus sa simbahan,</i><trans> They beg at the church on Fridays. </trans></eg>
</sense></hom></entry>
<entry><form id=""birnis_Santu"" lang=""ceb""><abbr expan=""birnis"" type=""lemma"">—</abbr> Santu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> Good Friday. </trans>
</sense></hom></entry>
<entry><form id=""nawung_ug_birnis"" lang=""ceb"">nawung ug <abbr expan=""birnis"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> <tr>long faced</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN1]</itype><trans> spend Good Friday. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[B]</itype><trans> get a long face. </trans>
<eg><i lang=""ceb"">Nagbirnis ang íyang nawung kay wà paubana,</i><trans> She has a long face because she wasn’t allowed to go along. </trans></eg>
</sense></hom></entry>
<entry><form id=""sixti_birnis"" lang=""ceb"">síti <abbr expan=""birnis"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> well-aged palm toddy.
