INSERT INTO `wced_entry` VALUES (2933, "bisaya", "142", "<entry page=""142"" id=""2933""><form id=""bisayaq"" lang=""ceb"">bisayà</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>Visayan</tr>. </trans>
<eg><i lang=""ceb"">Bantúgan siyang bisayà,</i><trans> He is a famous Visayan. </trans></eg>
<eg><i lang=""ceb"">Tambal nga bisayà,</i><trans> Visayan medicines. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> a smaller, ordinary <tr>mongrel</tr> variety of s.t., esp. domestic animals or cultivated plants. </trans>
<eg><i lang=""ceb"">Manuk bisayà,</i><trans> Mongrel chicken. </trans></eg>
<eg><i lang=""ceb"">Sibúyas bisayà,</i><trans> Small, green onions. </trans></eg>
<eg><i lang=""ceb"">Sabun bisayà,</i><trans> Laundry soap in bars. </trans></eg>
</sense></hom>
<entry><form id=""binisayaq"" lang=""ceb""><abbr expan=""binisayà"" type=""lemma"">-in-</abbr></form>
<hom>
<sense n=""1""><number>1</number><trans> the Visayan way. </trans>
<eg><i lang=""ceb"">Panambal nga binisayà,</i><trans> Visayan type of folk healing. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> Visayan language. </trans>
<eg><i lang=""ceb"">Binisayang putúput, tuganus,</i><trans> Pure Visayan with no admixture of foreign words. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> speak Visayan. </trans>
<eg><i lang=""ceb"">Binisay-i lang ku,</i><trans> Just speak to me in Visayan. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> translate into Visayan. </trans>
<eg><i lang=""ceb"">Kinsa tung paríang nagbinisayà sa biblíya?</i><trans> Who was that priest who translated the Bible into Visayan? </trans></eg>
</sense></hom></entry>
<entry><form id=""bisayista"" lang=""ceb"">bisayista</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> Visayanist. </trans>
</sense></hom></entry>
<entry><form id=""kabisay-an"" lang=""ceb"">kabisay-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the Visayan Islands.
