INSERT INTO `wced_entry` VALUES (2940, "bisiklita", "142", "<entry page=""142"" id=""2940""><form id=""bisiklixta"" lang=""ceb"">bisiklíta</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>bicycle</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> ride a bicycle. </trans>
<eg><i lang=""ceb"">Dì ku mubisiklíta ug gubà,</i><trans> I won’t ride a broken bicycle. </trans></eg>
<eg><i lang=""ceb"">Magbisiklíta ku padúlung sa syúdad,</i><trans> I will ride a bicycle to the city. </trans></eg>
<eg><i lang=""ceb"">Dì makabisiklíta ang bakul,</i><trans> The cripple <corr sic=""can not"">cannot</corr> ride a bicycle. </trans></eg>
<eg><i lang=""ceb"">Bisiklitáha lang ang Talísay,</i><trans> Take a bicycle to Talisay. </trans></eg>
<eg><i lang=""ceb"">Lisud ning agianánang bisiklitáhan,</i><trans> This path is difficult to ride a bike over. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> take s.t. s.w. by bicycle. </trans>
<eg><i lang=""ceb"">Bisiklitáha (ibisiklíta) ang utanun ngadtu sa mirkádu,</i><trans> Take the vegetables to the market on a bicycle. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A12]</itype><trans> get a bicycle. </trans>
<eg><i lang=""ceb"">Nakabisiklíta ku sa banggà,</i><trans> I won a bicycle in the contest. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; a]</itype><trans> make into a bicycle. </trans>
<eg><i lang=""ceb"">Kanang ímung wísir bisiklitáhun na lang kay dautang makina,</i><trans> Make your motor-bike into a bicycle because the motor <pb n=""143""/>is shot. </trans></eg>
</sense>
