<sense n=""1""><number>1</number> <itype>[A1; c16]</itype><trans> indulge in vice. </trans>
<eg><i lang=""ceb"">Ayaw bisyuha (ibisyu) ang pagtabakù,</i><trans> Don’t make smoking a vice. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A1; c16]</itype><trans> do s.t. always. </trans>
