INSERT INTO `wced_entry` VALUES (2968, "bitaw", "144", "<entry page=""144"" id=""2968""><form id=""bixtaw"" lang=""ceb"">bítaw</form>
<hom>
<sense n=""1""><number>1</number><trans> particle affirming interlocutor’s remark. </trans>
<eg><i lang=""ceb"">‘Mahal ra kaáyu.’—‘<corr sic=""Bitaw"">Bítaw</corr>,’</i><trans> ‘It’s too expensive.’—‘It sure is.’ </trans></eg>
<eg><i lang=""ceb"">‘Dì ba tu ikaw si Usting?’—‘Aku <corr sic=""bitaw"">bítaw</corr>,’</i><trans> ‘Aren’t you Osting?’—‘Yes, I am.’ </trans></eg>
<eg><i lang=""ceb"">‘Tugnaw kaáyu run.’—‘Nagswítir bítaw ku,’</i><trans> ‘It sure is cold.’—‘Yes, it is. Why do you think I’m wearing a sweater?’ </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> particle giving assurance. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> [so-and-so] is the case anyway. </trans>
<eg><i lang=""ceb"">Ayaw paghílak. Muabut na bítaw si Máma nímu,</i><trans> Don’t cry. Your mother is coming anyway. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> stop complaining because [so-and-so] happened, is happening in any case. </trans>
<eg><i lang=""ceb"">‘Sígi ming pangítà nímu dà.’—‘Nangítà bítaw pud ku nímu,’</i><trans> ‘We have been looking for you.’—‘Well, I have been looking for you, too.’ </trans></eg>
<eg><i lang=""ceb"">‘Ngánung wà ku nímu binlig kík?’—‘Niingun bítaw kang dì ka gustu,’</i><trans> ‘Why didn’t you leave me any cake?’—‘Well, you said you didn’t want any.’ </trans></eg>
</sense>
<sense n=""2c""><number>2c</number><trans> don’t worry about it, [so-and-so] is the case with s.o. else and it’s all right. </trans>
<eg><i lang=""ceb"">Ayaw <corr sic=""paghilak"">paghílak</corr>. Aku bítaw, wà ku tagái,</i><trans> Don’t cry. I didn’t get any either, so there. </trans></eg>
</sense>
<sense n=""2d""><number>2d</number><trans> don’t worry about it. I’m just joking. </trans>
<eg><i lang=""ceb"">Ambi nà bi. Ayaw bítaw. Nagkumidiya lang bítaw ku,</i><trans> Give that to me. Don’t really. I’m just joking. </trans></eg>
</sense>
<sense n=""2e""><number>2e</number><trans> seriously now, please do [so-and-so]. </trans>
<eg><i lang=""ceb"">Sígi bítaw. Adtu na ta,</i><trans> OK. OK, let’s go now. </trans></eg>
<eg><i lang=""ceb"">Ayaw bítaw ku dad-a sa lawum,</i><trans> Oh, stop now. Don’t pull me into the deep water. </trans></eg>
<eg><i lang=""ceb"">Usà pa bítaw. Unsa tuy ímung túyù pag-anhi?</i><trans> Seriously, though, what did you have in mind in coming here? </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> see, [so-and-so] had to happen. </trans>
<eg><i lang=""ceb"">‘Sakit ákung úlu.’—‘Bítaw. Giingnan ta bítaw kang dì magsígig ínum,’</i><trans> ‘I have a headache.’—‘See, I told you not to drink so much.’ </trans></eg>
<eg><i lang=""ceb"">Aligri man tà tu silang duha. Naabtan bítaw nas amahan,</i><trans> They were just having fun, but would not you know it, their father caught them.
</trans></eg>
</sense></hom></entry>");
