INSERT INTO `wced_entry` VALUES (2970, "bitay", "144", "<entry page=""144"" id=""2970""><form id=""bixtay"" lang=""ceb"">bítay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB12S; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>hang s.t. up</tr> suspended, be hanging. </trans>
<eg><i lang=""ceb"">Kinsay nagbítay sa parul?</i><trans> Who hung the lantern up? </trans></eg>
<eg><i lang=""ceb"">Ang ímung ranggu nagbitay sa usa ka lugas lánut,</i><trans> Your rank is hanging by a single thread (i.e. you are in imminent danger of demotion). </trans></eg>
<eg><i lang=""ceb"">Bitáya (ibítay) sa bintánà ang bandíra,</i><trans> Hang the flag in the window. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> <tr>execute</tr>. </trans>
<eg><i lang=""ceb"">Bitáya (ibítay) siya sa silya iliktrika,</i><trans> Execute him in the electric chair. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A123P; a3]</itype><trans> </trans>
</sense>
<sense n=""3a""><number>3a</number><trans> be beneath the other cock when fighting on the wing. </trans>
<eg><i lang=""ceb"">Nabíhag ang ákung manuk kay nabítay man paglupad,</i><trans> My cock was defeated because it was beneath its opponent when they fought on the wing. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number><trans> be far behind in a game or contest. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[A1; a]</itype><trans> perform the <ix>bítay</ix> ceremony in the <ix>súgat</ix> (<xr lang=""ceb"" target=""#bixtay""><ix>see</ix> <sc>bítay</sc>, <ix>n3</ix></xr>). </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> death by hanging or execution. </trans>
</sense>
<sense n=""2""><number>2</number><trans> distance one is behind in a contest. </trans>
</sense>
<sense n=""3""><number>3</number><trans> the lifting of the <ix>alilúya</ix> in the <ix>súgat</ix> ceremony. </trans>
</sense></hom>
<entry><form id=""bitay"" lang=""ceb""><abbr expan=""bitay"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> tending to <tr>droop</tr>. </trans>
<eg><i lang=""ceb"">Bitay siya ug ngábil,</i><trans> She has drooping lips. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B4]</itype><trans> become drooping. </trans>
<eg><i lang=""ceb"">Wà na siya ganáhi. Nagbitay na lang,</i><trans> He didn’t feel like it any more. It (the penis) just drooped. </trans></eg>
</sense></hom></entry>
<entry><form id=""bitaybixtay"" lang=""ceb"">bitaybítay</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the hanging part of dangling earrings. </trans>
</sense></hom></entry>
<entry><form id=""bitayan"" lang=""ceb""><abbr expan=""bitayan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place of execution. </trans>
</sense></hom></entry>
<entry><form id=""mamamitayan"" lang=""ceb""><abbr expan=""mamamitayan"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>executioner</tr>. </trans>
</sense></hom></entry>
<entry><form id=""pamixtay"" lang=""ceb""><abbr expan=""pamítay"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the lower <tr>wattles</tr> of a chicken. </trans>
</sense>
<sense n=""2""><number>2</number><trans> hanging decorations in a window. </trans>
</sense></hom></entry>
<entry><form id=""tingbitay_sa_iruq_iring"" lang=""ceb"">tingbitay sa irù, iring</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the month of July when food is scarce (and they hang dogs up to butcher them), or the period just before payday. </trans>
</sense></hom></entry>
<entry><form id=""bitayuxnun_bixtayun"" lang=""ceb""><abbr expan=""bitayúnun"" type=""lemma"">-únun</abbr>, <abbr expan=""bítayun"" type=""lemma"">-un</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> condemned person. </trans>
</sense></hom></entry>
<entry><form id=""kulumbixtay"" lang=""ceb""><abbr expan=""kulumbítay"" type=""lemma"">kulum-</abbr></form>
<hom>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#kulumbixtay""><ix>see</ix> <sc>kulumbítay</sc>.</xr>
</trans>
</sense></hom></entry></entry>");
