INSERT INTO `wced_entry` VALUES (2974, "bitik", "144", "<entry page=""144"" id=""2974""><form id=""bitik"" lang=""ceb"">bitik</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>catch with a noose</tr> or lasso. </trans>
<eg><i lang=""ceb"">Bitika (bitka, bikta) nang irù,</i><trans> Catch that <pb n=""145""/>dog with a lasso. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A123P; a123]</itype><trans> become entangled or caught in. </trans>
<eg><i lang=""ceb"">Nabitik ákung tiil sa bágun,</i><trans> My feet got entangled in the vine. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a2]</itype><trans> <tr>trap</tr> a person into saying s.t. </trans>
<eg><i lang=""ceb"">Maáyu nang abugadúha mamitik ug bakákung saksi,</i><trans> That lawyer is good in tripping up lying witnesses. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[a12]</itype><trans> become a victim of s.o.’s clever manipulation. </trans>
<eg><i lang=""ceb"">Nabitik ku sa matam-is níyang sáad,</i><trans> I was entrapped by his sweet promises. </trans></eg>
</sense></hom>
<entry><form id=""bitik_sa_hunsuy"" lang=""ceb""><abbr expan=""bitik"" type=""lemma"">—</abbr> sa hunsuy</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> do s.t. else rather than engage in s.t. useless. </trans>
<eg><i lang=""ceb"">Magbitik na lang ku sa hunsuy ug magnigusyu kug alkansi,</i><trans> I’ll do better to trap my pipe than go into business and lose. </trans></eg>
