INSERT INTO `wced_entry` VALUES (3000, "biya", "146", "<entry page=""146"" id=""3000""><form id=""bixyaq"" lang=""ceb"">bíyà</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b(1)]</itype><trans> <tr>leave</tr> a place, s.t. behind. </trans>
<eg><i lang=""ceb"">Ngánung mibíyà ka man dinhi?</i><trans> Why did you leave? </trans></eg>
<eg><i lang=""ceb"">Kinsay nagbíyà ning libru diri?</i><trans> Who left this book here? </trans></eg>
<eg><i lang=""ceb"">Dì ku makabíyà sa ákung búhat,</i><trans> I can’t leave my work. </trans></eg>
<eg><i lang=""ceb"">Byái ang pagtabakù,</i><trans> Quit your smoking habit. </trans></eg>
<eg><i lang=""ceb"">Hibyaan siya sa trin,</i><trans> She missed the train (i.e., failed to get married). </trans></eg>
<eg><i lang=""ceb"">Gibyáan na nà nákù sa buut,</i><trans> I have already forgotten that insignificant matter. </trans></eg>
<eg><i lang=""ceb"">Ang ímung pamisti hibyaan na sa urug,</i><trans> Your clothes are way out of style (have been left behind by the styles). </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b(1)]</itype><trans> <tr>abandon</tr>, <tr>desert</tr>. </trans>
<eg><i lang=""ceb"">Mibíyà ang bána sa asáwang yawyawan,</i><trans> The husband deserted his nagging wife. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A23]</itype><trans> <tr>die</tr>. </trans>
<eg><i lang=""ceb"">Gagmay pa mi sa dihang mibíyà si Tátay námù,</i><trans> We were still kids when our father died. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A12; b26]</itype><trans> win by a certain distance, amount. </trans>
<eg><i lang=""ceb"">Dílì makabíyà si Usminya ni Markus ug usa ka gatus ka líbu dinhi sa Sugbu,</i><trans> Osmeña can’t garner a majority of one-hundred thousand votes over Marcos here in Cebu. </trans></eg>
<eg><i lang=""ceb"">Hibyaan siyag duha ka dupa sa mananáug,</i><trans> He was behind the winner by two arm’s lengths. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[a3]</itype><trans> become the underdog. </trans>
<eg><i lang=""ceb"">Nabíyà siya kay Ilurdi ang kuntra,</i><trans> He was the underdog because Elorde was his opponent. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[a3]</itype><trans> become leftover waste material. </trans>
</sense></hom>
<entry><form id=""biyaq"" lang=""ceb""><abbr expan=""biyà"" type=""lemma"">(→)</abbr></form>
<hom>
<sense n=""1""><number>1</number><trans> amount by which s.o. is behind in a contest. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> be left behind. </trans>
<eg><i lang=""ceb"">Biyà na kaáyu sa panahun,</i><trans> You are very much behind the times. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> things not in use, cast off. </trans>
<eg><i lang=""ceb"">Átung ihátag ang biyà nga sinínà sa mga pubri,</i><trans> We’ll give our old clothes to the poor. </trans></eg>
</sense>
<sense n=""2c""><number>2c</number><trans> by-products. </trans>
<eg><i lang=""ceb"">Ang biyà sa pamanday magámit nga sugnud,</i><trans> The leftovers from carpentry work can be used as fuel. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> the <tr>underdog</tr> in a fight. </trans>
<eg><i lang=""ceb"">Ug parángan ang bisayà ug tiksas, biyà ang bisayà,</i><trans> If a Visayan cock is matched with a Texas, the Visayan is the underdog. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <tr>homely</tr>. </trans>
<eg><i lang=""ceb"">Biyag nawung,</i><trans> Homely looking. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> <tr>poor</tr> in quality. </trans>
<eg><i lang=""ceb"">Biyang panaptun,</i><trans> Poor quality cloth. </trans></eg>
</sense>
<sense n=""6""><number>6</number><trans> s.o. who behaves in a bad way. </trans>
<eg><i lang=""ceb"">Biyà ug batásan. Isipan,</i><trans> He is an awful sort. He counts favors he renders. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number><trans> <xr lang=""ceb"" target=""#bixyaq"">= <sc>bíyà</sc> <ix>4.</ix></xr> </trans>
</sense>
<sense n=""2""><number>2</number><trans> get to be poor in quality. </trans>
<eg><i lang=""ceb"">Nagkabíyà ang íyang ági nadúgayng sinuwat,</i><trans> His penmanship got worse and worse the longer he wrote. </trans></eg>
</sense></hom></entry>
<entry><form id=""pabixyaq"" lang=""ceb""><abbr expan=""pabíyà"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> allow oneself or s.t. to be left behind. </trans>
<eg><i lang=""ceb"">Dì ku magpabíyà sa íyang buut,</i><trans> I won’t allow her to forget me (to be left out of her thoughts). </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> bet on the underdog. </trans>
<eg><i lang=""ceb"">Ug pabíyà ta, dakù tag daug,</i><trans> If we bet on the underdog, we will win more. </trans></eg>
</sense></hom></entry>
<entry><form id=""bumibiyaq"" lang=""ceb""><abbr expan=""bumibiyà"" type=""lemma"">-um-r-(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> given to deserting one’s family.
</trans>
</sense></hom></entry></entry>");
