<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B26; b2]</itype><trans> for several things to fall and be <tr>scattered</tr> in every direction. </trans>
<eg><i lang=""ceb"">Pagkabuak sa alkansíya, nabuagsà ang kwarta,</i><trans> When the piggy bank broke, the money fell all over the place. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> scattered because of falling or having been dropped.
</trans>
</sense></hom></entry>");
