INSERT INTO `wced_entry` VALUES (3082, "buang", "149", "<entry page=""149"" id=""3082""><form id=""buxang"" lang=""ceb"">búang</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>insane</tr>, <tr>crazy</tr>. </trans>
<eg><i lang=""ceb"">Gigaugáu sa kabatáan ang búang,</i><trans> The children are making fun of the insane person. </trans></eg>
<eg><i lang=""ceb"">Irung búang,</i><trans> A rabid dog. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> lacking sense. </trans>
<eg><i lang=""ceb"">Búang nímung mubáyad kag diyis,</i><trans> You must be crazy to pay ten pesos! </trans></eg>
<eg><i lang=""ceb"">Ayaw ku tudlúi. Dì ku búang,</i><trans> You don’t have to show me. I’m not stupid. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>naughty</tr>, pranking. </trans>
<eg><i lang=""ceb"">Búang kaáyung bat-ána kay manglìlì,</i><trans> What a naughty child! He peeps at people. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> the one who is ‘it’ in games. </trans>
</sense>
<sense n=""5""><number>5</number><trans> defective coconut with no water and no meat. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B126; b3]</itype><trans> go crazy. </trans>
<eg><i lang=""ceb"">Hápit ku mabúang dihang ímung gitalikdan,</i><trans> I almost went crazy when you left me. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; a12]</itype><trans> make s.o. insane. </trans>
<eg><i lang=""ceb"">Gibúang siya sa bugsikan,</i><trans> The sorcerer inflicted madness on him. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a2]</itype><trans> <tr>fool</tr> s.o., think s.o. a fool. </trans>
<eg><i lang=""ceb"">Ayaw kug buánga kay nasáyud ku sa nahitabù,</i><trans> Don’t try to fool me because I know what happened. </trans></eg>
<eg><i lang=""ceb"">Gibuángan ka ba nákù?</i><trans> Do you take me for a fool? </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B12; b3(1)]</itype><trans> go crazy about s.t. </trans>
<eg><i lang=""ceb"">Nabúang siya sa súgal,</i><trans> He’s crazy over gambling. </trans></eg>
<eg><i lang=""ceb"">Babáying íyang gikabuángan,</i><trans> The woman he was crazy about. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B125; a12]</itype><trans> have a hard time doing s.t. for which one has little time. </trans>
<eg><i lang=""ceb"">Nagkabuang kug pinangítà nímu,</i><trans> I was going crazy looking for you. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[B1245]</itype><trans> do s.t. in an irrational, crazy way. </trans>
<eg><i lang=""ceb"">Nagkabuang ang mga táwug dágan pagbutu,</i><trans> The people ran every which way in panic upon hearing the explosion. </trans></eg>
</sense></hom>
<entry><form id=""buang"" lang=""ceb""><abbr expan=""buang"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#buxang"">= <sc>búang</sc>, <ix>5.</ix></xr> </trans>
</sense></hom></entry>
<entry><form id=""buangbuang"" lang=""ceb"">buangbuang</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number><trans> <xr lang=""ceb"" target=""#buxang"">= <sc>búang</sc>, <ix>v 4, 5.</ix></xr> </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A12C; b6]</itype><trans> play a game of tag hide-and-seek. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> tag hide-and-seek. </trans>
</sense></hom></entry>
<entry><form id=""pabuangbuxang"" lang=""ceb"">pabuangbúang</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> pretend to be a fool, crazy. </trans>
<eg><i lang=""ceb"">Magpabuangbúang ug pangutan-un. Mu rag dílì siya,</i><trans> You ask him and he pretends not to know. As if it wasn’t him. </trans></eg>
</sense></hom></entry>
<entry><form id=""pakabuxang"" lang=""ceb""><abbr expan=""pakabúang"" type=""lemma"">paka-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> act, treat like a fool or crazy person. </trans>
<eg><i lang=""ceb"">Ayaw pagpakabúang dihà. Gamítang ímung úlu,</i><trans> Don’t act like a fool. Use your head. </trans></eg>
</sense></hom></entry>
<entry><form id=""binuxang"" lang=""ceb""><abbr expan=""binúang"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>stupidity</tr>, unreasonable <tr>foolishness</tr>. </trans>
<eg><i lang=""ceb"">Usa ka binúang ang pagpakamatay tungud sa gugma,</i><trans> It’s <tr>stupid</tr> to kill oneself for love. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> foolish prank. </trans>
<eg><i lang=""ceb"">Binúang sa mga iskuyla kining pagsuwat sa bungbung,</i><trans> This writing on the wall is just one of the children’s pranks. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> do foolish <tr>mischief</tr>. </trans>
<eg><i lang=""ceb"">Way mubinúang nímu dinhi samtang nía ku,</i><trans> No one will do you any mischief as long as I am here. </trans></eg>
<eg><i lang=""ceb"">Ayaw kug binuángi, ha,</i><trans> Don’t try any foolishness on me, understand! </trans></eg>
</sense></hom></entry>
<entry><form id=""kabuxang"" lang=""ceb""><abbr expan=""kabúang"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> insanity. </trans>
</sense>
<sense n=""2""><number>2</number><trans> serious mischief. </trans>
<eg><i lang=""ceb"">Mu nay sangputánan sa ímung kabúang,</i><trans> That’s where your mischief will end you. </trans></eg>
</sense></hom></entry>
<entry><form id=""kinabuxang"" lang=""ceb""><abbr expan=""kinabúang"" type=""lemma"">kina-</abbr></form>
<hom>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#ka-"">= <sc><abbr expan=""kabúang"" type=""lemma"">ka-</abbr></sc>, <ix>2.</ix></xr> </trans>
</sense></hom></entry>
<entry><form id=""kinabuang"" lang=""ceb""><abbr expan=""kinabuang"" type=""lemma"">kina-(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> not done in seriousness. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; b6(1)]</itype><trans> do s.t. without being serious about it. </trans>
<eg><i lang=""ceb"">Nagkinabuang mig aplay ug nadáwat mi,</i><trans> We just applied for the fun of it, and we were hired. </trans></eg>
</sense></hom></entry>
<entry><form id=""buangun"" lang=""ceb""><abbr expan=""buangun"" type=""lemma"">-un(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> acting insane, stupid.†
</trans>
</sense></hom></entry></entry>");
