INSERT INTO `wced_entry` VALUES (3083, "buaw", "149", "<entry page=""149"" id=""3083""><form id=""buaw"" lang=""ceb"">buaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[BN]</itype><trans> for the eyes to get swollen. </trans>
<eg><i lang=""ceb"">Mibuaw (namuaw) íyang mata ug kinatúlug,</i><trans> Her eyes got swollen from sleeping too much.

</trans></eg>
</sense></hom></entry>");
