INSERT INTO `wced_entry` VALUES (3084, "buaw", "149", "<entry page=""149"" id=""3084""><form id=""buxaw"" lang=""ceb"">búaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126]</itype><trans> for a part of the body to <tr>swell</tr> after being struck. </trans>
<eg><i lang=""ceb"">Nabúaw ang kumagkù níyang natudturan sa martilyu,</i><trans> He accidentally struck his thumb with a hammer, and it swelled. </trans></eg>
</sense></hom>
<hom role=""""><pos/>
<sense n=""0""><trans> <ix>particle:</ix> magical expression used to qualify a statement which praises s.o., said for the purpose of avoiding harm to the person praised. </trans>
<eg><i lang=""ceb"">Maáyu búaw kang mulútù,</i><trans> You cook well, evil spirits beware. </trans></eg>
<eg><i lang=""ceb"">Gwápu búaw kag anak,</i><trans> You have a beautiful child, evil spirits beware.
</trans></eg>
</sense></hom></entry>");
