INSERT INTO `wced_entry` VALUES (3085, "buaya", "149", "<entry page=""149"" id=""3085""><form id=""buaxya"" lang=""ceb"">buáya</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>crocodile</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> lend or gamble in such a way that there is no chance of getting any but huge returns. </trans>
<eg><i lang=""ceb"">Buáya nà siyang mupahulag kwarta. Dakug garantíya. Dakug pátung,</i><trans> He is a real crocodile in his money-lending. He demands a huge security and huge interest. </trans></eg>
<eg><i lang=""ceb"">Buáya nga mupúkir,</i><trans> He plays poker ruthlessly. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> hogging the ball in basketball. </trans>
</sense>
<sense n=""4""><number>4</number><trans> <xr lang=""ceb"" target=""#dispatsir"">= <sc>dispatsir</sc>.</xr> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; b6]</itype><trans> get to <tr>be greedy</tr> in lending, gambling, or with the ball. </trans>
</sense></hom>
<entry><form id=""pamuaxya"" lang=""ceb""><abbr expan=""pamuáya"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b6(1)]</itype><trans> catch crocodiles. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a12]</itype><trans> for s.o. to entrap s.o. into playing against him by pretending not to know how. </trans>
<eg><i lang=""ceb"">Gipamuáya kug ahidris níya,</i><trans> He trapped me into playing chess with him. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <xr lang=""ceb"" target=""#dispatsir"">= <sc>dispatsir</sc>, <ix>v</ix>.</xr> </trans>
</sense></hom></entry>
<entry><form id=""buayaxhun"" lang=""ceb"">buayáhun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having a configuration in the lines of the palm resembling a crocodile and which signifies that the bearer will never have living children and further his brothers and sisters will not live to maturity. This configuration can be changed by magical means.
<pb n=""150""/>
</trans>
</sense></hom></entry></entry>");
