INSERT INTO `wced_entry` VALUES (3087, "bubhu", "150", "<entry page=""150"" id=""3087""><form id=""bubhu"" lang=""ceb"">bubhu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> wash the hair. </trans>
<eg><i lang=""ceb"">Bubhúig bawnus ang ákung buhuk,</i><trans> <tr>Shampoo</tr> my hair with gogo. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> put s.t. in the hair as dressing. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. to wash hair with. </trans>
</sense>
<sense n=""2""><number>2</number><trans> hair dressing. </trans>
</sense></hom>
<entry><form id=""pamubhu"" lang=""ceb""><abbr expan=""pamubhu"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> wash, dress one’s hair. </trans>
<eg><i lang=""ceb"">Mamubhu kug lubi,</i><trans> I will rinse my hair with coconut juice.
</trans></eg>
</sense></hom></entry></entry>");
