INSERT INTO `wced_entry` VALUES (3090, "bubu2, bubu", "150", "<entry page=""150"" id=""3090""><form id=""buxbu2_buxbuq"" lang=""ceb"">búbu<sub>2</sub>, búbù</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> box-like <tr>trap</tr> woven from bamboo slats allowing entrance but no egress, used to catch fish or monkeys. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> make, make into such a trap. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A2N; a]</itype><trans> catch things with the <ix>búbu.</ix> </trans>
<eg><i lang=""ceb"">Bubúun (bubúhun) nátù ang ungguy arun búhing dakpan,</i><trans> Let’s trap the monkey with a <ix>búbu</ix> so he can be taken alive. </trans></eg>
<eg><i lang=""ceb"">Kining sapáa maáyung bubúan,</i><trans> This river is a good place to set a fish trap.
