INSERT INTO `wced_entry` VALUES (3100, "budbud", "150", "<entry page=""150"" id=""3100""><form id=""budbud"" lang=""ceb"">budbud</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> <tr>wind</tr> string, wire, strips, etc. around s.t. or into a ball. </trans>
<eg><i lang=""ceb"">Budbúri nag bandids ang ímung samad,</i><trans> Wind a bandage around your wound. </trans></eg>
<eg><i lang=""ceb"">Ibudbud ang lúbid sa lápis,</i><trans> Wind the rope around the pencil. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> make a stick of <tr>dynamite</tr> out of. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a2]</itype><trans> make the delicacy <ix>budbud.</ix> </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
