<eg><i lang=""ceb"">Usa ka budbud hílu,</i><trans> A spoolful of thread. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> stick of dynamite. </trans>
</sense>
<sense n=""3""><number>3</number><trans> sweet prepared from crushed ingredients (rice, corn, pili nut, millet, etc.) formed into sticks, wrapped in banana leaves, and steamed. </trans>
</sense></hom>
<entry><form id=""budburan"" lang=""ceb"">budburan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>reel</tr>, <tr>spool</tr>. </trans>
