INSERT INTO `wced_entry` VALUES (3116, "budyung", "151", "<entry page=""151"" id=""3116""><form id=""budyung"" lang=""ceb"">budyung</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> helmet <tr>shells</tr>, <tr>conchs</tr>, or any large univalve with a pointed caudal apex. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>horn</tr> for signaling made from the <ix>budyung</ix> or one similar in appearance made from a carabao horn. </trans>
</sense>
