INSERT INTO `wced_entry` VALUES (3118, "buga", "151", "<entry page=""151"" id=""3118""><form id=""buga"" lang=""ceb"">buga</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> emit s.t. with force or in great quantity. </trans>
<eg><i lang=""ceb"">Ang adlaw mibuga sa íyang naglagiting nga kaínit,</i><trans> The sun emitted its stinging rays. </trans></eg>
<eg><i lang=""ceb"">Nagbuga ug átà ang kugíta,</i><trans> The octopus <tr>spewed</tr> out his ink. </trans></eg>
<eg><i lang=""ceb"">Tugtug nga gibuga sa amplipáyir,</i><trans> The song which the amplifier <tr>blared</tr> out. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> treat an illness by expectorating chewed medicinal herbs on a sore spot or at the person. </trans>
<eg><i lang=""ceb"">Naáyu ang nagsakit nga tiyan nga gibugahan,</i><trans> His stomach ailment got better after the herbalist spat on it. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A; b]</itype><trans> do s.t. with force or energy. </trans>
<eg><i lang=""ceb"">Ug bugahan nig trabáhu, human dáyun,</i><trans> If you do this with energy, it will get done right away. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number><trans> hit s.o. hard with the fist (slang). </trans>
<eg><i lang=""ceb"">Ang íyang úlu mauy gibugahan pag-áyu ni Ilurdi,</i><trans> Elorde kept smashing at his head.
</trans></eg>
</sense></hom></entry>");
