INSERT INTO `wced_entry` VALUES (3120, "bugaguy", "151", "<entry page=""151"" id=""3120""><form id=""bugaguy"" lang=""ceb"">bugaguy</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>stupid</tr>, having little or no judgment or common sense. </trans>
<eg><i lang=""ceb"">Ang mga bugaguy nagtangà lang. Maung nakaiskápu ang dinakpan,</i><trans> The idiots were so <tr>careless</tr>, so the prisoner escaped. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2; a2]</itype><trans> be, become a person with little common sense. </trans>
<eg><i lang=""ceb"">Mubugaguy (mabugaguy) nang ímung anak kun dì tagáag rispunsibilidad,</i><trans> Your child will never develop common sense if he is never given responsibilities. </trans></eg>
<eg><i lang=""ceb"">Gibugaguyan kaáyu ku níya nga mukatáwa lag walay sinugdánan,</i><trans> I consider her a <tr>fool</tr> because she laughs for no reason whatsoever.
