INSERT INTO `wced_entry` VALUES (3148, "bugkus1", "153", "<entry page=""153"" id=""3148""><form id=""bugkus"" lang=""ceb"">bugkus<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1]</itype><trans> <tr>tie</tr> a piece of string or s.t. similar around s.t. long, usually to tie it together with s.t. else. </trans>
<eg><i lang=""ceb"">Bugkúsa ang mga lipak,</i><trans> Tie the bamboo slats into a <tr>bundle</tr>. </trans></eg>
<eg><i lang=""ceb"">Bugkúsi ug panyù ang ímung samad,</i><trans> Tie a handkerchief around your wound. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. used to tie around s.t. </trans>
<eg><i lang=""ceb"">Alambri ang gamítang bugkus,</i><trans> Use wire to tie it up. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> bundle. </trans>
<eg><i lang=""ceb"">Tagtrayinta ang bugkus sa káhuy,</i><trans> Each bundle of firewood costs thirty centavos. </trans></eg>
</sense></hom>
<entry><form id=""binugkus"" lang=""ceb""><abbr expan=""binugkus"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. tied into a bundle.
