<eg><i lang=""ceb"">Bugkúta nang sugung dinhà arun dì matumba,</i><trans> Tie s.t. around that bamboo tube container so that it won’t fall over. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12b2]</itype><trans> for supernatural beings to kidnap a person rendering him invisible. This is usually done in the thickets, rocks, etc. where these spirits are thought to dwell. </trans>
