<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; ab3]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>fight</tr> at close quarters. </trans>
<eg><i lang=""ceb"">Walay kukalísang ang irung mibugnù (namugnù) sa bitin,</i><trans> The dog fought the snake bravely. </trans></eg>
