INSERT INTO `wced_entry` VALUES (3157, "bugnut", "154", "<entry page=""154"" id=""3157""><form id=""bugnut"" lang=""ceb"">bugnut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> pull s.t. with a hard <tr>jerk</tr>. </trans>
<eg><i lang=""ceb"">Ikaw bay nagbugnut sa buhuk ni Pilang?</i><trans> Were you the one who pulled Pilang’s hair? </trans></eg>
<eg><i lang=""ceb"">Ímung bugnútun (bugnutun) ug kalit ang láang arun dílì makalikay ang manuk,</i><trans> You pull the noose all of a sudden so the chicken cannot escape. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b8]</itype><trans> hastily impress s.o. to run an errand. </trans>
<eg><i lang=""ceb"">Akuy hibugnutan níyag súgù kay aku ra may didtu,</i><trans> I got trapped into running the errand because I was the only one there.
