INSERT INTO `wced_entry` VALUES (3159, "bugsu1", "154", "<entry page=""154"" id=""3159""><form id=""bugsuq"" lang=""ceb"">bugsù<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> <tr>drive</tr> s.t. long into the ground or some other surface. </trans>
<eg><i lang=""ceb"">Ibugsù ang mga lipak,</i><trans> Drive the stakes into the ground. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>throw</tr> s.t. down with force, as if to ram it into the ground. </trans>
<eg><i lang=""ceb"">Ibugsù ta kag ilárun ku nímu,</i><trans> I’ll ram you into the ground if you cheat me. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[B1256; b6]</itype><trans> <tr>fall headlong</tr>, landing hard. </trans>
<eg><i lang=""ceb"">Nabálì íyang líug dihang nabugsù siya sa yútà,</i><trans> He broke his neck when he fell headlong to the ground. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> piece of wood or metal used as a <tr>stake</tr>. </trans>
<eg><i lang=""ceb"">Bugsù sa bungsud,</i><trans> The stakes of the fish corral.
</trans></eg>
</sense></hom></entry>");
