INSERT INTO `wced_entry` VALUES (3169, "bugti", "154", "<entry page=""154"" id=""3169""><form id=""bugtiq"" lang=""ceb"">bugtì</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC; c]</itype><trans> <tr>swap</tr>, <tr>barter</tr> on a one-to-one basis. </trans>
