INSERT INTO `wced_entry` VALUES (3173, "bugtung", "154", "<entry page=""154"" id=""3173""><form id=""bugtung"" lang=""ceb"">bugtung</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>sole</tr>, <tr>lone</tr>. </trans>
