INSERT INTO `wced_entry` VALUES (3207, "buhi2", "157", "<entry page=""157"" id=""3207""><form id=""buxhiq2"" lang=""ceb"">búhì<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB12346; b6(1)]</itype><trans> set <tr>free</tr>, get free. </trans>
<eg><i lang=""ceb"">Kinsay nagbúhì nímu?</i><trans> Who freed you? </trans></eg>
<eg><i lang=""ceb"">Nakabuhì ang bigal sa tangkal,</i><trans> The sow escaped from the pen. </trans></eg>
<eg><i lang=""ceb"">Buhíi (buy-i) ang kanding,</i><trans> Set the goat free. </trans></eg>
<eg><i lang=""ceb"">Wà pa buhíi ang klási,</i><trans> The class has not been dismissed. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; b6]</itype><trans> <tr>release</tr> one’s hold on. </trans>
<eg><i lang=""ceb"">Maáyu siyang mubisiklíta kay mamúhì (manimúhì),</i><trans> He rides a bicycle well because he can let go. </trans></eg>
<eg><i lang=""ceb"">Buhíi (buy-i) ang ákung bag,</i><trans> Let go of my bag. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b]</itype><trans> </trans>
</sense>
<sense n=""3a""><number>3a</number><trans> release one’s emotions. </trans>
<eg><i lang=""ceb"">Gibuhían níya ang íyang paghílak,</i><trans> She let herself go crying. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number><trans> let a vehicle go to a certain speed. </trans>
<eg><i lang=""ceb"">Gibuhían kug utsinta ang mutursiklu,</i><trans> I let the motorcycle go up to eighty. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b]</itype><trans> spend money from a certain fund. </trans>
<eg><i lang=""ceb"">Walà pa buhíi ang sáping itúkud sa dálan,</i><trans> The money for the road has not been released yet. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A1; b(1)]</itype><trans> draw in a lottery. </trans>
<eg><i lang=""ceb"">Buhían ang rípa ugmà,</i><trans> The drawing of the lottery will be held tomorrow. </trans></eg>
</sense>
<sense n=""6""><number>6</number> <itype>[A; b6]</itype><trans> set off dynamite. </trans>
<eg><i lang=""ceb"">Gibuhían ug dinamíta ang duut,</i><trans> They set off dynamite on the school of fish. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> setting of s.t. free, esp. cocks in a fight. </trans>
<eg><i lang=""ceb"">Pila ka búhì ang ímung nadag-an?</i><trans> How many cockfights (lit. settings free) did you win? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> holding of a lottery. </trans>
</sense>
<sense n=""3""><number>3</number><trans> setting off of dynamite. </trans>
</sense></hom>
<entry><form id=""buhiq"" lang=""ceb""><abbr expan=""buhì"" type=""lemma"">(→)</abbr></form>
<hom>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#buxhiq"">= <sc>búhì</sc>, <ix>v 1, 2.</ix></xr> </trans>
</sense></hom></entry>
<entry><form id=""panimuxhiq"" lang=""ceb""><abbr expan=""panimúhì"" type=""lemma"">paniN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> <xr lang=""ceb"" target=""#buxhiq"">= <sc>búhì</sc>, <bx>2</bx>.</xr> </trans>
</sense></hom></entry>
<entry><form id=""binuhixan"" lang=""ceb""><abbr expan=""binuhían"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> animal that is let to go free. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>unrestrained</tr>. </trans>
<eg><i lang=""ceb"">Binuhían nga katáwa,</i><trans> Unrestrained laughter. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> fish caught by setting off dynamite. </trans>
</sense></hom></entry>
<entry><form id=""binuhian_binuy-an"" lang=""ceb""><abbr expan=""binuhian"" type=""lemma""><corr sic=""in-an(→)"">-in-an(→)</corr></abbr>, binuy-an</form>
<hom>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#in-an"">= <sc>in-an</sc>, <ix>1.</ix></xr> </trans>
</sense></hom></entry>
<entry><form id=""mamumuhiq"" lang=""ceb""><abbr expan=""mamumuhì"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fisherman who uses dynamite. </trans>
</sense></hom></entry>
<entry><form id=""pamuxhiq"" lang=""ceb""><abbr expan=""pamúhì"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>dismissal</tr> of a group. </trans>
</sense></hom></entry>
<entry><form id=""tingpamuxhiq"" lang=""ceb""><abbr expan=""tingpamúhì"" type=""lemma"">tingpaN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> dismissal time.
</trans>
</sense></hom></entry></entry>");
