INSERT INTO `wced_entry` VALUES (3217, "buhung", "158", "<entry page=""158"" id=""3217""><form id=""buhung"" lang=""ceb"">buhung</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> provided in <tr>abundance</tr>. </trans>
<eg><i lang=""ceb"">Buhung sa kalípay ang ámung kaminyúun,</i><trans> Our marriage had an abundance of happiness. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3P; a1]</itype><trans> supply s.t. in abundance. </trans>
<eg><i lang=""ceb"">Makabuhung (makapabuhung) nga panihápun,</i><trans> A sumptuous meal. </trans></eg>
<eg><i lang=""ceb"">Buhungun ta ka sa gugma,</i><trans> I’ll shower love on you. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b4]</itype><trans> be surfeited to the point of losing desire. </trans>
<eg><i lang=""ceb"">Gibunghan na kug kináug bábuy,</i><trans> I’m fed up with eating pork. </trans></eg>
</sense></hom>
<entry><form id=""kabuhung"" lang=""ceb""><abbr expan=""kabuhung"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> having things in abundance, <tr>affluence</tr>. </trans>
<eg><i lang=""ceb"">Laráwan sa kabuhung ang táwung adunáhan,</i><trans> A rich man is a picture of affluence.
</trans></eg>
</sense></hom></entry></entry>");
