INSERT INTO `wced_entry` VALUES (3220, "buka", "158", "<entry page=""158"" id=""3220""><form id=""buka"" lang=""ceb"">buka</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[APB3(1); bc1]</itype><trans> for the eyes or mouth to <tr>open</tr>, cause them to do so. </trans>
<eg><i lang=""ceb"">Ang kalisud mauy mibuka (mipabuka) sa íyang mga mata sa sayup nga íyang nahímù,</i><trans> Hardship opened his eyes to the error of his ways. </trans></eg>
<eg><i lang=""ceb"">Nakabuka na bang mga mata sa ituy?</i><trans> Are the puppies’ eyes opened yet? </trans></eg>
<eg><i lang=""ceb"">Bukha (ibuka) ang bàbà sa punaw,</i><trans> Open the mouth of the clam. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> for the earth to crack open, as in an <tr>earthquake</tr>. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b]</itype><trans> add width to space. </trans>
<eg><i lang=""ceb"">Bukhi (bukahi) ang balay,</i><trans> <tr>Widen</tr> the house. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>opening</tr>, <tr>aperture</tr>. </trans>
<eg><i lang=""ceb"">Buka sa pultahan,</i><trans> The amount the door is opened. </trans></eg>
</sense></hom>
<entry><form id=""buka_sa_balay"" lang=""ceb""><abbr expan=""buka"" type=""lemma"">—</abbr> sa balay</form>
<hom>
<sense n=""0""><trans> the width of the house (lit. the amount of opening between the sides).
</trans>
</sense></hom></entry></entry>");
