INSERT INTO `wced_entry` VALUES (3259, "bukiki", "159", "<entry page=""159"" id=""3259""><form id=""bukiqkiq"" lang=""ceb"">bukìkì</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> push things apart, esp. those which offer a certain amount of resistance. </trans>
<eg><i lang=""ceb"">Mibukìkì ku sa íyang pitákag may kwarta ba,</i><trans> I looked in his wallet to see if there was any money. </trans></eg>
<eg><i lang=""ceb"">Nagbukìkì ka ba sa mga pinusù?</i><trans> Have you pushed the husks <pb n=""160""/>of the ears aside to examine the grains? </trans></eg>
<eg><i lang=""ceb"">Bukìkía ang íyang buhuk kung náa bay kútu,</i><trans> Look in her hair if there are any lice. </trans></eg>
<eg><i lang=""ceb"">Ayaw ibukìkì ang ímung kamut sa kúgun,</i><trans> Don’t push the cogon grass apart with your hands. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>reopen</tr> a subject no longer discussed. </trans>
<eg><i lang=""ceb"">Gibukìkì ang íyang kagahápun sa kaatbang níya sa pulitika,</i><trans> His political rival brought up his past.
</trans></eg>
</sense></hom></entry>");
