<eg><i lang=""ceb"">Ibuklad (buklára) ning sáku didtu sa ínit arun mamala,</i><trans> Spread this sack out in the sun to dry. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> for a girl to grow to maidenhood (poetic). </trans>
</sense>
<sense n=""2b""><number>2b</number><trans> for a <tr>blossom</tr> to open. </trans>
<eg><i lang=""ceb"">Mingbuklad na ang mga rúsas,</i><trans> The roses are starting to open. </trans></eg>
