INSERT INTO `wced_entry` VALUES (3287, "bukul, bukul", "161", "<entry page=""161"" id=""3287""><form id=""bukul_buxkul"" lang=""ceb"">bukul, búkul</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>protruding lump</tr>. </trans>
<eg><i lang=""ceb"">Unsa nang bukul sa ímung úlu?</i><trans> What’s that lump on your head? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>lump</tr>, <tr>clump</tr>. </trans>
<eg><i lang=""ceb"">Búkul sa kan-un,</i><trans> Lump of rice. </trans></eg>
<eg><i lang=""ceb"">Búkul sa yútà,</i><trans> Lumps of soil. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B26; aP]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> get a lump. </trans>
<eg><i lang=""ceb"">Mibúkul ang úlu nga nabunalan,</i><trans> His head swelled where I had struck him. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> form lumps. </trans>
</sense></hom>
<entry><form id=""bukulbukul"" lang=""ceb"">bukulbukul</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B14]</itype><trans> be full of lumps. </trans>
<eg><i lang=""ceb"">Dautan ning litsi kay nagbukulbukul man,</i><trans> This milk is no good because it is full of lumps. </trans></eg>
</sense></hom></entry>
<entry><form id=""pamukul"" lang=""ceb""><abbr expan=""pamukul"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> for the breasts to develop in adolescence. </trans>
<eg><i lang=""ceb"">Unsa? Manarátu ka na nga wà pa ka gánì pamukli (pamukúli)?</i><trans> What is all this about boy friends when your breasts have not even started to develop?
</trans></eg>
</sense></hom></entry></entry>");
