INSERT INTO `wced_entry` VALUES (3293, "bukway", "161", "<entry page=""161"" id=""3293""><form id=""bukway"" lang=""ceb"">bukway</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for long, thin things to <tr>stretch out</tr>: tendrils, flowers, sunrays, etc. </trans>
<eg><i lang=""ceb"">Nagbukway na ang mga bánay sa mais,</i><trans> The corn tassels are spreading out now. </trans></eg>
<eg><i lang=""ceb"">Wà pa makabukway ang sílaw sa adlaw ug nakaligù na siya,</i><trans> He took his bath before the sun had spread its rays. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for the arms, tentacles to <tr>spread out</tr> and wave or wiggle. </trans>
<eg><i lang=""ceb"">Mibukway ang mga gaway sa kugíta pagkakitag kaáway,</i><trans> The octopus spread his tentacles in all directions when he spotted an enemy. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B1256]</itype><trans> in a game of <ix>takyan,</ix> to fail to hit the shuttlecock squarely and thus lose one’s turn to be served. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> taro shoots before they develop leaves. </trans>
</sense>
<sense n=""2""><number>2</number><trans> failure to return the serve in <ix>takyan.</ix>
</trans>
</sense></hom></entry>");
