INSERT INTO `wced_entry` VALUES (3297, "bula1", "161", "<entry page=""161"" id=""3297""><form id=""buxla"" lang=""ceb"">búla<sub>1</sub></form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>ball</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> game of ball. </trans>
</sense></hom>
<entry><form id=""buxla_dimaxnu"" lang=""ceb""><abbr expan=""búla"" type=""lemma"">—</abbr> dimánu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>cue ball</tr> in billiards. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> form s.t. into a ball. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A26; b6]</itype><trans> play a ball game. </trans>
</sense></hom></entry>
<entry><form id=""bulabuxla"" lang=""ceb"">bulabúla</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> make meat balls. </trans>
</sense>
<sense n=""2""><number>2</number><trans> be bounced around like a ball. </trans>
<eg><i lang=""ceb"">Ang sakayan gibulabúla sa dagkung balud,</i><trans> The boat was tossed about like a ball in the high seas. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> for several persons to maul s.o. bouncing him around among themselves. </trans>
