INSERT INTO `wced_entry` VALUES (3305, "bulad", "161", "<entry page=""161"" id=""3305""><form id=""bulad"" lang=""ceb"">bulad</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> stay out <tr>in the sun</tr>. </trans>
<eg><i lang=""ceb"">Nagbulad siya pagbantayg trák,</i><trans> He waited for the bus in the sun. </trans></eg>
<eg><i lang=""ceb"">Ayawg bulara (ibulad) nang bátà sa ínit,</i><trans> Don’t expose the child to the heat of the sun. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> dry s.t. in the sun. </trans>
<eg><i lang=""ceb"">Bulara (ibulad) ang kupras,</i><trans> Dry the copra. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A13; c1]</itype><trans> be, put out under the moon. </trans>
<eg><i lang=""ceb"">Nagbulad siya sa búlan nga nagdáru,</i><trans> He stayed out plowing under the moon. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; c1]</itype><trans> expose one’s body brazenly. </trans>
<eg><i lang=""ceb"">Láwas nga gibulad sa kadaghánan,</i><trans> A body exposed to public view. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A1; c1]</itype><trans> lay down an open card, <pb n=""162""/>esp. the starting card in a game. </trans>
<eg><i lang=""ceb"">Nakabulad na ang naglíbud,</i><trans> The dealer has opened. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> dried fish. </trans>
<eg><i lang=""ceb"">Bulad lay ámung isuwà,</i><trans> The only thing we have for lunch is dried fish. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> card laid open, esp. the starting card. </trans>
</sense></hom>
<entry><form id=""binlad_binulad"" lang=""ceb"">binlad, <abbr expan=""binulad"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> unhusked rice or corn set out to dry under the sun. </trans>
<eg><i lang=""ceb"">Naningáun ang manuk sa binlad,</i><trans> The chicken is feeding on the rice you have left out to dry.
</trans></eg>
</sense></hom></entry></entry>");
