INSERT INTO `wced_entry` VALUES (3309, "bulag", "162", "<entry page=""162"" id=""3309""><form id=""bulag"" lang=""ceb"">bulag</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2B2; bc]</itype><trans> separate from, get separated. </trans>
<eg><i lang=""ceb"">Adtu ku mubulag nímu sa iskína,</i><trans> I will leave you at the corner. </trans></eg>
<eg><i lang=""ceb"">Mibulag ang úlu sa íyang láwas,</i><trans> His head got cut off (separated from his body). </trans></eg>
<eg><i lang=""ceb"">Dílì siya bulagan ug basahun,</i><trans> She is never without s.t. to read (lit. left by reading matter). </trans></eg>
<eg><i lang=""ceb"">Ibulag ang anak sa inahan,</i><trans> Separate the child from the mother. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b(1)]</itype><trans> desist, cease doing s.t. </trans>
<eg><i lang=""ceb"">Wà siya mubulag paglìlì,</i><trans> He didn’t take his eye off the peephole. </trans></eg>
<eg><i lang=""ceb"">Bulagi nang bisyúha,</i><trans> Cease that vice of yours. </trans></eg>
</sense></hom>
<entry><form id=""buxlag"" lang=""ceb""><abbr expan=""búlag"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A123PC; a]</itype><trans> separate from each other, cause to separate. </trans>
<eg><i lang=""ceb"">Nagbúlag ang managtrátu,</i><trans> The engaged couple separated. </trans></eg>
<eg><i lang=""ceb"">Bulága ang hilawg hinug,</i><trans> Separate the unripe and the ripe ones. </trans></eg>
</sense></hom></entry>
<entry><form id=""hamulag_himulag"" lang=""ceb""><abbr expan=""hamulag"" type=""lemma"">haN-</abbr>/<abbr expan=""himulag"" type=""lemma"">hiN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a3]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> get separated from involuntarily. </trans>
<eg><i lang=""ceb"">Nahimuwag siya sa grúpu,</i><trans> He got separated from the group. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b8]</itype><trans> have s.o. close die (be left involuntarily). </trans>
<eg><i lang=""ceb"">Nahimulagan kami sa usa ka buuk anak,</i><trans> One of our children died.
</trans></eg>
</sense></hom></entry></entry>");
