INSERT INTO `wced_entry` VALUES (3312, "bulahan1", "162", "<entry page=""162"" id=""3312""><form id=""bulaxhan"" lang=""ceb"">buláhan<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> blessed, fortunate. </trans>
<eg><i lang=""ceb"">Buláhan ka sa mga babáyi nga tanan,</i><trans> Blessed art thou above all women. </trans></eg>
<eg><i lang=""ceb"">Buláhan ka kay dátù ka,</i><trans> You are fortunate because you are wealthy. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> in order to, so that. </trans>
<eg><i lang=""ceb"">Musulud tag sayu buláhan makaundang ug sayu,</i><trans> Let’s go to work early so we can quit early. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B126]</itype><trans> be fortunate, blessed. </trans>
<eg><i lang=""ceb"">Ang ákung anak ang mabuláhan ning ákung kasapían,</i><trans> My child will be benefited from my wealth. </trans></eg>
</sense></hom>
<entry><form id=""kabulaxhanan"" lang=""ceb""><abbr expan=""kabuláhanan"" type=""lemma"">ka-an</abbr></form>
