INSERT INTO `wced_entry` VALUES (3315, "bulak", "162", "<entry page=""162"" id=""3315""><form id=""buxlak"" lang=""ceb"">búlak</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>flower</tr>, <tr>blossom</tr>. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> <tr>woman</tr> (metaphor). </trans>
<eg><i lang=""ceb"">Ikaw ang búlak nga ákung gipangítà,</i><trans> You are the maid (lit. flower) I have been looking for. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> suit of cards. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> suit in mahjong composed of eight pieces which have pictures of flowers on them. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2345N; b6]</itype><trans> flower. </trans>
<eg><i lang=""ceb"">Mibúlak (namúlak) nang rúsas,</i><trans> The rose plant is flowering. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b]</itype><trans> put a flowery design on s.t. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B236N; b6]</itype><trans> get moldy. </trans>
<eg><i lang=""ceb"">Namúlak ang kan-un,</i><trans> The rice is all moldy. </trans></eg>
</sense></hom>
<entry><form id=""kabuxlak"" lang=""ceb""><abbr expan=""kabúlak"" type=""lemma"">ka-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> be bestrewn with flowers. </trans>
</sense></hom></entry>
<entry><form id=""bulakbuxlak"" lang=""ceb"">bulakbúlak</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> sweet things in life. </trans>
<eg><i lang=""ceb"">Bulakbúlak sa kinabúhì ang pagpanugal,</i><trans> Gambling adds spice to one’s life. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>flowery design</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> ad lib, cadenza in a musical piece. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[b(1)]</itype><trans> add spice to life. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A3; b6(1)]</itype><trans> add a flowery design. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b6(1)]</itype><trans> play ad lib music. </trans>
<eg><i lang=""ceb"">Nindut ang sunátang gibuwakbuwákan sa trumpíta,</i><trans> It was a beautiful song with the ad lib trumpet. </trans></eg>
</sense></hom></entry>
<entry><form id=""kabulakay"" lang=""ceb""><abbr expan=""kabulakay"" type=""lemma"">-ay(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> game of cards wherein a card is placed face up and bets are made as to the number of the next card of the same suit turned up. </trans>
</sense></hom>
