INSERT INTO `wced_entry` VALUES (3350, "bulbul", "164", "<entry page=""164"" id=""3350""><form id=""bulbul"" lang=""ceb"">bulbul</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>pubic hair</tr>. </trans>
</sense>
