INSERT INTO `wced_entry` VALUES (3361, "bulhut", "165", "<entry page=""165"" id=""3361""><form id=""bulhut"" lang=""ceb"">bulhut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> <tr>blow</tr> s.t. out of s.t. </trans>
<eg><i lang=""ceb"">Bulhúta ang kandílà,</i><trans> <tr>Blow out</tr> the candle. </trans></eg>
<eg><i lang=""ceb"">Gibulhútan aku níyag túbig,</i><trans> He spurted water at me from his mouth. </trans></eg>
<eg><i lang=""ceb"">Ibulhut nang asu,</i><trans> Puff out the smoke. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b1]</itype><trans> for the wind to blow. </trans>
<eg><i lang=""ceb"">Mibulhut ang amíhan,</i><trans> The northeast wind blew. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b]</itype><trans> treat a sickness, usually of stomach, by blowing cigar smoke on the affected area. </trans>
<eg><i lang=""ceb"">Bulhútan sa mananambal ang nagbutud kung tíyan,</i><trans> The folk doctor will blow smoke on my stomach because I have gas. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; c6P]</itype><trans> move at great speed. </trans>
</sense></hom>
<entry><form id=""Bulhut!"" lang=""ceb"">Bulhut!</form>
<hom>
<sense n=""0""><trans> Step on the gas! </trans>
<eg><i lang=""ceb"">Nakabulhut ug dágan ang kawatan,</i><trans> The thief ran away on the double. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> action of blowing. </trans>
</sense></hom></entry>
<entry><form id=""pabulhut"" lang=""ceb""><abbr expan=""pabulhut"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a2]</itype><trans> <tr>puff</tr> on a pipe or cigar. </trans>
</sense></hom></entry>
<entry><form id=""bulhutay"" lang=""ceb""><abbr expan=""bulhutay"" type=""lemma"">-ay</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> game involving blowing. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[c]</itype><trans> play this game.
</trans>
</sense></hom></entry></entry>");
