<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> buri palm: <bio>Corypha elata</bio>. The fibers from the unopened leaves are used in weaving hats, baskets, etc. It is also a source of toddy (<ix>guhang</ix>), vinegar, and sugar. The shoots are used as a vegetable and the trunk is a source of starch.
