INSERT INTO `wced_entry` VALUES (3395, "bulitsi", "166", "<entry page=""166"" id=""3395""><form id=""bulitsi"" lang=""ceb"">bulitsi</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. raffle with Spanish cards. One set of cards is spread out on the table for the bettors to place their bets on. Another set of the same cards are rolled up individually and inserted into a small metal cylinder. The cylinders are placed in a large metal drum, jumbled about, and one cylinder is drawn. The card in the cylinder drawn is the winner. There are variations using balls with numbers to replace the cards in the cylinders. Usually the dealer sings out verses while rolling the drum and waiting for the bettors to place their bets. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; b(1)]</itype><trans> play <ix>bulitsi.</ix>
</trans>
</sense></hom></entry>");
