INSERT INTO `wced_entry` VALUES (3400, "bulsa", "166", "<entry page=""166"" id=""3400""><form id=""bulsa"" lang=""ceb"">bulsa</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>pocket</tr>. </trans>
<eg><i lang=""ceb"">Rilu dibulsa,</i><trans> <tr>Pocket watch</tr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> cavity in a fishing net which holds the fish. </trans>
</sense>
<sense n=""3""><number>3</number><trans> an external pocket-like cavity s.w. on one’s person (said to bring good fortune to the possessor). </trans>
</sense>
<sense n=""4""><number>4</number> <form id=""isulud_sa_bulsa"" lang=""ceb"">isulud sa <abbr expan=""bulsa"" type=""lemma"">—</abbr></form><trans> fool s.o. into doing s.t. </trans>
<eg><i lang=""ceb"">Tuntúha dù. Dílì na ku nímu masulud sa bulsa,</i><trans> Don’t try to fool me, boy. You can’t pull anything on me. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> put a pocket, make into a pocket. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c16]</itype><trans> pocket dishonestly. </trans>
<eg><i lang=""ceb"">Ug ibulsa (bulsáhun) nímu ang ganansiya, sigúrung ikíha ka,</i><trans> If you pocket the profit, you surely will be brought to court. </trans></eg>
</sense></hom>
<entry><form id=""bulsaxhan"" lang=""ceb"">bulsáhan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having a pocket-like cavity on any part of the body. Such a person is believed likely to become rich.
</trans>
</sense></hom></entry></entry>");
