INSERT INTO `wced_entry` VALUES (3459, "bundak", "168", "<entry page=""168"" id=""3459""><form id=""bundak"" lang=""ceb"">bundak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> let s.t. <tr>fall</tr> with force. </trans>
<eg><i lang=""ceb"">Ngánung nabuak ang kúlun? Kinsay nagbundak niíni?</i><trans> Why is the clay pot broken? Who threw it down? </trans></eg>
<eg><i lang=""ceb"">Ayaw ibundak ang tilipunu,</i><trans> Don’t bang the telephone receiver down. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <form id=""bundak_sa_salaq"" lang=""ceb""><abbr expan=""bundak"" type=""lemma"">—</abbr> sa salà</form><trans> lay the <tr>blame</tr> on s.o. </trans>
<eg><i lang=""ceb"">Gibundákan siya sa salà nga dílì íya,</i><trans> They blamed him for s.t. that was not his fault. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> <tr>stomp</tr> one’s feet. </trans>
<eg><i lang=""ceb"">Ayaw bundáka (ibundak) ang tiil mug manáug ka sa hagdan,</i><trans> Don’t stomp your feet as you go downstairs. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[B346; b2]</itype><trans> for the rain to <tr>fall</tr> heavily. </trans>
<eg><i lang=""ceb"">Mibundak ang ulan,</i><trans> The rain came down in sheets. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number><trans> for s.t. heavy to come down by itself. </trans>
<eg><i lang=""ceb"">Mibundak ang gawang sa garáhi,</i><trans> The garage door came down with a bang. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b6(1)]</itype><trans> </trans>
</sense>
<sense n=""4a""><number>4a</number><trans> speak with a gruff voice. </trans>
<eg><i lang=""ceb"">Pinabundak ang tíngug, mitawag siya sa íyang suluguun,</i><trans> He called his servant in a sharp voice. </trans></eg>
</sense>
<sense n=""4b""><number>4b</number><trans> call s.o. by name with no title of respect. </trans>
<eg><i lang=""ceb"">Ayaw ibundak ang ngálan sa ímung magulang. Tawga siyag manang,</i><trans> <pb n=""169""/>Don’t just call your elder sister by name. Give her the title <ix>manang.</ix> </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>crashing</tr> down of s.t., stomping of feet. </trans>
</sense>
<sense n=""2""><number>2</number><trans> downpour.
</trans>
</sense></hom></entry>");
