INSERT INTO `wced_entry` VALUES (3482, "bungbung1", "169", "<entry page=""169"" id=""3482""><form id=""bungbung"" lang=""ceb"">bungbung<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>wall</tr> of a building. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>side</tr> covers of any box-like thing. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>enclose</tr> with, make into a wall. </trans>
<eg><i lang=""ceb"">Bungbúngi ang parul ug papil hapun,</i><trans> Put <corr sic=""tissue"">rice</corr> paper on the sides of the lantern. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for adverse weather or some other barrier to <tr>confine</tr> people s.w. </trans>
<eg><i lang=""ceb"">Ang bahà nga mibungbung námù sa tabuk,</i><trans> The flood that confined us to the opposite bank. </trans></eg>
<eg><i lang=""ceb"">Nabungbung sila sa isla tungud sa hángin,</i><trans> They were confined to the island because of the wind. </trans></eg>
</sense></hom>
<entry><form id=""pamungbung"" lang=""ceb""><abbr expan=""pamungbung"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> cut of meat underneath the short ribs, the plate.
