INSERT INTO `wced_entry` VALUES (3484, "bungdu1", "169", "<entry page=""169"" id=""3484""><form id=""bungduq"" lang=""ceb"">bungdù<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>pile</tr> or a <tr>heap</tr> of s.t., a <tr>mound</tr>. </trans>
<eg><i lang=""ceb"">Bungdù sa yútà,</i><trans> Pile of dirt. </trans></eg>
<eg><i lang=""ceb"">Ang bungdù sa sinsilyu sa lamísa,</i><trans> The pile of money on the table. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>grave</tr>. </trans>
<eg><i lang=""ceb"">Marmul ang bungdù ni Risal,</i><trans> Rizal’s grave is of marble. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> woman’s genitalia (humorous slang). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B3(1); a]</itype><trans> for s.t. to pile up or form a mound. </trans>
<eg><i lang=""ceb"">Nagbungdù ang dughan,</i><trans> She has bulging breasts. </trans></eg>
<eg><i lang=""ceb"">Dì makabungdù ang labhanan ug amnun,</i><trans> The laundry can’t pile up if you take care of it <pb n=""170""/>as it comes along. </trans></eg>
</sense></hom>
<entry><form id=""bungduun"" lang=""ceb""><abbr expan=""bungduun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>bulging outward</tr>.
