INSERT INTO `wced_entry` VALUES (3486, "bungdul", "170", "<entry page=""170"" id=""3486""><form id=""bungdul"" lang=""ceb"">bungdul</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab2c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> strike s.t. stationary by poking s.t. at it. </trans>
<eg><i lang=""ceb"">Bungdúla ang búnga ug dílì nímu masaka,</i><trans> Poke at the fruit if you can’t climb up to get it. </trans></eg>
<eg><i lang=""ceb"">Ibungdul ang ímung sungkud sa kisami arun sila muhílum,</i><trans> Knock your cane against the ceiling so they will shut up. </trans></eg>
