<sense n=""1""><number>1</number> <itype>[A3P; a]</itype><trans> break off s.t. rigid with pressure. </trans>
<eg><i lang=""ceb"">Hángin ang mibunggù sa mga sanga sa káhuy,</i><trans> The wind broke the branches off of the tree. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> reveal s.t. which s.o. had kept secret for a purpose. </trans>
<eg><i lang=""ceb"">Bunggùun ta kang dúna kay láing trátu ug ang ákung ig-ágaw ang ímung pangulitawhan,</i><trans> I’ll reveal that you already have a girl friend if you try to victimize my cousin.
</trans></eg>
</sense></hom></entry>");
