<sense n=""0""> <itype>[A; b6(1)]</itype><trans> tell malicious things about s.o. to s.o. else with a purpose. </trans>
<eg><i lang=""ceb"">May nagbunghug nákung gipamabáyi mu kunung ímung súhul,</i><trans> S.o. is trying to get me mad at you by telling me that you’re spending your salary on women. </trans></eg>
</sense></hom>
