INSERT INTO `wced_entry` VALUES (3493, "bungi", "170", "<entry page=""170"" id=""3493""><form id=""bungiq"" lang=""ceb"">bungì</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>harelip</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for a bottle or jar to have a chip in the mouth. </trans>
</sense>
<sense n=""3""><number>3</number><trans> for s.t. projecting to be broken off. </trans>
</sense></hom>
<entry><form id=""buxngiq"" lang=""ceb""><abbr expan=""búngì"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3P; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> make s.o. into a harelip. </trans>
</sense>
<sense n=""2""><number>2</number><trans> make a break in a mouth-like opening or dent in the front of s.t. </trans>
<eg><i lang=""ceb"">Siyay mibúngì (nagbúngì) sa awtu kay gidasmag sa pusti,</i><trans> He was the one who dented the front of the car when he smashed it against the post. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> break s.t. projecting off. </trans>
<eg><i lang=""ceb"">Ang inggranáhi gibungíag tangu,</i><trans> The gear had a tooth broken off it.
</trans></eg>
</sense></hom></entry></entry>");
