INSERT INTO `wced_entry` VALUES (3498, "bungkag", "170", "<entry page=""170"" id=""3498""><form id=""bungkag"" lang=""ceb"">bungkag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> take s.t. <tr>apart</tr>, <tr>break</tr> s.t. up into its constituent parts. </trans>
<eg><i lang=""ceb"">Kinsay nagbungkag sa rilu?</i><trans> Who took the watch apart? </trans></eg>
<eg><i lang=""ceb"">Bungkága ring písus,</i><trans> Change this peso bill. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> break up a group, <tr>disarrange</tr> s.t. in a group. </trans>
<eg><i lang=""ceb"">Kinsay nagbungkag sa ákung <corr sic=""sinína"">sinínà</corr>?</i><trans> Who disarranged my clothes that had been stacked nicely? </trans></eg>
<eg><i lang=""ceb"">Nakabungkag si Magsaysay sa mga Huks,</i><trans> Magsaysay broke up the Huk rebellion. </trans></eg>
<eg><i lang=""ceb"">Nabungkag ang tígum pag-ulan,</i><trans> The gathering broke up when it rained. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> break up a relationship. </trans>
<eg><i lang=""ceb"">Ikay nakabungkag sa ámung pagpuyù,</i><trans> You broke up our home. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <tr>arrange music</tr> (slang). </trans>
<eg><i lang=""ceb"">Ang <corr sic=""bítuls"">Bítuls</corr> ray magbungkag sa ílang kantáhun,</i><trans> The Beatles arrange their songs themselves. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> break the soil in a field that has never been cultivated or not cultivated for some time. </trans>
<eg><i lang=""ceb"">Nagbungkag siya sa kaíngin,</i><trans> He plowed the clearing in the forest. </trans></eg>
</sense></hom>
<entry><form id=""bungkagay"" lang=""ceb""><abbr expan=""bungkagay"" type=""lemma"">-ay</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> children’s game in which a bunch of rubber bands is separated. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12; c]</itype><trans> play this game.
</trans>
</sense></hom></entry></entry>");
