INSERT INTO `wced_entry` VALUES (3516, "bungun", "171", "<entry page=""171"" id=""3516""><form id=""buxngun"" lang=""ceb"">búngun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> space directly underneath the house or tree. </trans>
<eg><i lang=""ceb"">Ang kanding túa gihukut sa búngun,</i><trans> The goat is tethered under the house. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[c6]</itype><trans> put or place s.t. under s.t. else. </trans>
<eg><i lang=""ceb"">Gibúngun ba nímu ug tanum ang mga ságing sa mga lubi?</i><trans> Did you plant the bananas under the coconut trees?
</trans></eg>
</sense></hom></entry>");
