INSERT INTO `wced_entry` VALUES (3517, "bungut", "171", "<entry page=""171"" id=""3517""><form id=""buxngut"" lang=""ceb"">búngut</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>beard</tr>, <tr>mustache</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>pubic hairs</tr> (euphemism). </trans>
</sense>
<sense n=""3""><number>3</number><trans> <xr lang=""ceb"" target=""#bulbul"">= <sc>bulbul</sc>, 2.</xr> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[a4]</itype><trans> for a beard to grow on one. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> have pubic hairs (euphemism). </trans>
<eg><i lang=""ceb"">Gibúngut na lang mu piru magbinátà gihápun,</i><trans> You already have pubic hairs, but you are acting like children. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c]</itype><trans> put a beard on s.t. </trans>
</sense></hom>
<entry><form id=""pabuxngut"" lang=""ceb""><abbr expan=""pabúngut"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1]</itype><trans> allow one’s beard, mustache to grow. </trans>
</sense></hom></entry>
<entry><form id=""himuxngut"" lang=""ceb""><abbr expan=""himúngut"" type=""lemma"">hiN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> pluck or shave a beard or mustache. </trans>
</sense></hom></entry>
<entry><form id=""panghimuxngut"" lang=""ceb""><abbr expan=""panghimúngut"" type=""lemma"">panghiN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> pluck or shave one’s beard, mustache. </trans>
</sense></hom></entry>
<entry><form id=""bungutbungut"" lang=""ceb"">bungutbungut</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> wooly, hairy material. </trans>
</sense>
<sense n=""2""><number>2</number><trans> name given to grasses of waste places with numerous spikes: <bio>Chloris spp</bio>. </trans>
</sense></hom></entry>
<entry><form id=""bungutbuxngut"" lang=""ceb"">bungutbúngut</form>
<hom>
<sense n=""1""><number>1</number><trans> <xr lang=""ceb"" target=""#bungutbungut"">= <sc>bungutbungut</sc>, <bx>1</bx>.</xr> </trans>
</sense>
<sense n=""2""><number>2</number>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> tassel fish (<bio>Polynemus spp</bio>.), fishes with filamentous rays coming from under the head. </trans>
</sense></hom></entry>
<entry><form id=""buxngutan"" lang=""ceb""><abbr expan=""búngutan"" type=""lemma"">-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> general term for catfish. </trans>
</sense></hom></entry>
<entry><form id=""bungtan"" lang=""ceb"">bungtan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> name given to goat fish (<ix>timbúngan</ix>) with long barbels on the face. </trans>
</sense></hom></entry>
<entry><form id=""himuxngut"" lang=""ceb""><abbr expan=""himúngut"" type=""lemma"">hiN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. used to pluck or shave the beard or mustache. </trans>
</sense></hom></entry>
<entry><form id=""bungutun"" lang=""ceb""><abbr expan=""bungutun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> bearded. </trans>
</sense>
<sense n=""2""><number>2</number><trans> goon. </trans>
<eg><i lang=""ceb"">Mudagsang ang mga bungútun panahun sa piliay,</i><trans> There are goons in droves during elections. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1456]</itype><trans> be a goon. </trans>
</sense></hom></entry>
<entry><form id=""bungutbungutun"" lang=""ceb"">bungutbungutun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>hairy</tr>.
</trans>
</sense></hom></entry></entry>");
