INSERT INTO `wced_entry` VALUES (3557, "bun-ug1", "173", "<entry page=""173"" id=""3557""><form id=""bun-ug"" lang=""ceb"">bun-ug<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>bruise</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>expenses</tr>, loss of money (slang). </trans>
<eg><i lang=""ceb"">Pilay bun-ug nímu sa bangka gabíi?</i><trans> How much did you spend when you treated us? </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>bruised</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for a woman’s chastity to be ruined. </trans>
</sense>
<sense n=""3""><number>3</number><trans> s.t. which has been repeated till it bores. </trans>
<eg><i lang=""ceb"">Bun-ug nga áwit,</i><trans> A tired tune. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> misused, <tr>over-used</tr>. </trans>
<eg><i lang=""ceb"">Bun-ug nga pláka,</i><trans> A worn-out record. </trans></eg>
<eg><i lang=""ceb"">Bun-ug na ang bátà sa hináwuk,</i><trans> The baby was smothered with kisses. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1b2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> inflict bruises on. </trans>
<eg><i lang=""ceb"">Ayaw bun-úga ang kamátis,</i><trans> Don’t bruise the tomatoes. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> ruin a girl’s chastity.</trans>
<eg><i lang=""ceb""> Gibun-ug níya ang dalága únà bulagi,</i><trans> He robbed the girl of her chastity before he left her. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> cause s.o. to spend a large amount (slang). </trans>
<eg><i lang=""ceb"">Gibun-ug aku nílag dakù,</i><trans> They made me spend a heck of a lot. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B126]</itype><trans> <tr>over-use</tr>, <tr>misuse</tr>. </trans>
<eg><i lang=""ceb"">Dílì giyud undángag gámit ang makinilya hangtud dílì mabun-ug,</i><trans> He won’t stop using the typewriter until it gets completely broken. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <form id=""bun-ug_ang_hilaxnat"" lang=""ceb""><abbr expan=""bun-ug"" type=""lemma"">—</abbr> ang hilánat</form><trans> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; a12]</itype><trans> for fever to recur a number of times after partial recovery. </trans>
<eg><i lang=""ceb"">Mabun-ug ang hilánat nga dílì idiskansu,</i><trans> If you do not rest, your fever will recur. </trans></eg>
</sense>
<sense n=""6""><number>6</number> <form id=""bun-ug_ang_tulug"" lang=""ceb""><abbr expan=""bun-ug"" type=""lemma"">—</abbr> ang tulug</form><trans> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; a12]</itype><trans> for one’s sleep to get interrupted a number of times. </trans>
<eg><i lang=""ceb"">Nabun-ug ang ákung tulug sa paghilakhílak sa bátà kagabíi,</i><trans> My sleep was interrupted last night because the baby kept crying. </trans></eg>
</sense></hom>
<entry><form id=""mamumun-ug"" lang=""ceb""><abbr expan=""mamumun-ug"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who inflicts bruises.
</trans>
</sense></hom></entry></entry>");
