INSERT INTO `wced_entry` VALUES (3560, "bunul", "173", "<entry page=""173"" id=""3560""><form id=""buxnul"" lang=""ceb"">búnul</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>bruise</tr> s.t. </trans>
<eg><i lang=""ceb"">Ayaw bunúla ang kamátis,</i><trans> Don’t bruise the tomatoes. </trans></eg>
<eg><i lang=""ceb"">Nabúnul na ang íyang láwas,</i><trans> His body is badly bruised. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> make soil, clay, firm and compact. </trans>
<eg><i lang=""ceb"">Nabúnul na ang daruhan nga inyung giagían kanúnay,</i><trans> The field you keep walking over has become hard. </trans></eg>
</sense></hom>
<entry><form id=""bunul"" lang=""ceb""><abbr expan=""bunul"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> infected subcutaneous injury due to a blow. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B26]</itype><trans> for a bruise to become infected. </trans>
<eg><i lang=""ceb"">Nabunul ang ákung bun-ug,</i><trans> My bruise turned into a boil. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a4b4]</itype><trans> get an infected bruise. </trans>
<eg><i lang=""ceb"">Gibunul (gibunulan) ákung pálad,</i><trans> The palm of my hand got an infected bruise.
</trans></eg>
</sense></hom></entry></entry>");
