INSERT INTO `wced_entry` VALUES (3566, "bunut", "173", "<entry page=""173"" id=""3566""><form id=""buxnut"" lang=""ceb"">búnut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ab2]</itype><trans> pull s.t. that is in between s.t. </trans>
<eg><i lang=""ceb"">Hináyag búnut ang húnus,</i><trans> Pull the drawers out slowly. </trans></eg>
<eg><i lang=""ceb"">Ákung bunútun ang madyungan,</i><trans> I’ll draw a piece from the mahjong set. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> <tr>pull out</tr> s.t. rooted, stuck <pb n=""174""/>in s.t. </trans>
<eg><i lang=""ceb"">Bunúta ang lansang,</i><trans> Pull out the nail. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; c1]</itype><trans> pull s.t. out as if uprooting weeds. </trans>
<eg><i lang=""ceb"">Ayaw ibúnut (bunúta) pagkúhà ang igtalánum,</i><trans> Don’t just rip out the seedlings. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AC12; a]</itype><trans> draw a weapon. </trans>
<eg><i lang=""ceb"">Makigbúnut ku nímug pistulahay,</i><trans> I’ll duel you with pistols. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> action of drawing. </trans>
</sense></hom>
<entry><form id=""buxnut_laxbay"" lang=""ceb""><abbr expan=""búnut"" type=""lemma"">—</abbr> lábay</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> action of drawing and discarding what was drawn in a game in order to allow the game to continue without anyone’s dropping out. </trans>
</sense></hom></entry>
<entry><form id=""buxnut_madyung"" lang=""ceb""><abbr expan=""búnut"" type=""lemma"">—</abbr> madyung</form>
<hom>
<sense n=""0""><trans> in mahjong, the action of getting a piece which enables one to go mahjong. </trans>
</sense></hom></entry>
<entry><form id=""buxnut_panixngit"" lang=""ceb""><abbr expan=""búnut"" type=""lemma"">—</abbr> paníngit</form>
<hom>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#singit""><ix>see</ix> <sc>singit</sc>.</xr> </trans>
</sense></hom></entry>
<entry><form id=""buxnut_supu"" lang=""ceb""><abbr expan=""búnut"" type=""lemma"">—</abbr> supu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> manner of betting in mahjong whereby a player bets that his next draw will cause s.o. (himself or any other player) to get mahjong. </trans>
</sense>
<sense n=""2""><number>2</number><trans> amount bet in this manner of betting.
</trans>
</sense></hom></entry></entry>");
