<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> go s.w. in a <tr>roundabout</tr>, not direct way. </trans>
<eg><i lang=""ceb"">Muburdu ta arun dì ta masagatà sa mga buguy,</i><trans> Let’s go round about so we don’t run into the ruffians. </trans></eg>
<eg><i lang=""ceb"">Iburdu (burdúhun) ang prusisyun sa tibuuk lungsud,</i><trans> They will take the procession around the whole town. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> for a sailboat to go at a zigzag or diagonal course to ride against the wind. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>roam</tr>, <tr>walk about</tr>. </trans>
<eg><i lang=""ceb"">Nagburdu silag panangkù,</i><trans> They went out to steal palm toddy. </trans></eg>
<eg><i lang=""ceb"">Iburdu ning mga tinda,</i><trans> Go around to sell these goods.
</trans></eg>
</sense></hom></entry>");
