INSERT INTO `wced_entry` VALUES (3617, "burus", "175", "<entry page=""175"" id=""3617""><form id=""burus"" lang=""ceb"">burus</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>pregnant</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for rice to form grains in the panicle. </trans>
</sense>
<sense n=""3""><number>3</number><trans> for borrowed things to have been kept too long. </trans>
<eg><i lang=""ceb"">Burus na ang librung ímung gihuwaman,</i><trans> You’ve kept the book you borrowed till it got pregnant. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; b6]</itype><trans> be, become pregnant. </trans>
<eg><i lang=""ceb"">Patakáling anay arun muburus (maburus),</i><trans> Mate the sow so she will become pregnant. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <form id=""burus_sa_pasaxlig"" lang=""ceb""><abbr expan=""burus"" type=""lemma"">—</abbr> sa pasálig</form><trans> be fooled by assurances. </trans>
<eg><i lang=""ceb"">Daghan na ang miburus sa pasálig niánang pulitiku,</i><trans> Lots of people have been fooled by the promises of that politician. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A1; c]</itype><trans> have in one’s womb. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B; b6]</itype><trans> for rice to form in the panicle. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[B]</itype><trans> keep borrowed things too long.
</trans>
</sense></hom></entry>");
