INSERT INTO `wced_entry` VALUES (3618, "burut", "175", "<entry page=""175"" id=""3618""><form id=""buxrut"" lang=""ceb"">búrut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2S3]</itype><trans> <tr>inflate</tr>, <tr>swell</tr>, esp. into a rounded shape. </trans>
<eg><i lang=""ceb"">Mibúrut ang láyag sa sakayan,</i><trans> The sail of the boat billowed out. </trans></eg>
<eg><i lang=""ceb"">Pistúla nang nagburut sa íyang kílid,</i><trans> That is a <pb n=""176""/>pistol that is bulging at his side. </trans></eg>
<eg><i lang=""ceb"">Butangig yílu ang bun-ug arun dì makabúrut,</i><trans> Put ice on the bruise so it won’t swell. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B246]</itype><trans> be, become pregnant (slang). </trans>
<eg><i lang=""ceb"">Mibúrut nang ákung asáwa,</i><trans> My wife is pregnant. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B46]</itype><trans> be, become rich (slang). </trans>
<eg><i lang=""ceb"">Mubúrut kag dalig mag-ismaglir ka,</i><trans> You’ll soon get rich if you engage in smuggling. </trans></eg>
</sense></hom>
<entry><form id=""pabuxrut"" lang=""ceb""><abbr expan=""pabúrut"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> blow s.t. up, make s.t. swell. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>flatter</tr>, <tr>inflate</tr> s.o.’s pride. </trans>
<eg><i lang=""ceb"">Nagpabúrut na sad siya sa íyang kaugalíngun,</i><trans> He is blowing himself up again. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>balloon</tr>. </trans>
</sense></hom></entry>
<entry><form id=""burutburut"" lang=""ceb"">burutburut</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> crevalles with a pronounced curve outward on the ventral portion: <bio>Caranx gymnostethoides</bio>.
</trans>
</sense></hom></entry></entry>");
