<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b5]</itype><trans> <tr>break open</tr> a sack or the like that is filled. </trans>
<eg><i lang=""ceb"">Nabusdik ang balun,</i><trans> The balloon burst.</trans></eg>
<eg><i lang=""ceb""> Busdíki ang sáku. Tan-áwa kun unsay klási sa humay,</i><trans> Punch a hole in the sack and see what k.o. rice it is. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b126]</itype><trans> be filled to satiety. </trans>
<eg><i lang=""ceb"">Makabusdik giyud ang inyung gidálit,</i><trans> You served a most filling dinner. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> full to bursting after eating.
</trans>
</sense></hom></entry>");
