INSERT INTO `wced_entry` VALUES (3640, "busi", "176", "<entry page=""176"" id=""3640""><form id=""buxsi"" lang=""ceb"">búsi</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> <tr>survive</tr>, last to be of some value. </trans>
<eg><i lang=""ceb"">Dílì mabúsi ang kaminyúung way pagsinabtanay,</i><trans> A marriage without understanding cannot survive. </trans></eg>
<eg><i lang=""ceb"">Usa ray nabúsi sa mga baktin,</i><trans> Only one piglet survived. </trans></eg>
<eg><i lang=""ceb"">Way mabúsi sa íyang swildu kay gastadur,</i><trans> Nothing is left of his salary because he is a spendthrift. </trans></eg>
<eg><i lang=""ceb"">Dílì mabúsi ang trabáhung biyàbiyáan,</i><trans> Work that you don’t keep after will not result in anything.
</trans></eg>
</sense></hom></entry>");
