INSERT INTO `wced_entry` VALUES (3647, "busisi", "177", "<entry page=""177"" id=""3647""><form id=""busiqsiq"" lang=""ceb"">busìsì</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> make a <tr>laceration</tr>, esp. in a surface that is tight due to fullness. </trans>
<eg><i lang=""ceb"">Busìsíun sa duktur ímung hubag,</i><trans> The doctor will slit your boil. </trans></eg>
<eg><i lang=""ceb"">Busìsía ang sáku arun muágas ang humay,</i><trans> Slit the sack so the rice will spill. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> lay out in the open some malicious gossip that has long lain buried. </trans>
<eg><i lang=""ceb"">Gibusìsì níya ang húgawng kagahápun sa íyang kaáway,</i><trans> He dug out the dirty secrets of his enemy’s past. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> <tr>pressure</tr> s.o. to speed up work. </trans>
<eg><i lang=""ceb"">Busìsía siya arun mahuman,</i><trans> Hurry her up so it will get done. </trans></eg>
</sense></hom>
<entry><form id=""busiqsixru"" lang=""ceb"">busìsíru</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> always putting pressure on people to speed up the work.
</trans>
</sense></hom></entry></entry>");
