INSERT INTO `wced_entry` VALUES (3650, "buskag", "177", "<entry page=""177"" id=""3650""><form id=""buskag"" lang=""ceb"">buskag</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB26; a]</itype><trans> <tr>undo</tr>, <tr>untie</tr> s.t., esp. so that the contents spread; for s.t. wrapped or tied up to open. </trans>
<eg><i lang=""ceb"">Mibuskag ang tákung ug migímaw ang mga bungul sa lubi,</i><trans> The coconut sheath opened and its buds spread out beneath. </trans></eg>
<eg><i lang=""ceb"">Nabuskag ang íyang bálun,</i><trans> His lunch broke open allowing the contents to spread out. </trans></eg>
<eg><i lang=""ceb"">Makabuskag ka ba sa balitùtù?</i><trans> Can you untie the knot? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for hair neatly groomed to get <tr>dishevelled</tr>. </trans>
<eg><i lang=""ceb"">Nabuskag íyang hinápay sa hángin,</i><trans> Her hair got all dishevelled in the wind. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> expose s.o.’s secret. </trans>
<eg><i lang=""ceb"">Akuy mubuskag sa makauúlaw mung tinagúan,</i><trans> I will expose your shameful secret.
</trans></eg>
</sense></hom></entry>");
