INSERT INTO `wced_entry` VALUES (3652, "buslung", "177", "<entry page=""177"" id=""3652""><form id=""buslung"" lang=""ceb"">buslung</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; ab5]</itype><trans> <tr>look at</tr> s.t. squarely without hiding that one is looking. </trans>
<eg><i lang=""ceb"">Si Ána ra giyuy nakabuslung kay nag-antipára mag dikulur,</i><trans> Ana was the only one who was able to get a good look because she was wearing dark glasses. </trans></eg>
<eg><i lang=""ceb"">Buslungi (buslunga) arun makahibalu mug unsay riaksiyun níya,</i><trans> Look at him square in the face so you will see what his reaction is.
</trans></eg>
</sense></hom></entry>");
