INSERT INTO `wced_entry` VALUES (3680, "butang1", "179", "<entry page=""179"" id=""3680""><form id=""butang"" lang=""ceb"">butang<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> put down, in, on. </trans>
<eg><i lang=""ceb"">Ikaw bay mubutang sa ákung lip-istik?</i><trans> Will you put my lipstick on me? </trans></eg>
<eg><i lang=""ceb"">Butangan nátug utlánan ang átung pagkaamígu,</i><trans> Let’s set limits to our friendship. </trans></eg>
<eg><i lang=""ceb"">Súkang gibutangag lamas,</i><trans> Vinegar with spices put in it. </trans></eg>
<eg><i lang=""ceb"">Ibutang nà,</i><trans> Put that down. </trans></eg>
<eg><i lang=""ceb"">Ibutang sa lista ang ákung útang,</i><trans> Put my debts in the list. </trans></eg>
<eg><i lang=""ceb"">Walà ikabutang si Lína sa bayli,</i><trans> Lena could not sit down at the dance. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> pay for s.t. in advance. </trans>
<eg><i lang=""ceb"">Arun dílì ibaligyag láin gibutangan kug diyis,</i><trans> I put ten down so that he wouldn’t sell it to anyone else. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> put up money or goods for the harvest or anything else produced. </trans>
<eg><i lang=""ceb"">Magbutang kug panaptun pára sa panúig,</i><trans> I put up cloth to be repaid from the harvest. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> put up capital, money for a bond. </trans>
<eg><i lang=""ceb"">Usa ka líbu ákung gibutang sa tindáhan,</i><trans> I invested one thousand in the store. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <form id=""ibutang_ta_naxtuq"" lang=""ceb"">ibutang ta, nátù</form><trans> supposing it’s like this way. </trans>
<eg><i lang=""ceb"">Ibutang tag kinyintus, palitun ba nímu?</i><trans> Let’s say it’s 500 pesos. Will you buy it? </trans></eg>
</sense>
<sense n=""4""><number>4</number> <form id=""ibutang_sa_lugar"" lang=""ceb"">ibutang sa lugar</form><trans> do at the proper time. </trans>
<eg><i lang=""ceb"">Ibutang sa lugar ang pag-inum,</i><trans> Drink at the proper time. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A; b]</itype><trans> hit. </trans>
<eg><i lang=""ceb"">Butangan ku siya sa nawung,</i><trans> I will hit him in the face. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> money put down as advance payment. </trans>
</sense></hom>
<entry><form id=""butangbutang"" lang=""ceb"">butangbutang</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> make false accusations. </trans>
<eg><i lang=""ceb"">Gibutangbutángan ba ku nímung nangáwat?</i><trans> Are you trying to accuse me of stealing? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> false accusations. </trans>
</sense></hom></entry>
<entry><form id=""pamutang"" lang=""ceb""><abbr expan=""pamutang"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> put things. </trans>
</sense>
<sense n=""2""><number>2</number><trans> put s.t. on oneself. </trans>
<eg><i lang=""ceb"">Mamutang kug lip-istik,</i><trans> I will put lipstick on. </trans></eg>
</sense></hom></entry>
<entry><form id=""himutang_hamutang_himuxtang_hamuxtang"" lang=""ceb""><abbr expan=""himutang"" type=""lemma"">hiN-</abbr>/<abbr expan=""hamutang"" type=""lemma"">haN-</abbr>, <abbr expan=""himútang"" type=""lemma"">hiN-</abbr>/<abbr expan=""hamútang"" type=""lemma"">haN-(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AP1B1256; b6]</itype><trans> be situated, located. </trans>
<eg><i lang=""ceb"">Si Bíbi naghimútag (nagpahimútag) lingkud sa silya,</i><trans> Bebe settled down comfortably in the chair. </trans></eg>
<eg><i lang=""ceb"">Ang ílang balay náa mahimutang sa ámung duul,</i><trans> Their house is situated near ours. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1256]</itype><trans> be classified as. </trans>
<eg><i lang=""ceb"">Kining suwáta mahimutang sa sikun klas,</i><trans> This letter is classified as second class. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B1256]</itype><trans> be in peace. </trans>
<eg><i lang=""ceb"">Dílì ku mahimutang hangtud dílì mahuman ang ákung trabáhu,</i><trans> I won’t be in peace until I finish my work. </trans></eg>
</sense></hom></entry>
<entry><form id=""pahimuxtang_pahamuxtang"" lang=""ceb""><abbr expan=""pahimútang"" type=""lemma"">pahiN-</abbr>/<abbr expan=""pahamútang"" type=""lemma"">pahaN-(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> put s.t. s.w. carefully. </trans>
<eg><i lang=""ceb"">Gipahimútang ang mga pagkáun sa pridyidir,</i><trans> The food was put away carefully in the frigidaire. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> place s.o. in a job. </trans>
<eg><i lang=""ceb"">Gipahimútang siya sa munisipyu,</i><trans> He was given a job in City hall. </trans></eg>
</sense></hom></entry>
<entry><form id=""pahamtang"" lang=""ceb"">pahamtang</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> impose a punishment. </trans>
<eg><i lang=""ceb"">Pahamtángan kag bug-at nga sílut,</i><trans> Heavy punishment will be imposed on you. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b]</itype><trans> spend money on s.t. </trans>
<eg><i lang=""ceb"">Unsay ímung gipahamtángan sa ímung sápì?</i><trans> What did you spend your money on? </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b6(1)]</itype><trans> make charges or accusations, usually maliciously. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>punishment</tr> imposed. </trans>
</sense>
<sense n=""2""><number>2</number><trans> malicious accusation made against s.o. </trans>
<eg><i lang=""ceb"">Ang ílang mga pahamtang kanákù walay kapasikáran,</i><trans> Their charges against me are without basis. </trans></eg>
</sense></hom></entry>
<entry><form id=""butangixru"" lang=""ceb"">butangíru</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>ruffian</tr>, <tr>toughie</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kabutang"" lang=""ceb""><abbr expan=""kabutang"" type=""lemma"">ka-</abbr></form>
<hom>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#pagka-_2_3"">= <sc><abbr expan=""pagkabutang"" type=""lemma"">pagka-</abbr> 2, 3</sc>.</xr> </trans>
</sense></hom></entry>
<entry><form id=""kahimtang"" lang=""ceb"">kahimtang</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> way things are, situation. </trans>
<eg><i lang=""ceb"">Pait ang kahimtang sa ámù human sa bagyu,</i><trans> Very difficult conditions obtained in our town after the typhoon. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>circumstances</tr>. </trans>
<eg><i lang=""ceb"">Ang kahimtang sa kásu,</i><trans> The circumstances surrounding the case. </trans></eg>
</sense></hom></entry>
<entry><form id=""pagkabutang"" lang=""ceb""><abbr expan=""pagkabutang"" type=""lemma"">pagka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> way s.t. is situated. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>financial situation</tr>. </trans>
<eg><i lang=""ceb"">Lisud ang ámung pagkabutang karun,</i><trans> We are in a bad financial situation now. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> one’s <tr>situation</tr> in general. </trans>
</sense>
<sense n=""4""><number>4</number> <form id=""unsang_pagkabutaxnga"" lang=""ceb"">unsang <abbr expan=""pagkabutánga"" type=""lemma"">-a</abbr></form><trans> how did it come about. </trans>
<eg><i lang=""ceb"">Naunsang pagkabutánga nga wà ka mamatay?</i><trans> How did it come to be that you didn’t die?†
</trans></eg>
</sense></hom></entry></entry>");
