INSERT INTO `wced_entry` VALUES (3719, "butsaka", "180", "<entry page=""180"" id=""3719""><form id=""butsaxka"" lang=""ceb"">butsáka</form>
<hom>
<sense n=""0""><trans> term used in playing pool for a certain agreed-to score, where part of the score is made by drawing a numbered marble. </trans>
