<eg><i lang=""ceb"">Way daug, way pildi námù, butsáka ra mi,</i><trans> Neither of us lost; we came out even. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2N]</itype><trans> get even in this k.o. pool. </trans>
</sense>
