INSERT INTO `wced_entry` VALUES (3725, "butu1", "181", "<entry page=""181"" id=""3725""><form id=""butu"" lang=""ceb"">butu<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>explosion</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>blister</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B246; b4]</itype><trans> <tr>explode</tr>. </trans>
<eg><i lang=""ceb"">Mibutu ang bulkan nga Taal,</i><trans> Taal Volcano erupted. </trans></eg>
<eg><i lang=""ceb"">Ug buthan kag ligid may ikarisirba ka?</i><trans> In case you have a blowout, do you have a spare tire? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A23]</itype><trans> for s.t. to swell and <tr>rupture</tr>. </trans>
<eg><i lang=""ceb"">Mibutu ang íyang hubag,</i><trans> His boil burst. </trans></eg>
<eg><i lang=""ceb"">Wà pa mubutu ang tumatub,</i><trans> Her bag of waters hasn’t broke yet. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A23]</itype><trans> fall or hit s.t. with a bang. </trans>
<eg><i lang=""ceb"">Ang libru mibutu sa salug,</i><trans> The book fell to the floor with a bang. </trans></eg>
<eg><i lang=""ceb"">Mubutu ka rug suntúkun ka nákù,</i><trans> I’ll bang you one when I hit you. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[b4]</itype><trans> <tr>get blisters</tr>. </trans>
<eg><i lang=""ceb"">Nabuthan ákung pálad pagbinughà,</i><trans> I got blisters on my palms from chopping wood. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[B246]</itype><trans> <tr>flunk</tr> an exam, esp. board or bar. </trans>
<eg><i lang=""ceb"">Mibutu siya sa bar,</i><trans> He failed the bar. </trans></eg>
</sense>
<sense n=""6""><number>6</number> <itype>[A2]</itype><trans> give birth (humorous). </trans>
</sense></hom>
<entry><form id=""pabutu"" lang=""ceb""><abbr expan=""pabutu"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> <tr>fire</tr>, make s.t. explode. </trans>
<eg><i lang=""ceb"">Pabutha ang ripli,</i><trans> Fire the rifle. </trans></eg>
<eg><i lang=""ceb"">Daghang kug ribintadur nga ipabutu sa Bag-ung Túig,</i><trans> I have lots of firecrackers to explode for New Year’s. </trans></eg>
</sense></hom></entry>
<entry><form id=""pamutu"" lang=""ceb""><abbr expan=""pamutu"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b4]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> get blisters. </trans>
<eg><i lang=""ceb"">Namutu ang ákung pálad,</i><trans> My palms were blistered. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> get one’s just deserts after accumulating too much wealth, esp. illegally or at the expense of others. </trans>
<eg><i lang=""ceb"">Mamutu ka bayà sa kataas niánang ímung tantu,</i><trans> You’ll get your just deserts from charging such usurious rates of interest. </trans></eg>
</sense></hom></entry>
<entry><form id=""buthanan"" lang=""ceb"">buthanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> head of a boil.†
</trans>
</sense></hom></entry></entry>");
