INSERT INTO `wced_entry` VALUES (3733, "butuk", "181", "<entry page=""181"" id=""3733""><form id=""buxtuk"" lang=""ceb"">bútuk</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2346]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for a burn to form a blister. </trans>
<eg><i lang=""ceb"">Mibútuk ang ákung pánit nga nalaswaan sa nagbukal nga mantíkà,</i><trans> My skin was blistered when the boiling fat splashed on it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for rice or corn or pork to swell in cooking or for dough to rise. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A]</itype><trans> for rice or corn to boil gently with a low simmering sound when the water is practically gone. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[B2]</itype><trans> for the grains of rice or corn to get soft after cooking. </trans>
<eg><i lang=""ceb"">Walà pa makabútuk ug maáyu ang mais, maung adúna pa kiniy lísu,</i><trans> The corn grits didn’t get soft and so they still have uncooked grains in the middle. </trans></eg>
</sense></hom>
<entry><form id=""butukbutuk"" lang=""ceb"">butukbutuk</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> make a throbbing, bubbling sound. </trans>
<eg><i lang=""ceb"">Nagbutukbutuk ang linung-ag nga hápit na mahubas,</i><trans> The rice made a popping sound as it was about to evaporate. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <xr lang=""ceb"" target=""#x-in-"">= <sc><abbr expan=""binútuk"" type=""lemma"">-in-</abbr></sc>.</xr> </trans>
</sense></hom></entry>
<entry><form id=""binuxtuk"" lang=""ceb""><abbr expan=""binútuk"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> throbbing, bubbling sound. </trans>
<eg><i lang=""ceb"">Binutukbutuk sa kasingkásing,</i><trans> Throbbing of the heart.
</trans></eg>
</sense></hom></entry></entry>");
