INSERT INTO `wced_entry` VALUES (3744, "buug", "182", "<entry page=""182"" id=""3744""><form id=""buxug"" lang=""ceb"">búug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> </trans>
