<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> an <tr>infection</tr> characterized by a smelly yellow pus. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a4]</itype><trans> get this infection. </trans>
