INSERT INTO `wced_entry` VALUES (3760, "buwa2", "183", "<entry page=""183"" id=""3760""><form id=""buxwaq2"" lang=""ceb"">búwà<sub>2</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>prolapsed uterus</tr>. </trans>
