INSERT INTO `wced_entry` VALUES (3781, "buylug", "184", "<entry page=""184"" id=""3781""><form id=""buylug"" lang=""ceb"">buylug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b7]</itype><trans> <tr>speed</tr>, <tr>rush</tr> forward. </trans>
<eg><i lang=""ceb"">Mibuylug ang túbig pagkagubà sa liptung,</i><trans> The water gushed out when the dam broke. </trans></eg>
<eg><i lang=""ceb"">Buylúgi (pabuylúgi) arun makaapas ta níla,</i><trans> Give it more speed so we can catch up with them. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fast, onrushing forward speed. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
