INSERT INTO `wced_entry` VALUES (3784, "buynu", "184", "<entry page=""184"" id=""3784""><form id=""buynu"" lang=""ceb"">buynu</form>
<hom>
<sense n=""1""><number>1</number><trans> <ix>particle conceding a situation:</ix> ‘well’. </trans>
<eg><i lang=""ceb"">Buynu, ug dì ka, ay na lang,</i><trans> Well, if you don’t want to, you don’t have to. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <ix>particle terminating a conversation:</ix> ‘well, all right now’. </trans>
<eg><i lang=""ceb"">Buynu, mau na lang tu. Dad-a dinhi ugmà,</i><trans> Well, that’s all. Bring it here tomorrow. </trans></eg>
<eg><i lang=""ceb"">Buynu, sanggía ang mais ugmà,</i><trans> All right. Harvest the corn tomorrow. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> particle in a story preceding a summary of the situation. </trans>
<eg><i lang=""ceb"">Buynu, kay nakapangasáwa sa prinsísa, siyay nahímung manunúnud,</i><trans> All right, since he married the princess, he became the heir to the throne.
</trans></eg>
</sense></hom></entry>");
