INSERT INTO `wced_entry` VALUES (3786, "buysit", "184", "<entry page=""184"" id=""3786""><form id=""buysit"" lang=""ceb"">buysit</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>bad luck</tr> that is permanently associated with a person or thing. </trans>
<eg><i lang=""ceb"">Kanang ímung nawung mau rag mauy nagdala sa buysit,</i><trans> Your face brings bad luck with it. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having bad luck associated with it. </trans>
<eg><i lang=""ceb"">Buysit kining baláya. Pirming kamatyan,</i><trans> This house brings us bad luck. Lots of people have died here. <ix>interjection</ix> </trans></eg>
<eg><i lang=""ceb"">Buysit! Gikuútan ku,</i><trans> Damned! S.o. picked my pocket. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> be constantly <tr>beset</tr> by bad luck. </trans>
<eg><i lang=""ceb"">Nabuysit ákung panágat human nákù mapatay ang íhung putì,</i><trans> My fishing was beset by misfortune after I killed the white shark.
</trans></eg>
</sense></hom></entry>");
