INSERT INTO `wced_entry` VALUES (3809, "bwilta", "185", "<entry page=""185"" id=""3809""><form id=""bwilta"" lang=""ceb"">bwilta</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b5c]</itype><trans> <tr>come</tr>, <tr>go back</tr>, go back to get s.t. </trans>
<eg><i lang=""ceb"">Ákù pang bwiltáhun (bwiltáhan) si Míri,</i><trans> I still have to go back for Mary. </trans></eg>
<eg><i lang=""ceb"">Ibwilta ni ngadtu,</i><trans> Take this back to them. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c1]</itype><trans> <tr>repeat</tr>, do again. </trans>
<eg><i lang=""ceb"">Bwiltáhun (ibwilta) ta nig pangutána,</i><trans> Let’s ask that again. </trans></eg>
</sense></hom>
<entry><form id=""bwiltabwilta"" lang=""ceb"">bwiltabwilta</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b5]</itype><trans> go <tr>back</tr> and <tr>forth</tr>. </trans>
<eg><i lang=""ceb"">Mubwiltabwilta ka giyud kay dílì makas-a nag dala,</i><trans> You have to go back and forth because you cannot take all of that at once. </trans></eg>
<eg><i lang=""ceb"">Ngánung nagbwiltabwilta ka man, unsay suliran mu?</i><trans> Why are you pacing back and forth? What’s your problem? </trans></eg>
</sense></hom></entry>
<entry><form id=""idabwilta"" lang=""ceb""><abbr expan=""idabwilta"" type=""lemma"">ida-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>round trip</tr>. </trans>
<eg><i lang=""ceb"">Milukat ku ug tíkit sa barku nga idabwilta,</i><trans> I bought a round trip boat ticket.
</trans></eg>
</sense></hom></entry></entry>");
