INSERT INTO `wced_entry` VALUES (3812, "byahi", "185", "<entry page=""185"" id=""3812""><form id=""byaxhi"" lang=""ceb"">byáhi</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> trip, <tr>journey</tr>. </trans>
<eg><i lang=""ceb"">Bálud tung byahía uy!</i><trans> That was a rough trip. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>trip</tr>, single run of a vehicle between two points. </trans>
<eg><i lang=""ceb"">Alas dúsi ang katapúsang byáhi,</i><trans> The last trip is at twelve. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> <tr>take a trip</tr>. </trans>
<eg><i lang=""ceb"">Nagbyáhi sila sa Amirika,</i><trans> They took a trip to America. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> for a public conveyance to make its run. </trans>
<eg><i lang=""ceb"">Ayaw ibyáhi ang dyip ug dì pa punù,</i><trans> Don’t dispatch the jeep before it is full. </trans></eg>
</sense></hom>
<entry><form id=""byahian"" lang=""ceb"">byahian</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> take a <tr>run</tr> s.w. regularly. </trans>
</sense></hom></entry>
<entry><form id=""byahidur"" lang=""ceb"">byahidur</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who <tr>travels</tr> often. †
